ntain a given URL.\";'),('en','messages:apihelp-query+filearchive-example-simple','s:33:\"Show a list of all deleted files.\";'),('en','messages:apihelp-query+filearchive-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+filearchive-param-from','s:42:\"The image title to start enumerating from.\";'),('en','messages:apihelp-query+filearchive-param-limit','s:35:\"How many images to return in total.\";'),('en','messages:apihelp-query+filearchive-param-prefix','s:55:\"Search for all image titles that begin with this value.\";'),('en','messages:apihelp-query+filearchive-param-prop','s:31:\"Which image information to get:\";'),('en','messages:apihelp-query+filearchive-param-sha1','s:43:\"SHA1 hash of image. Overrides $1sha1base36.\";'),('en','messages:apihelp-query+filearchive-param-sha1base36','s:50:\"SHA1 hash of image in base 36 (used in MediaWiki).\";'),('en','messages:apihelp-query+filearchive-param-to','s:39:\"The image title to stop enumerating at.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-archivename','s:65:\"Adds the filename of the archive version for non-latest versions.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-bitdepth','s:34:\"Adds the bit depth of the version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-description','s:38:\"Adds description of the image version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-dimensions','s:15:\"Alias for size.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-mediatype','s:33:\"Adds the media type of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-metadata','s:49:\"Lists Exif metadata for the version of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-mime','s:23:\"Adds MIME of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-parseddescription','s:37:\"Parse the description of the version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-sha1','s:30:\"Adds SHA-1 hash for the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-size','s:89:\"Adds the size of the image in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-timestamp','s:40:\"Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-user','s:41:\"Adds user who uploaded the image version.\";'),('en','messages:apihelp-query+filearchive-summary','s:41:\"Enumerate all deleted files sequentially.\";'),('en','messages:apihelp-query+filerepoinfo-example-simple','s:40:\"Get information about file repositories.\";'),('en','messages:apihelp-query+filerepoinfo-param-prop','s:82:\"Which repository properties to get (properties available may vary on other wikis).\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-apiurl','s:73:\"URL to the repository API - helpful for getting image info from the host.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-articlepath','s:106:\"Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgArticlePath|$wgArticlePath]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-canUpload','s:90:\"Whether files can be uploaded to this repository, e.g. via CORS and shared authentication.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-displayname','s:47:\"The human-readable name of the repository wiki.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-favicon','s:102:\"Repository wiki\'s favicon URL, from <var>[[mw:Special:MyLanguage/Manual:$wgFavicon|$wgFavicon]]</var>.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-fetchDescription','s:106:\"Whether file description pages are fetched from this repository when viewing local file description pages.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-initialCapital','s:58:\"Whether file names implicitly start with a capital letter.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-local','s:48:\"Whether that repository is the local one or not.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-name','s:189:\"The key of the repository - used in e.g. <var>[[mw:Special:MyLanguage/Manual:$wgForeignFileRepos|$wgForeignFileRepos]]</var> and [[Special:ApiHelp/query+imageinfo|imageinfo]] return values.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-rootUrl','s:30:\"Root URL path for image paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-scriptDirUrl','s:63:\"Root URL path for the repository wiki\'s MediaWiki installation.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-server','s:96:\"Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgServer|$wgServer]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-thumbUrl','s:34:\"Root URL path for thumbnail paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-url','s:21:\"Public zone URL path.\";'),('en','messages:apihelp-query+filerepoinfo-summary','s:72:\"Return meta information about image repositories configured on the wiki.\";'),('en','messages:apihelp-query+fileusage-example-generator','s:56:\"Get information about pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-example-simple','s:48:\"Get a list of pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-param-limit','s:19:\"How many to return.\";'),('en','messages:apihelp-query+fileusage-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+fileusage-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+fileusage-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-