ram-prop','s:30:\"Which file information to get:\";'),('en','messages:apihelp-query+imageinfo-param-start','s:32:\"Timestamp to start listing from.\";'),('en','messages:apihelp-query+imageinfo-param-urlheight','s:22:\"Similar to $1urlwidth.\";'),('en','messages:apihelp-query+imageinfo-param-urlparam','s:170:\"A handler specific parameter string. For example, PDFs might use <kbd>page15-100px</kbd>. <var>$1urlwidth</var> must be used and be consistent with <var>$1urlparam</var>.\";'),('en','messages:apihelp-query+imageinfo-param-urlwidth','s:174:\"If $2prop=url is set, a URL to an image scaled to this width will be returned.\nFor performance reasons if this option is used, no more than $1 scaled images will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:157:\"Adds the filename of the archive version for non-latest versions. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-badfile','s:60:\"Adds whether the file is on the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-bitdepth','s:126:\"Adds the bit depth of the version. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:129:\"Adds the canonical title of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-comment','s:121:\"Comment on the version. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-commonmetadata','s:155:\"Lists file format generic metadata for the version of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihe