rom the page <kbd>Main Page</kbd>\";'),('en','messages:apihelp-query+links-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+links-param-limit','s:25:\"How many links to return.\";'),('en','messages:apihelp-query+links-param-namespace','s:36:\"Show links in these namespaces only.\";'),('en','messages:apihelp-query+links-param-titles','s:101:\"Only list links to these titles. Useful for checking whether a certain page links to a certain title.\";'),('en','messages:apihelp-query+links-summary','s:39:\"Returns all links from the given pages.\";'),('en','messages:apihelp-query+linkshere-example-generator','s:57:\"Get information about pages linking to the [[Main Page]].\";'),('en','messages:apihelp-query+linkshere-example-simple','s:49:\"Get a list of pages linking to the [[Main Page]].\";'),('en','messages:apihelp-query+linkshere-param-limit','s:19:\"How many to return.\";'),('en','messages:apihelp-query+linkshere-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+linkshere-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+linkshere-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-pageid','s:21:\"Page ID of each page.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-redirect','s:31:\"Flag if the page is a redirect.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-title','s:19:\"Title of each page.\";'),('en','messages:apihelp-query+linkshere-summary','s:44:\"Find all pages that link to the given pages.\";'),('en','messages:apihelp-query+logevents-example-simple','s:23:\"List recent log events.\";'),('en','messages:apihelp-query+logevents-param-action','s:210:\"Filter log actions to only this action. Overrides <var>$1type</var>. In the list of possible values, values with the asterisk wildcar