pihelp-query+random-param-redirect','s:47:\"Use <kbd>$1filterredir=redirects</kbd> instead.\";'),('en','messages:apihelp-query+random-summary','s:26:\"Get a set of random pages.\";'),('en','messages:apihelp-query+recentchanges-example-generator','s:47:\"Get page info about recent unpatrolled changes.\";'),('en','messages:apihelp-query+recentchanges-example-simple','s:20:\"List recent changes.\";'),('en','messages:apihelp-query+recentchanges-param-end','s:33:\"The timestamp to end enumerating.\";'),('en','messages:apihelp-query+recentchanges-param-excludeuser','s:32:\"Don\'t list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-param-generaterevisions','s:174:\"When being used as a generator, generate revision IDs rather than titles. Recent change entries without associated revision IDs (e.g. most log entries) will generate nothing.\";'),('en','messages:apihelp-query+recentchanges-param-limit','s:33:\"How many total changes to return.\";'),('en','messages:apihelp-query+recentchanges-param-namespace','s:40:\"Filter changes to only these namespaces.\";'),('en','messages:apihelp-query+recentchanges-param-prop','s:41:\"Include additional pieces of information:\";'),('en','messages:apihelp-query+recentchanges-param-show','s:127:\"Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('en','messages:apihelp-query+recentchanges-param-slot','s:44:\"Only list changes that touch the named slot.\";'),('en','messages:apihelp-query+recentchanges-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+recentchanges-param-tag','s:39:\"Only list changes tagged with this tag.\";'),('en','messages:apihelp-query+recentchanges-param-title','s:42:\"Filter entries to those related to a page.\";'),('en','messages:apihelp-query+recentchanges-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('en','messages:apihelp-query+recentchanges-param-toponly','s:48:\"Only list changes which are the latest revision.\";'),('en','messages:apihelp-query+recentchanges-param-type','s:31:\"Which types of changes to show.\";'),('en','messages:apihelp-query+recentchanges-param-user','s:31:\"Only list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-autopatrolled','s:53:\"Tags patrollable edits as being autopatrolled or not.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:128:\"Adds the comment for the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-flags','s:24:\"Adds flags for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:68:\"Adds the page ID, recent changes ID and the new and old revision ID.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:60:\"Adds log information (log ID, log type, etc) to log entries.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:135:\"Adds the parsed comment for the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:57:\"Tags patrollable edits as being patrolled or unpatrolled.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:32:\"Tags edit if page is a redirect.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:160:\"Adds the content checksum for entries associated with a revision. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:42:\"Adds the new and old page length in bytes.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-tags','s:25:\"Lists tags for the entry.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:27:\"Adds timestamp of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:32:\"Adds the page title of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:158:\"Adds the user responsible for the edit and tags if they are an IP. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:134:\"Adds the user ID responsible for the edit. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-summary','s:25:\"Enumerate recent changes.\";'),('en','messages:apihelp-query+redirects-example-generator','s:57:\"Get information about all redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+redirects-example-simple','s:45:\"Get a list of redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+redirects-param-limit','s:29:\"How many redirects to return.\";'),('en','messages:apihelp-query+redirects-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+redirects-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+redirects-param-show','s:139:\"Show only items that meet these criteria:\n;fragment:Only show redirects with a fragment.\n;!fragment:Only show redirects without a fragment.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-fragment','s:34:\"Fragment of each redirect, if any.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:25:\"Page ID of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-title','s:23:\"Title of each redirect.\";'),('en','messages:apihelp-query+redirects-summary','s:41:\"Returns all redirects to the given pages.\";'),('en','messages:apihelp-query+revisions+base-param-contentformat','s:89:\"Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('en','messages:apihelp-query+revisions+base-param-diffto','s:218:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively.\";'),('en','messages:apihelp-query+revisions+base-param-difftotext','s:254:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$1diffto</var>. If <var>$1section</var> is set, only that section will be diffed against this text.\";'),('en','messages:apihelp-query+revisions+base-param-difftotextpst','s:177:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Perform a pre-save transform on the text before diffing it. Only valid when used with <var>$1difftotext</var>.\";'),('en','messages:apihelp-query+revisions+base-param-expandtemplates','s:146:\"Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> instead. Expand templates in revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-generatexml','s:207:\"Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Generate XML parse tree for revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-limit','s:42:\"Limit how many revisions will be returned.\";'),('en','messages:apihelp-query+revisions+base-param-parse','s:187:\"Use <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Parse revision content (requires $1prop=content). For performance reasons, if this option is used, $1limit is enforced to 1.\";'),('en','messages:apihelp-query+revisions+base-param-prop','s:42:\"Which properties to get for each revision:\";'),('en','messages:apihelp-query+revisions+base-param-section','s:49:\"Only retrieve the content of this section number.\";'),('en','messages:apihelp-query+revisions+base-param-slots','s:203:\"Which revision slots to return data for, when slot-related properties are included in <var>$1props</var>. If omitted, data from the <kbd>main</kbd> slot will be returned in a backwards-compatible format.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-comment','s:135:\"Comment by the user for the revision. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-content','s:125:\"Content of each revision slot. If the content has been revision deleted, a <samp>texthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-contentmodel','s:39:\"Content model ID of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-flags','s:23:\"Revision flags (minor).\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-ids','s:23:\"The ID of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment','s:142:\"Parsed comment by the user for the revision. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsetree','s:216:\"Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. The XML parse tree of revision content (requires content model <code>$1</code>).\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-roles','s:51:\"List content slot roles that exist in the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-sha1','s:127:\"SHA-1 (base 16) of the revision. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-size','s:31:\"Length (bytes) of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-slotsha1','s:133:\"SHA-1 (base 16) of each revision slot. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-slotsize','s:37:\"Length (bytes) of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-tags','s:22:\"Tags for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-timestamp','s:30:\"The timestamp of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-user','s:120:\"User that made the revision. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-userid','s:124:\"User ID of the revision creator. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions-example-content','s:94:\"Get data with content for the last revision of titles <kbd>API</kbd> and <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5','s:50:\"Get first 5 revisions of the <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-after','s:72:\"Get first 5 revisions of the <kbd>Main Page</kbd> made after 2006-05-01.\";'),('en','messages:apihelp-query+revisions-example-first5-not-localhost','s:108:\"Get first 5 revisions of the <kbd>Main Page</kbd> that were not made by anonymous user <kbd>127.0.0.1</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-user','s:106:\"Get first 5 revisions of the <kbd>Main Page</kbd> that were made by the user <kbd>MediaWiki default</kbd>.\";'),('en','messages:apihelp-query+revisions-example-last5','s:49:\"Get last 5 revisions of the <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-extended-description','s:267:\"May be used in several ways:\n# Get data about a set of pages (last revision), by setting titles or pageids.\n# Get revisions for one given page, by using titles or pageids with start, end, or limit.\n# Get data about a set of revisions by setting their IDs with revids.\";'),('en','messages:apihelp-query+revisions-param-end','s:31:\"Enumerate up to this timestamp.\";'),('en','messages:apihelp-query+revisions-param-endid','s:105:\"Stop enumeration at this revision\'s timestamp. The revision must exist, but need not belong to this page.\";'),('en','messages:apihelp-query+revisions-param-excludeuser','s:31:\"Exclude revisions made by user.\";'),('en','messages:apihelp-query+revisions-param-start','s:51:\"From which revision timestamp to start enumeration.\";'),('en','messages:apihelp-query+revisions-param-startid','s:108:\"Start enumeration from this revision\'s timestamp. The revision must exist, but need not belong to this page.\";'),('en','messages:apihelp-query+revisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+revisions-param-token','s:41:\"Which tokens to obtain for each revision.\";'),('en','messages:apihelp-query+revisions-param-user','s:36:\"Only include revisions made by user.\";'),('en','messages:apihelp-query+revisions-paraminfo-singlepageonly','s:46:\"May only be used with a single page (mode #2).\";'),('en','messages:apihelp-query+revisions-summary','s:25:\"Get revision information.\";'),('en','messages:apihelp-query+search-example-generator','s:75:\"Get page info about the pages returned for a search for <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+search-example-simple','s:30:\"Search for <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+search-example-text','s:36:\"Search texts for <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+search-param-backend','s:48:\"Which search backend to use, if not the default.\";'),('en','messages:apihelp-query+search-param-enablerewrites','s:176:\"Enable internal query rewriting. Some search backends can rewrite the query into another which is thought to provide better results, for instance by correcting spelling errors.\";'),('en','messages:apihelp-query+search-param-info','s:25:\"Which metadata to return.\";'),('en','messages:apihelp-query+search-param-interwiki','s:54:\"Include interwiki results in the search, if available.\";'),('en','messages:apihelp-query+search-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+search-param-namespace','s:36:\"Search only within these namespaces.\";'),('en','messages:apihelp-query+search-param-prop','s:27:\"Which properties to return:\";'),('en','messages:apihelp-query+search-param-qiprofile','s:61:\"Query independent profile to use (affects ranking algorithm).\";'),('en','messages:apihelp-query+search-param-search','s:175:\"Search for page titles or content matching this value. You can use the search string to invoke special search features, depending on what the wiki\'s search backend implements.\";'),('en','messages:apihelp-query+search-param-sort','s:39:\"Set the sort order of returned results.\";'),('en','messages:apihelp-query+search-param-what','s:32:\"Which type of search to perform.\";'),('en','messages:apihelp-query+search-paramvalue-prop-categorysnippet','s:47:\"Adds a parsed snippet of the matching category.\";'),('en','messages:apihelp-query+search-paramvalue-prop-extensiondata','s:40:\"Adds extra data generated by extensions.\";'),('en','messages:apihelp-query+search-paramvalue-prop-hasrelated','s:8:\"Ignored.\";'),('en','messages:apihelp-query+search-paramvalue-prop-isfilematch','s:61:\"Adds a boolean indicating if the search matched file content.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirectsnippet','s:44:\"Adds a parsed snippet of the redirect title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirecttitle','s:40:\"Adds the title of the matching redirect.\";'),('en','messages:apihelp-query+search-paramvalue-prop-score','s:8:\"Ignored.\";'),('en','messages:apihelp-query+search-paramvalue-prop-sectionsnippet','s:52:\"Adds a parsed snippet of the matching section title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-sectiontitle','s:39:\"Adds the title of the matching section.\";'),('en','messages:apihelp-query+search-paramvalue-prop-size','s:35:\"Adds the size of the page in bytes.\";'),('en','messages:apihelp-query+search-paramvalue-prop-snippet','s:34:\"Adds a parsed snippet of the page.\";'),('en','messages:apihelp-query+search-paramvalue-prop-timestamp','s:52:\"Adds the timestamp of when the page was last edited.\";'),('en','messages:apihelp-query+search-paramvalue-prop-titlesnippet','s:40:\"Adds a parsed snippet of the page title.\";'),('en','messages:apihelp-query+search-paramvalue-prop-wordcount','s:32:\"Adds the word count of the page.\";'),('en','messages:apihelp-query+search-summary','s:27:\"Perform a full text search.\";'),('en','messages:apihelp-query+siteinfo-example-interwiki','s:41:\"Fetch a list of local interwiki prefixes.\";'),('en','messages:apihelp-query+siteinfo-example-replag','s:34:\"Check the current replication lag.\";'),('en','messages:apihelp-query+siteinfo-example-simple','s:23:\"Fetch site information.\";'),('en','messages:apihelp-query+siteinfo-param-filteriw','s:64:\"Return only local or only nonlocal entries of the interwiki map.\";'),('en','messages:apihelp-query+siteinfo-param-inlanguagecode','s:72:\"Language code for localised language names (best effort) and skin names.\";'),('en','messages:apihelp-query+siteinfo-param-numberingroup','s:41:\"Lists the number of users in user groups.\";'),('en','messages:apihelp-query+siteinfo-param-prop','s:25:\"Which information to get:\";'),('en','messages:apihelp-query+siteinfo-param-showalldb','s:61:\"List all database servers, not just the one lagging the most.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-dbrepllag','s:57:\"Returns database server with the highest replication lag.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-defaultoptions','s:48:\"Returns the default values for user preferences.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-extensions','s:41:\"Returns extensions installed on the wiki.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-extensiontags','s:40:\"Returns a list of parser extension tags.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-fileextensions','s:68:\"Returns list of file extensions (file types) allowed to be uploaded.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-functionhooks','s:40:\"Returns a list of parser function hooks.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-general','s:27:\"Overall system information.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-interwikimap','s:103:\"Returns interwiki map (optionally filtered, optionally localised by using <var>$1inlanguagecode</var>).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-languages','s:107:\"Returns a list of languages MediaWiki supports (optionally localised by using <var>$1inlanguagecode</var>).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-languagevariants','s:153:\"Returns a list of language codes for which [[mw:Special:MyLanguage/LanguageConverter|LanguageConverter]] is enabled, and the variants supported for each.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-libraries','s:40:\"Returns libraries installed on the wiki.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-magicwords','s:38:\"List of magic words and their aliases.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-namespacealiases','s:37:\"List of registered namespace aliases.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-namespaces','s:56:\"List of registered namespaces and their canonical names.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-protocols','s:63:\"Returns a list of protocols that are allowed in external links.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-restrictions','s:64:\"Returns information on available restriction (protection) types.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-rightsinfo','s:55:\"Returns wiki rights (license) information if available.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-showhooks','s:115:\"Returns a list of all subscribed hooks (contents of <var>[[mw:Special:MyLanguage/Manual:$wgHooks|$wgHooks]]</var>).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-skins','s:131:\"Returns a list of all enabled skins (optionally localised by using <var>$1inlanguagecode</var>, otherwise in the content language).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-specialpagealiases','s:29:\"List of special page aliases.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-statistics','s:24:\"Returns site statistics.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-uploaddialog','s:40:\"Returns the upload dialog configuration.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-usergroups','s:51:\"Returns user groups and the associated permissions.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-variables','s:31:\"Returns a list of variable IDs.\";'),('en','messages:apihelp-query+siteinfo-summary','s:42:\"Return general information about the site.\";'),('en','messages:apihelp-query+stashimageinfo-example-params','s:41:\"Returns thumbnails for two stashed files.\";'),('en','messages:apihelp-query+stashimageinfo-example-simple','s:39:\"Returns information for a stashed file.\";'),('en','messages:apihelp-query+stashimageinfo-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-query+stashimageinfo-p