d','s:20:\"Изменённые\";'),('ru','messages:allmessages-filter-submit','s:14:\"Перейти\";'),('ru','messages:allmessages-filter-translate','s:18:\"Перевести\";'),('ru','messages:allmessages-filter-unmodified','s:24:\"Неизменённые\";'),('ru','messages:allmessages-language','s:9:\"Язык:\";'),('ru','messages:allmessages-not-supported-database','s:119:\"Эта страница недоступна, так как отключена опция \'\'\'$wgUseDatabaseMessages\'\'\'.\";'),('ru','messages:allmessages-prefix','s:35:\"Фильтр по префиксу:\";'),('ru','messages:allmessagescurrent','s:25:\"Текущий текст\";'),('ru','messages:allmessagesdefault','s:34:\"Текст по умолчанию\";'),('ru','messages:allmessagesname','s:18:\"Сообщение\";'),('ru','messages:allmessagestext','s:452:\"Это список системных сообщений, доступных в пространстве имён «MediaWiki».\nЕсли вы хотите внести вклад в общую локализацию MediaWiki, пожалуйста, посетите страницу [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation описания локализации] и проект [https://translatewiki.net translatewiki.net].\";'),('ru','messages:allowemail','s:114:\"Разрешить другим участникам отправлять мне электронную почту\";'),('ru','messages:allpages','s:23:\"Все страницы\";'),('ru','messages:allpages-bad-ns','s:76:\"{{SITENAME}} не содержит пространства имён «$1».\";'),('ru','messages:allpages-hide-redirects','s:43:\"Скрыть перенаправления\";'),('ru','messages:allpages-summary','s:0:\"\";'),('ru','messages:allpagesbadtitle','s:225:\"Недопустимое название страницы. Заголовок содержит интервики, межъязыковой префикс или запрещённые в заголовках символы.\";'),('ru','messages:allpagesfrom','s:63:\"Вывести страницы, начинающиеся на:\";'),('ru','messages:allpagesprefix','s:57:\"Найти страницы, начинающиеся с:\";'),('ru','messages:allpagessubmit','s:18:\"Выполнить\";'),('ru','messages:allpagesto','s:37:\"Остановить вывод на:\";'),('ru','messages:alreadyrolled','s:612:\"Невозможно откатить последние изменения страницы «[[:$1]]», совершённые [[User:$2|$2]] ([[User talk:$2|обсуждение]]{{int:pipe-separator}}[[Special:Contributions/$2|{{int:contribslink}}]]),\nпоскольку кто-то другой уже успел откатить эти правки или отредактировать страницу.\n\nПоследние изменения {{GENDER:$3|внёс|внесла}} [[User:$3|$3]] ([[User talk:$3|обсуждение]]{{int:pipe-separator}}[[Special:Contributions/$3|{{int:contribslink}}]]).\";'),('ru','messages:ancientpages','s:76:\"Статьи по дате последнего редактирования\";'),('ru','messages:ancientpages-summary','s:0:\"\";'),('ru','messages:and','s:7:\"&#32;и\";'),('ru','messages:anoncontribs','s:10:\"Вклад\";'),('ru','messages:anoneditwarning','s:546:\"<strong>Внимание!</strong> Вы не авторизовались на сайте. Ваш IP-адрес будет публично видимым, если вы будете вносить любые правки. Если вы <strong>[$1 войдёте]</strong> или <strong>[$2 создадите учётную запись]</strong>, правки вместо этого будут связаны с вашим именем пользователя, а также у вас появятся другие преимущества.\";'),('ru','messages:anonnotice','s:1:\"-\";'),('ru','messages:anononlyblock','s:29:\"только анонимов\";'),('ru','messages:anonpreviewwarning','s:194:\"\'\'Вы не представились системе. Сохранение приведёт к записи вашего IP-адреса в историю изменений страницы.\'\'\";'),('ru','messages:anontalk','s:20:\"Обсуждение\";'),('ru','messages:anontalkpagetext','s:920:\"----\n<em>Эта страница обсуждения анонимного участника, который ещё не создал учётной записи или не использует её.</em>\nПоэтому мы вынуждены для его/её идентификации использовать цифровой IP-адрес.\nЭтот же адрес может использоваться несколькими участниками.\nЕсли вы анонимный участник и полагаете, что получили сообщения, адресованные не вам, пожалуйста, [[Special:CreateAccount|создайте учётную запись]] или [[Special:UserLogin|представьтесь системе]], чтобы впредь избежать возможной путаницы с другими анонимными участниками.\";'),('ru','messages:anonuser','s:72:\"анонимный участник {{grammar:genitive|{{SITENAME}}}} $1\";'),('ru','messages:anonusers','s:126:\"{{PLURAL:$2|1=анонимный участник|анонимные участники}} {{grammar:genitive|{{SITENAME}}}} $1\";'),('ru','messages:anonymous','s:123:\"{{PLURAL:$1|1=Анонимный участник|Анонимные участники}} {{grammar:genitive|{{SITENAME}}}}\";'),('ru','messages:api-clientside-error-aborted','s:35:\"Запрос был прерван.\";'),('ru','messages:api-clientside-error-http','s:48:\"Сервер вернул ошибку: HTTP $1.\";'),('ru','messages:api-clientside-error-invalidresponse','s:48:\"Неверный ответ от сервера.\";'),('ru','messages:api-clientside-error-noconnect','s:193:\"Невозможно соединиться с сервером. Убедитесь, что у вас есть подключение к Интернету и повторите попытку.\";'),('ru','messages:api-clientside-error-timeout','s:68:\"Сервер не ответил за ожидаемое время.\";'),('ru','messages:api-credits','s:604:\"Разработчики API:\n* Yuri Astrakhan (создатель, ведущий разработчик с сентября 2006 по сентябрь 2007)\n* Roan Kattouw (ведущий разработчик 2007—2009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Brad Jorsch (ведущий разработчик с 2013)\n\nПожалуйста, присылайте ваши комментарии, предложения и вопросы на адрес mediawiki-api@lists.wikimedia.org\nили присылайте отчёты об ошибках на https://phabricator.wikimedia.org/.\";'),('ru','messages:api-credits-header','s:18:\"Создатели\";'),('ru','messages:api-error-badtoken','s:72:\"Внутренняя ошибка:  некорректный токен.\";'),('ru','messages:api-error-emptypage','s:84:\"Не допускается создание новых пустых страниц.\";'),('ru','messages:api-error-publishfailed','s:109:\"Внутренняя ошибка: сервер не смог сохранить временный файл.\";'),('ru','messages:api-error-stashfailed','s:109:\"Внутренняя ошибка: сервер не смог сохранить временный файл.\";'),('ru','messages:api-error-unknown-warning','s:60:\"Неизвестное предупреждение: «$1».\";'),('ru','messages:api-error-unknownerror','s:44:\"Неизвестная ошибка: «$1».\";'),('ru','messages:api-exception-trace','s:15:\"$1 в $2($3)\n$4\";'),('ru','messages:api-feed-error-title','s:17:\"Ошибка ($1)\";'),('ru','messages:api-format-prettyprint-header','s:610:\"Это HTML-представление формата $1. HTML хорош для отладки, но неудобен для практического применения.\n\nУкажите параметр <var>format</var> для изменения формата вывода. Для отображения не-HTML-представления формата $1, присвойте <kbd>format=$2</kbd>.\n\nСм. [[mw:Special:MyLanguage/API|полную документацию]] или [[Special:ApiHelp/main|справку API]] для получения дополнительной информации.\";'),('ru','messages:api-format-prettyprint-header-hyperlinked','s:596:\"Это HTML-представление формата $1. HTML хорош для отладки, но неудобен для практического применения.\n\nУкажите параметр <var>format</var> для изменения формата вывода. Для отображения не-HTML-представления формата $1, присвойте [$3 <kbd>format=$2</kbd>].\n\nСм. [[mw:API|полную документацию]] или [[Special:ApiHelp/main|справку API]] для получения дополнительной информации.\";'),('ru','messages:api-format-prettyprint-header-only-html','s:346:\"Это HTML-представление для отладки, не рассчитанное на практическое применение.\n\nСм. [[mw:Special:MyLanguage/API|полную документацию]] или [[Special:ApiHelp/main|справку API]] для получения дополнительной информации.\";'),('ru','messages:api-format-prettyprint-status','s:78:\"Этот ответ будет возвращён HTTP статусом $1 $2.\";'),('ru','messages:api-format-title','s:32:\"Результат MediaWiki API\";'),('ru','messages:api-help-authmanager-general-usage','s:1991:\"Стандартная процедура использования этого модуля такова:\n# Запрос полей, доступных из <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> с <kbd>amirequestsfor=$4</kbd>, и токена <kbd>$5</kbd> из <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Предоставление полей пользователю и получение его данных.\n# Запрос к этому модулю, содержащий <var>$1returnurl</var> или аналогичное поле.\n# Проверка поля <samp>status</samp> ответа.\n#* Если вы получили <samp>PASS</samp> или <samp>FAIL</samp>, вы закончили. Операция либо завершилась успехом, либо нет.\n#* Если вы получили <samp>UI</samp>, предоставьте новые поля пользователю и получите новые данные. Затем совершите новый запрос с параметром <var>$1continue</var> и новыми полями, после чего повторите пункт 4.\n#* Если вы получили <samp>REDIRECT</samp>, отправьте пользователя на <samp>redirecttarget</samp> и подождите возвращения на <var>$1returnurl</var>. Затем совершите запрос к этому модулю с параметром <var>$1continue</var> и всеми полями, содержащимися в возвращённой ссылке, и повторите пункт 4.\n#* Если вы получили <samp>RESTART</samp>, это означает, что аутентификация работает, но мы не привязали пользовательский аккаунт. Вы можете рассматривать это как <samp>UI</samp> или <samp>FAIL</samp>.\";'),('ru','messages:api-help-authmanagerhelper-additional-params','s:553:\"Этот модуль принимает дополнительные параметры в зависимости от доступных аутентификационных запросов. Используйте <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> с <kbd>amirequestsfor=$1</kbd> (или предыдущий ответ этого модуля, если доступен) для определения, какие запросы доступны и какие поля они используют.\";'),('ru','messages:api-help-authmanagerhelper-continue','s:240:\"Этот запрос — продолжение после предшествующего ответа <samp>UI</samp> или <samp>REDIRECT</samp>. Либо этот параметр, либо <var>$1returnurl</var>, обязателен.\";'),('ru','messages:api-help-authmanagerhelper-mergerequestfields','s:134:\"Слить поля информации со всех аутентификационных запросов в один массив.\";'),('ru','messages:api-help-authmanagerhelper-messageformat','s:90:\"Формат, используемый для возвращаемых сообщений.\";'),('ru','messages:api-help-authmanagerhelper-preservestate','s:154:\"Сохранить состояние с предыдущей провалившейся попытки авторизации, если возможно.\";'),('ru','messages:api-help-authmanagerhelper-request','s:254:\"Использовать этот аутентификационный запрос, с <samp>id</samp>, возвращённом из <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> с <kbd>amirequestsfor=$1</kbd>.\";'),('ru','messages:api-help-authmanagerhelper-requests','s:340:\"Использовать только эти аутентификационные запросы, с <samp>id</samp>, возвращённом из <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> с <kbd>amirequestsfor=$1</kbd>, или из предыдущего ответа этого модуля.\";'),('ru','messages:api-help-authmanagerhelper-returnurl','s:918:\"Вернуть ссылку для стороннего процесса аутентификации, должна быть абсолютной. Либо этот параметр, либо <var>$1continue</var>, обязателен.\n\nПосле получения ответа <samp>REDIRECT</samp>, вы, как правило, должны открыть в браузере или вэб-просмотрщике указанную в <samp>redirecttarget</samp> ссылку для продолжения стороннего процесса аутентификации. По завершению, сторонний сервис отошлёт браузеру или веб-просмотрщику эту ссылку. Вы должны извлечь все параметры из ссылки и отослать их в параметр <var>$1continue</var> запроса к этому модулю.\";'),('ru','messages:api-help-datatype-boolean','s:168:\"Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\";'),('ru','messages:api-help-datatype-expiry','s:230:\"Expiry values be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). For no expiry, use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> or <kbd>never</kbd>.\";'),('ru','messages:api-help-datatype-timestamp','s:388:\"Timestamps may be specified in several formats, see [[mw:Special:MyLanguage/Timestamp|the Timestamp library input formats documented on mediawiki.org]] for details. ISO 8601 date and time is recommended: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. Additionally, the string <kbd>now</kbd> may be used to specify the current timestamp.\";'),('ru','messages:api-help-datatypes-header','s:21:\"Типы данных\";'),('ru','messages:api-help-datatypes-top','s:616:\"Input to MediaWiki should be NFC-normalized UTF-8. MediaWiki may attempt to convert other input, but this may cause some operations (such as [[Special:ApiHelp/edit|edits]] with MD5 checks) to fail.\n\nParameters that take multiple values are normally submitted with the values separated using the pipe character, e.g. <kbd>param=value1|value2</kbd> or <kbd>param=value1%7Cvalue2</kbd>. If a value must contain the pipe character, use U+001F (Unit Separator) as the separator \'\'and\'\' prefix the value with U+001F, e.g. <kbd>param=%1Fvalue1%1Fvalue2</kbd>.\n\nSome parameter types in API requests need further explanation:\";'),('ru','messages:api-help-examples','s:30:\"Пример{{PLURAL:$1||ы}}:\";'),('ru','messages:api-help-flag-deprecated','s:37:\"Этот модуль устарел.\";'),('ru','messages:api-help-flag-generator','s:106:\"Этот модуль может быть использован в качестве генератора.\";'),('ru','messages:api-help-flag-internal','s:185:\"<strong>Этот модуль внутренний или нестабильный.</strong> Его операции могут измениться без предупреждения.\";'),('ru','messages:api-help-flag-mustbeposted','s:74:\"Этот модуль принимает только POST-запросы.\";'),('ru','messages:api-help-flag-readrights','s:64:\"Этот модуль требует прав на чтение.\";'),('ru','messages:api-help-flag-writerights','s:64:\"Этот модуль требует прав на запись.\";'),('ru','messages:api-help-flags','s:0:\"\";'),('ru','messages:api-help-help-urls','s:0:\"\";'),('ru','messages:api-help-lead','s:201:\"Это автоматически сгенерированная страница документации MediaWiki API.\n\nДокументация и примеры: https://www.mediawiki.org/wiki/API\";'),('ru','messages:api-help-license','s:27:\"Лицензия: [[$1|$2]]\";'),('ru','messages:api-help-license-noname','s:43:\"Лицензия: [[$1|см. ссылку]]\";'),('ru','messages:api-help-license-unknown','s:62:\"Лицензия: <span class=\"apihelp-unknown\">unknown</span>\";'),('ru','messages:api-help-main-header','s:27:\"Главный модуль\";'),('ru','messages:api-help-no-extended-description','s:0:\"\";'),('ru','messages:api-help-open-in-apisandbox','s:53:\"<small>[открыть в песочнице]</small>\";'),('ru','messages:api-help-param-continue','s:125:\"Когда доступно больше результатов, используйте это для продолжения.\";'),('ru','messages:api-help-param-default-empty','s:72:\"По умолчанию: <span class=\"apihelp-empty\">(пусто)</span>\";'),('ru','messages:api-help-param-deprecated','s:17:\"Устарело.\";'),('ru','messages:api-help-param-direction','s:342:\"В каком порядке перечислять:\n;newer: Начать с самых старых. Обратите внимание: $1start должно быть раньше $1end.\n;older: Начать с самых новых (по умолчанию). Обратите внимание: $1start должно быть позже $1end.\";'),('ru','messages:api-help-param-disabled-in-miser-mode','s:103:\"Отключено из-за [[mw:Special:MyLanguage/Manual:$wgMiserMode|жадного режима]].\";'),('ru','messages:api-help-param-internal','s:21:\"Внутренний.\";'),('ru','messages:api-help-param-limited-in-miser-mode','s:406:\"<strong>Примечание:</strong> Из-за [[mw:Special:MyLanguage/Manual:$wgMiserMode|жадного режима]], использование этого может привести к меньшему, чем <var>$1limit</var>, числу результатов перед продолжением; в крайнем случае, может вернуться и ноль результатов.\";'),('ru','messages:api-help-param-multi-all','s:88:\"Для указания всех значений, используйте <kbd>$1</kbd>.\";'),('ru','messages:api-help-param-multi-separate','s:170:\"Разделяйте значения с помощью <kbd>|</kbd> или [[Special:ApiHelp/main#main/datatypes|альтернативного разделителя]].\";'),('ru','messages:api-help-param-no-description','s:76:\"<span class=\"apihelp-empty\">(описание отсутствует)</span>\";'),('ru','messages:api-help-param-templated','s:132:\"Это [[Special:ApiHelp/main#main/templatedparams|шаблонный параметр]]. При отправке запроса $2.\";'),('ru','messages:api-help-param-templated-var','s:64:\"<var>&#x7B;$1&#x7D;</var> — значениями <var>$2</var>\";'),('ru','messages:api-help-param-templated-var-first','s:138:\"<var>&#x7B;$1&#x7D;</var> в названии параметра должно быть заменено значениями <var>$2</var>\";'),('ru','messages:api-help-param-token','s:102:\"Токен «$1», полученный из [[Special:ApiHelp/query+tokens|action=query&meta=tokens]]\";'),('ru','messages:api-help-param-token-webui','s:149:\"Для обратной совместимости, токен, используемый в веб-интерфейсе, также применим.\";'),('ru','messages:api-help-param-type-enum','s:249:\"{{PLURAL:$1|1=Одно из следующих значений|2=Значения (разделённые с помощью <kbd>{{!}}</kbd> или [[Special:ApiHelp/main#main/datatypes|альтернативного разделителя]])}}: $2\";'),('ru','messages:api-help-param-type-expiry','s:103:\"Type: {{PLURAL:$1|1=expiry|2=list of expiries}} ([[Special:ApiHelp/main#main/datatype/expiry|details]])\";'),('ru','messages:api-help-param-type-limit','s:51:\"Тип: целое число или <kbd>max</kbd>\";'),('ru','messages:api-help-param-type-presenceboolean','s:70:\"Type: boolean ([[Special:ApiHelp/main#main/datatype/boolean|details]])\";'),('ru','messages:api-help-param-type-timestamp','s:178:\"Тип: {{PLURAL:$1|1=временная метка|2=список временных меток}} ([[Special:ApiHelp/main#main/datatypes|разрешённые форматы]])\";'),('ru','messages:api-help-parameters','s:34:\"Параметр{{PLURAL:$1||ы}}:\";'),('ru','messages:api-help-permissions','s:56:\"{{PLURAL:$1|Разрешение|Разрешения}}:\";'),('ru','messages:api-help-permissions-granted-to','s:44:\"{{PLURAL:$1|Гарантируется}}: $2\";'),('ru','messages:api-help-right-apihighlimits','s:306:\"Использовать высокие лимиты в запросах API (медленные запросы: $1, быстрые запросы: $2). Лимиты для медленных запросов также применимы к параметрам со множеством значений.\";'),('ru','messages:api-help-source','s:20:\"Источник: $1\";'),('ru','messages:api-help-source-unknown','s:62:\"Источник: <span class=\"apihelp-unknown\">unknown</span>\";'),('ru','messages:api-help-templatedparams','s:1078:\"Шаблонные параметры используются в случаях, когда модулю API нужно получить по параметру со значением на каждое значение другого параметра. Например, если бы был модуль API, запрашивающий фрукты, у него мог бы быть параметр <var>фрукты</var>, указывающий, какие фрукты запрашиваются, и шаблонный параметр <var>{фрукт}-в-количестве</var>, указывающий, сколько фруктов каждого вида запросить. Клиент API, который хочет запросить 1 яблоко, 5 бананов и 20 апельсинов, мог бы тогда сделать запрос наподобие <kbd>фрукты=яблоки|бананы|апельсины&яблоки-в-количестве=1&бананы-в-количестве=5&апельсины-в-количестве=20</kbd>.\";'),('ru','messages:api-help-templatedparams-header','s:37:\"Шаблонные параметры\";'),('ru','messages:api-help-title','s:28:\"Справка MediaWiki API\";'),('ru','messages:api-help-undocumented-module','s:55:\"Нет документации для модуля $1.\";'),('ru','messages:api-login-fail-aborted','s:466:\"Аутентификация требует взаимодействия с пользователем, что не поддерживается <kbd>action=login</kbd>. Чтобы авторизовываться через <kbd>action=login</kbd>, см. [[Special:BotPasswords]]. Для продолжения использования авторизации основного аккаунта см. <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('ru','messages:api-login-fail-aborted-nobotpw','s:268:\"Аутентификация требует взаимодействия с пользователем, что не поддерживается <kbd>action=login</kbd>. Для авторизации см. <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('ru','messages:api-login-fail-badsessionprovider','s:81:\"Авторизация при использовании $1 невозможна.\";'),('ru','messages:api-login-fail-sameorigin','s:129:\"Авторизация при использовании правила ограничения домена невозможна.\";'),('ru','messages:api-pageset-param-converttitles','s:373:\"Преобразовать заголовки в другой вариант, если это необходимо. Работает только если язык содержимого вики поддерживает преобразование вариантов. Языки, поддерживающие преобразование, включают в себя $1.\";'),('ru','messages:api-pageset-param-generator','s:295:\"Получить список страниц для работы, запустив указанный запрос-модуль.\n\n<strong>Примечание:</strong> названия параметров генераторов должны начинаться с «g», см. примеры.\";'),('ru','messages:api-pageset-param-pageids','s:79:\"Список идентификаторов страниц для работы.\";'),('ru','messages:api-pageset-param-redirects-generator','s:233:\"Автоматически разрешать перенаправления в <var>$1titles</var>, <var>$1pageids</var> и <var>$1revids</var>, а также на страницах, возвращённых <var>$1generator</var>.\";'),('ru','messages:api-pageset-param-redirects-nogenerator','s:145:\"Автоматически разрешать перенаправления в <var>$1titles</var>, <var>$1pageids</var> и <var>$1revids</var>.\";'),('ru','messages:api-pageset-param-revids','s:77:\"Список идентификаторов версий для работы.\";'),('ru','messages:api-pageset-param-titles','s:54:\"Список заголовков для работы.\";'),('ru','messages:api-usage-docref','s:47:\"См. $1 для использования API.\";'),('ru','messages:api-usage-mailinglist-ref','s:307:\"Подпишитесь на электронную рассылку MediaWiki API на &lt;https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce&gt;, чтобы получать информацию о неподдерживаемых функциях и ломающих изменениях.\";'),('ru','messages:apierror-allimages-redirect','s:192:\"Используйте <kbd>gaifilterredir=nonredirects</kbd> вместо <var>redirects</var> при использовании <kbd>allimages</kbd> в качестве генератора.\";'),('ru','messages:apierror-allpages-generator-redirects','s:191:\"Используйте <kbd>gaifilterredir=nonredirects</kbd> вместо <var>redirects</var> при использовании <kbd>allpages</kbd> в качестве генератора.\";'),('ru','messages:apierror-appendnotsupported','s:120:\"Невозможно дописать страницы, использующие модель содержимого $1.\";'),('ru','messages:apierror-articleexists','s:91:\"Статья, которую вы пытаетесь создать, уже создана.\";'),('ru','messages:apierror-assertanonfailed','s:111:\"Проверка того, что пользователь не авторизирован, не удалась\";'),('ru','messages:apierror-assertbotfailed','s:117:\"Проверка того, что у участника есть право <code>bot</code>, провалилась.\";'),('ru','messages:apierror-assertnameduserfailed','s:145:\"Вы больше не авторизированны как «$1», поэтому действие не может быть завершено.\";'),('ru','messages:apierror-assertuserfailed','s:129:\"Вы больше не авторизированы, поэтому действие не может быть завершено.\";'),('ru','messages:apierror-autoblocked','s:188:\"Ваш IP-адрес был автоматически заблокирован, потому что он был использован заблокированным участником.\";'),('ru','messages:apierror-bad-badfilecontexttitle','s:89:\"Неверное название в параметре <var>$1badfilecontexttitle</var>.\";'),('ru','messages:apierror-bad-watchlist-token','s:198:\"Предоставлен некорректный токен списка наблюдения. Пожалуйста, установите корректный токен в [[Special:Preferences]].\";'),('ru','messages:apierror-badconfig-resulttoosmall','s:181:\"Значение <code>$wgAPIMaxResultSize</code> этой вики слишком мало, чтобы вместить базовую информацию о результате.\";'),('ru','messages:apierror-badcontinue','s:168:\"Некорректный параметр continue. Вы должны передать значение, возвращённое предыдущим запросом.\";'),('ru','messages:apierror-baddiff','s:234:\"Сравнение версий не может быть проведено. Одна или обе версии не существуют или у вас не достаточно прав чтобы просматривать их.\";'),('ru','messages:apierror-baddiffto','s:142:\"<var>$1diffto</var> должно быть неотрицательным числом, <kbd>prev</kbd>, <kbd>next</kbd> или <kbd>cur</kbd>.\";'),('ru','messages:apierror-badformat','s:147:\"Запрашиваемый формат $1 не поддерживается моделью содержимого $2, используемой $3.\";'),('ru','messages:apierror-badformat-generic','s:118:\"Запрашиваемый формат $1 не поддерживается моделью содержимого $2.\";'),('ru','messages:apierror-badgenerator-notgenerator','s:116:\"Модуль <kbd>$1</kbd> не может быть использован в качестве генератора.\";'),('ru','messages:apierror-badgenerator-unknown','s:47:\"Неизвестный <kbd>generator=$1</kbd>.\";'),('ru','messages:apierror-badip','s:43:\"Параметр IP некорректен.\";'),('ru','messages:ap