on edit.\";'),('ru','messages:apihelp-compare-param-fromslots','s:515:\"Переопределение содержимого версии, заданной параметром <var>fromtitle</var>, <var>fromid</var> или <var>fromrev</var>.\n\nЭтот параметр определяет слоты, которые должны быть изменены. Используйте <var>fromtext-&#x7B;slot}</var>, <var>fromcontentmodel-&#x7B;slot}</var>, и <var>fromcontentformat-&#x7B;slot}</var> для определения содержимого для каждого слота.\";'),('ru','messages:apihelp-compare-param-fromtext','s:92:\"Укажите <kbd>fromslots=main</kbd> и используйте <var>fromtext-main</var>.\";'),('ru','messages:apihelp-compare-param-fromtext-{slot}','s:78:\"Text of the specified slot. If omitted, the slot is removed from the revision.\";'),('ru','messages:apihelp-compare-param-fromtitle','s:74:\"Заголовок первой сравниваемой страницы.\";'),('ru','messages:apihelp-compare-param-prop','s:49:\"Какую информацию получить.\";'),('ru','messages:apihelp-compare-param-slots','s:85:\"Return individual diffs for these slots, rather than one combined diff for all slots.\";'),('ru','messages:apihelp-compare-param-tocontentformat','s:97:\"Укажите <kbd>toslots=main</kbd> и используйте <var>tocontentformat-main</var>.\";'),('ru','messages:apihelp-compare-param-tocontentformat-{slot}','s:62:\"Content serialization format of <var>totext-&#x7B;slot}</var>.\";'),('ru','messages:apihelp-compare-param-tocontentmodel','s:96:\"Укажите <kbd>toslots=main</kbd> и используйте <var>tocontentmodel-main</var>.\";'),('ru','messages:apihelp-compare-param-tocontentmodel-{slot}','s:160:\"Модель содержимого <var>totext-&#x7B;slot}</var>. Если не задана, будет угадана по другим параметрам.\";'),('ru','messages:apihelp-compare-param-toid','s:82:\"Идентификатор второй сравниваемой страницы.\";'),('ru','messages:apihelp-compare-param-topst','s:118:\"Выполнить преобразование перед записью правки (PST) над <var>totext</var>.\";'),('ru','messages:apihelp-compare-param-torelative','s:235:\"Использовать версию, относящуюся к определённой <var>fromtitle</var>, <var>fromid</var> или <var>fromrev</var>. Все другие опции \'to\' будут проигнорированы.\";'),('ru','messages:apihelp-compare-param-torev','s:51:\"Вторая сравниваемая версия.\";'),('ru','messages:apihelp-compare-param-tosection','s:105:\"Использовать только указанную секцию из содержимого «to».\";'),('ru','messages:apihelp-compare-param-tosection-{slot}','s:229:\"When <var>totext-&#x7B;slot}</var> is the content of a single section, this is the section number. It will be merged into the revision specified by <var>totitle</var>, <var>toid</var> or <var>torev</var> as if for a section edit.\";'),('ru','messages:apihelp-compare-param-toslots','s:314:\"Override content of the revision specified by <var>totitle</var>, <var>toid</var> or <var>torev</var>.\n\nThis parameter specifies the slots that are to be modified. Use <var>totext-&#x7B;slot}</var>, <var>tocontentmodel-&#x7B;slot}</var>, and <var>tocontentformat-&#x7B;slot}</var> to specify content for each slot.\";'),('ru','messages:apihelp-compare-param-totext','s:88:\"Укажите <kbd>toslots=main</kbd> и используйте <var>totext-main</var>.\";'),('ru','messages:apihelp-compare-param-totext-{slot}','s:78:\"Text of the specified slot. If omitted, the slot is removed from the revision.\";'),('ru','messages:apihelp-compare-param-totitle','s:74:\"Заголовок второй сравниваемой страницы.\";'),('ru','messages:apihelp-compare-paramvalue-prop-comment','s:69:\"Описания правок для версий «from» и «to».\";'),('ru','messages:apihelp-compare-paramvalue-prop-diff','s:27:\"HTML-код разницы.\";'),('ru','messages:apihelp-compare-paramvalue-prop-diffsize','s:58:\"Размер HTML-кода разницы в байтах.\";'),('ru','messages:apihelp-compare-paramvalue-prop-ids','s:79:\"Идентификаторы страниц и версий «from» и «to».\";'),('ru','messages:apihelp-compare-paramvalue-prop-parsedcomment','s:94:\"Распарсенные описания правок для версий «from» и «to».\";'),('ru','messages:apihelp-compare-paramvalue-prop-rel','s:109:\"Идентификаторы предыдущей к «from» и следующей за «to» версий.\";'),('ru','messages:apihelp-compare-paramvalue-prop-size','s:45:\"Размер версий «from» и «to».\";'),('ru','messages:apihelp-compare-paramvalue-prop-title','s:71:\"Названия страниц для версий «from» и «to».\";'),('ru','messages:apihelp-compare-paramvalue-prop-user','s:95:\"Имя и идентификатор участника для версий «from» и «to».\";'),('ru','messages:apihelp-compare-summary','s:77:\"Получение разницы между двумя страницами.\";'),('ru','messages:apihelp-createaccount-example-create','s:113:\"Начать создание участника <kbd>Example</kbd> с паролем <kbd>ExamplePassword</kbd>.\";'),('ru','messages:apihelp-createaccount-param-preservestate','s:540:\"Если запрос <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> возвращает true для <samp>hasprimarypreservedstate</samp>, то запросы, отмеченные как <samp>primary-required</samp>, должны быть пропущены. Если запрос возвращает непустое значение поля <samp>preservedusername</samp>, то это значение должно быть использовано в параметре <samp>username</var>.\";'),('ru','messages:apihelp-createaccount-summary','s:56:\"Создание новой учётной записи.\";'),('ru','messages:apihelp-cspreport-param-reportonly','s:138:\"Отметить как доклад от политики мониторинга, не от принудительной политики\";'),('ru','messages:apihelp-cspreport-param-source','s:98:\"Что сгенерировало заголовок CSP, вызвавший этот доклад\";'),('ru','messages:apihelp-cspreport-summary','s:387:\"Используется браузерами, чтобы сообщать о нарушениях политики безопасности (CSP). Этот модуль никогда не должен использоваться, за исключением случаев автоматического использования совместимыми с CSP браузерами.\";'),('ru','messages:apihelp-delete-example-reason','s:86:\"Удалить <kbd>Main Page</kbd> по причине <kbd>Preparing for move</kbd>.\";'),('ru','messages:apihelp-delete-example-simple','s:36:\"Удалить <kbd>Main Page</kbd>.\";'),('ru','messages:apihelp-delete-param-oldimage','s:191:\"Название старого удаляемого изображения, предоставляемое [[Special:ApiHelp/query+imageinfo|action=query&prop=imageinfo&iiprop=archivename]].\";'),('ru','messages:apihelp-delete-param-pageid','s:149:\"Идентификатор удаляемой страницы. Нельзя использовать одновременно с <var>$1title</var>.\";'),('ru','messages:apihelp-delete-param-reason','s:170:\"Причина удаления. Если не задана, будет использована автоматически сгенерированная причина.\";'),('ru','messages:apihelp-delete-param-tags','s:76:\"Изменить метки записи в журнале удалений.\";'),('ru','messages:apihelp-delete-param-title','s:142:\"Заголовок удаляемой страницы. Нельзя использовать одновременно с <var>$1pageid</var>.\";'),('ru','messages:apihelp-delete-param-unwatch','s:107:\"Удалить страницу из списка наблюдения текущего участника.\";'),('ru','messages:apihelp-delete-param-watch','s:107:\"Добавить страницу в список наблюдения текущего участника.\";'),('ru','messages:apihelp-delete-param-watchlist','s:243:\"Безусловно добавить или удалить страницу из списка наблюдения текущего участника, использовать настройки или не менять наблюдение.\";'),('ru','messages:apihelp-delete-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('ru','messages:apihelp-delete-summary','s:34:\"Удаление страницы.\";'),('ru','messages:apihelp-disabled-summary','s:46:\"Этот модуль был отключён.\";'),('ru','messages:apihelp-edit-example-edit','s:44:\"Редактировать страницу.\";'),('ru','messages:apihelp-edit-example-prepend','s:111:\"Добавить магическое слово <kbd>_&#95;NOTOC_&#95;</kbd> в начало страницы.\";'),('ru','messages:apihelp-edit-example-undo','s:120:\"Отменить изменения с 13579 по 13585 с автоматическим описанием правки.\";'),('ru','messages:apihelp-edit-param-appendtext','s:231:\"Добавить этот текст в конец страницы. Переопределяет $text.\n\nДля создания нового раздела, используйте $1section=new, а не этот параметр.\";'),('ru','messages:apihelp-edit-param-baserevid','s:458:\"Идентификатор базовой ревизии, используемый для обнаружения конфликтов редактирования. Может быть получено через [[Special:ApiHelp/query+revisions|action=query&prop=revisions]]. Самостоятельные конфликты приводят к сбою редактирования, если не задана базовая отметка времени.\";'),('ru','messages:apihelp-edit-param-basetimestamp','s:314:\"Метка времени редактируемой версии, используется для обнаружения конфликтов редактирования. Может быть получена посредством [[Special:ApiHelp/query+revisions|action=query&prop=revisions&rvprop=timestamp]].\";'),('ru','messages:apihelp-edit-param-bot','s:67:\"Пометить правку как сделанную ботом.\";'),('ru','messages:apihelp-edit-param-contentformat','s:128:\"Формат сериализации содержимого, используемый для введённого текста.\";'),('ru','messages:apihelp-edit-param-contentmodel','s:49:\"Модель нового содержимого.\";'),('ru','messages:apihelp-edit-param-createonly','s:94:\"Не редактировать страницу, если она уже существует.\";'),('ru','messages:apihelp-edit-param-md5','s:231:\"MD5-хеш параметра $1text, или конкатенации параметров $1prependtext и $1apendtext. Если задан, правка не будет выполнена при несовпадении хеша.\";'),('ru','messages:apihelp-edit-param-minor','s:74:\"Пометить эту правку как малое изменение.\";'),('ru','messages:apihelp-edit-param-nocreate','s:89:\"Выбрасывать ошибку, если страницы не существует.\";'),('ru','messages:apihelp-edit-param-notminor','s:201:\"Не помечать эту правку как малое изменение даже есть установлена пользовательская настройка «{{int:tog-minordefault}}».\";'),('ru','messages:apihelp-edit-param-pageid','s:157:\"Идентификатор редактируемой страницы. Нельзя использовать одновременно с <var>$1title</var>.\";'),('ru','messages:apihelp-edit-param-prependtext','s:107:\"Добавить этот текст в начало страницы. Переопределяет $1text.\";'),('ru','messages:apihelp-edit-param-recreate','s:158:\"Игнорировать предупреждение о том, что страница была удалена во время редактирования.\";'),('ru','messages:apihelp-edit-param-redirect','s:77:\"Автоматически разрешать перенаправления.\";'),('ru','messages:apihelp-edit-param-section','s:130:\"Номер раздела. <kbd>0</kbd> для верхнего раздела, <kbd>new</kbd> для нового раздела.\";'),('ru','messages:apihelp-edit-param-sectiontitle','s:47:\"Заголовок нового раздела.\";'),('ru','messages:apihelp-edit-param-starttimestamp','s:476:\"Метка времени начала редактирования, используется для обнаружения конфликтов редактирования. Необходимое значение может быть получено с помощью <var>[[Special:ApiHelp/main|curtimestamp]]</var> в начале редактирования (то есть, после загрузки содержимого редактируемой страницы).\";'),('ru','messages:apihelp-edit-param-summary','s:189:\"Описание изменений. Также является заголовком раздела, когда используется $1section=new, а $1sectiontitle не задано.\";'),('ru','messages:apihelp-edit-param-tags','s:78:\"Изменить метки записи в истории изменений.\";'),('ru','messages:apihelp-edit-param-text','s:38:\"Содержимое страницы.\";'),('ru','messages:apihelp-edit-param-title','s:148:\"Название редактируемой страницы. Нельзя использовать одновременно с <var>$1pageid</var>.\";'),('ru','messages:apihelp-edit-param-token','s:195:\"Токен всегда должен быть послан в качестве последнего параметра, или, по крайней мере, после параметра $1text.\";'),('ru','messages:apihelp-edit-param-undo','s:110:\"Отменить это изменение. Переопределяет $text, $1prependtext и $1appendtext.\";'),('ru','messages:apihelp-edit-param-undoafter','s:162:\"Отменить все изменения от $1undo до данного. Если не задано, просто отменить одно изменение.\";'),('ru','messages:apihelp-edit-param-unwatch','s:107:\"Удалить страницу из списка наблюдения текущего участника.\";'),('ru','messages:apihelp-edit-param-watch','s:107:\"Добавить страницу в список наблюдения текущего участника.\";'),('ru','messages:apihelp-edit-param-watchlist','s:243:\"Безусловно добавить или удалить страницу из списка наблюдения текущего участника, использовать настройки или н