,('ru','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:174:\"Возвращает переменные конфигурации JavaScript, свойственные именно этой странице, в виде JSON-строки.\";'),('ru','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:143:\"Возвращает переменные конфигурации JavaScript, свойственные именно этой странице.\";'),('ru','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:310:\"Любые модули ResourceLoader, запрашиваемые функциями парсера на добавление в результат. Одновременно с <kbd>modules</kbd> должен быть запрошен либо <kbd>jsconfigvars</kbd>, либо <kbd>encodedjsconfigvars</kbd>.\";'),('ru','messages:apihelp-expandtemplates-paramvalue-prop-parsetree','s:91:\"Дерево синтаксического разбора XML входных данных.\";'),('ru','messages:apihelp-expandtemplates-paramvalue-prop-properties','s:144:\"Свойства страницы, определённые раскрытыми магическими словами в вики-тексте.\";'),('ru','messages:apihelp-expandtemplates-paramvalue-prop-ttl','s:178:\"Максимальное время, по прошествии которого кэш результата должен быть признан недействительным.\";'),('ru','messages:apihelp-expandtemplates-paramvalue-prop-volatile','s:200:\"Является ли вывод нестабильным и следует ли отказаться от его повторного использования где-либо на странице.\";'),('ru','messages:apihelp-expandtemplates-paramvalue-prop-wikitext','s:43:\"Расширенный вики-текст.\";'),('ru','messages:apihelp-expandtemplates-summary','s:78:\"Разворачивание всех шаблонов в вики-текст.\";'),('ru','messages:apihelp-feedcontributions-example-simple','s:66:\"Показать вклад участника <kbd>Example</kbd>.\";'),('ru','messages:apihelp-feedcontributions-param-deletedonly','s:62:\"Показать только удалённые правки.\";'),('ru','messages:apihelp-feedcontributions-param-feedformat','s:24:\"Формат ленты.\";'),('ru','messages:apihelp-feedcontributions-param-hideminor','s:37:\"Скрыть малые правки.\";'),('ru','messages:apihelp-feedcontributions-param-month','s:34:\"От месяца (и ранее).\";')