ges:apihelp-filerevert-param-comment','s:40:\"Комментарий загрузки.\";'),('ru','messages:apihelp-filerevert-param-filename','s:71:\"Целевое имя файла без префикса «Файл:».\";'),('ru','messages:apihelp-filerevert-summary','s:63:\"Возвращение файла к старой версии.\";'),('ru','messages:apihelp-format-example-generic','s:70:\"Вернуть результат запроса в формате $1.\";'),('ru','messages:apihelp-format-param-wrappedhtml','s:141:\"Вернуть хорошо читаемый HTML со связанными модулями ResourceLoader  в виде объекта JSON.\";'),('ru','messages:apihelp-help-example-help','s:61:\"Справка по самому модулю справки.\";'),('ru','messages:apihelp-help-example-main','s:48:\"Помощь по главному модулю.\";'),('ru','messages:apihelp-help-example-query','s:56:\"Справка по двум подмодулям query.\";'),('ru','messages:apihelp-help-example-recursive','s:55:\"Вся справка на одной странице.\";'),('ru','messages:apihelp-help-example-submodules','s:86:\"Помощь по модулю <kbd>action=query</kbd> и его подмодулям.\";'),('ru','messages:apihelp-help-param-helpformat','s:41:\"Формат вывода справки.\";'),('ru','messages:apihelp-help-param-modules','s:270:\"Модули, справку которых необходимо отобразить (значения параметров <var>action</var> и <var>format</var>, или <kbd>main</kbd>). Можно указывать подмодули с помощью <kbd>+</kbd>.\";'),('ru','messages:apihelp-help-param-recursivesubmodules','s:74:\"Включить справку подмодулей рекурсивно.\";'),('ru','messages:apihelp-help-param-submodules','s:85:\"Включить справку подмодулей заданного модуля.\";'),('ru','messages:apihelp-help-param-toc','s:57:\"Включить содержание в вывод HTML.\";'),('ru','messages:apihelp-help-param-wrap','s:90:\"Обернуть вывод в стандартную структуру API-ответа.\";'),('ru','messages:apihelp-help-summary','s:72:\"Отображение справки указанных модулей.\";'),('ru','messages:apihelp-imagerotate-example-generator','s:114:\"Повернуть все изображения в <kbd>Category:Flip</kbd> на <kbd>180</kbd> градусов.\";'),('ru','messages:apihelp-imagerotate-example-simple','s:83:\"Повернуть <kbd>File:Example.png</kbd> на <kbd>90</kbd> градусов.\";'),('ru','messages:apihelp-imagerotate-param-rotation','s:114:\"На сколько градусов по часовой стрелке повернуть изображение.\";'),('ru','messages:apihelp-imagerotate-param-tags','s:76:\"Изменить метки записи в журнале загрузок.\";'),('ru','messages:apihelp-imagerotate-summary','s:79:\"Поворот одного или нескольких изображений.\";'),('ru','messages:apihelp-import-example-import','s:144:\"Импортировать [[meta:Help:ParserFunctions]] с полной историей правок в пространство имён 100.\";'),('ru','messages:apihelp-import-extended-description','s:340:\"Обратите внимание, что HTTP POST-запрос должен быть осуществлён как загрузка файла (то есть с использованием многотомных данных <code>multipart/form-data</code>) при отправке файла через параметр <var>xml</var>.\";'),('ru','messages:apihelp-import-param-assignknownusers','s:158:\"Связать правки с локальными участниками, когда участники с такими именами существуют.\";'),('ru','messages:apihelp-import-param-fullhistory','s:159:\"Для импорта из других вики: импортировать полную историю, а не только текущую страницу.\";'),('ru','messages:apihelp-import-param-interwikipage','s:94:\"Для импорта из других вики: импортируемая страница.\";'),('ru','messages:apihelp-import-param-interwikiprefix','s:228:\"Для загруженных импортов: префикс интервики для неизвестных имён участников (а также известных, если задан <var>$1assignknownusers</var>).\";'),('ru','messages:apihelp-import-param-interwikisource','s:86:\"Для импорта из других вики: импортируемая вики.\";'),('ru','messages:apihelp-import-param-namespace','s:172:\"Импортировать в это пространство имён. Не может быть использовано одновременно с <var>$1rootpage</var>.\";'),('ru','messages:apihelp-import-param-rootpage','s:202:\"Импортировать в качестве подстраницы данной страницы. Не может быть использовано одновременно с <var>$1namespace</var>.\";'),('ru','messages:apihelp-import-param-summary','s:60:\"Описание записи журнала импорта.\";'),('ru','messages:apihelp-import-param-tags','s:189:\"Метки, которые следует указать у записи в журнале импорта и у нулевой правки в импортируемых страницах.\";'),('ru','messages:apihelp-import-param-templates','s:131:\"Для импорта из других вики: также импортировать все включённые шаблоны.\";'),('ru','messages:apihelp-import-param-xml','s:36:\"Загруженный XML-файл.\";'),('ru','messages:apihelp-import-summary','s:79:\"Импорт страницы из другой вики или XML-файла.\";'),('ru','messages:apihelp-json-param-ascii','s:231:\"Если задано, заменяет все не-ASCII-символы на шестнадцатеричные коды. Применяется по умолчанию, когда <var>formatversion</var> равно <kbd>1</kbd>.\";'),('ru','messages:apihelp-json-param-callback','s:241:\"Если задано, оборачивает вывод в вызов данной функции. Из соображении безопасности, вся пользовательская информация будет удалена.\";'),('ru','messages:apihelp-json-param-formatversion','s:422:\"Формат вывода:\n;1: Обратно совместимый формат (логические значения в стиле XML, ключи <samp>*</samp> для узлов данных, и так далее).\n;2: Современный формат. \n;latest: Использовать последний формат (сейчас <kbd>2</kbd>), может меняться без предупреждения.\";'),('ru','messages:apihelp-json-param-utf8','s:313:\"Если задано, кодирует большинство (но не все) не-ASCII символов в UTF-8 вместо замены их на шестнадцатеричные коды. Применяется по умолчанию, когда <var>formatversion</var> не равно <kbd>1</kbd>.\";'),('ru','messages:apihelp-json-summary','s:53:\"Выводить данные в формате JSON.\";'),('ru','messages:apihelp-jsonfm-summary','s:98:\"Выводить данные в формате JSON (отформатированном в HTML).\";'),('ru','messages:apihelp-link','s:25:\"[[Special:ApiHelp/$1|$2]]\";'),('ru','messages:apihelp-linkaccount-example-link','s:73:\"Начать связывание аккаунта с <kbd>Example</kdb>.\";'),('ru','messages:apihelp-linkaccount-summary','s:99:\"Связать аккаунт третьей стороны с текущим участником.\";'),('ru','messages:apihelp-login-example-login','s:11:\"Войти.\";'),('ru','messages:apihelp-login-extended-description','s:488:\"Это действие должно быть использовано только в комбинации со [[Special:BotPasswords]]; использование этого модуля для входа в основной аккаунт устарело и может сбиться без предупреждения. Для безопасного входа в основной аккаунт, используйте <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('ru','messages:apihelp-login-extended-description-nobotpasswords','s:251:\"Это действие не поддерживается и может сбиться без предупреждения. Для безопасного входа, используйте <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('ru','messages:apihelp-login-param-domain','s:40:\"Домен (необязательно).\";'),('ru','messages:apihelp-login-param-name','s:26:\"Имя участника.\";'),('ru','messages:apihelp-login-param-password','s:13:\"Пароль.\";'),('ru','messages:apihelp-login-param-token','s:79:\"Токен входа, полученный при первом запросе.\";'),('ru','messages:apihelp-login-summary','s:75:\"Вход и получение аутентификационных cookie.\";'),('ru','messages:apihelp-logout-example-logout','s:59:\"Выйти из текущей учётной записи.\";'),('ru','messages:apihelp-logout-summary','s:57:\"Выйти и очистить данные сессии.\";'),('ru','messages:apihelp-main-extended-description','s:1707:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Документация]]\n* [[mw:Special:MyLanguage/API:FAQ|ЧаВО]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Почтовая рассылка]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce Новости API]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Ошибки и запросы]\n</div>\n<strong>Статус:</strong> MediaWiki API — зрелый и стабильный интерфейс, активно поддерживаемый и улучшаемый. Мы стараемся избегать ломающих изменений, однако изредка они могут быть необходимы. Подпишитесь на [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ почтовую рассылку mediawiki-api-announce], чтобы быть в курсе обновлений.\n\n<strong>Ошибочные запросы:</strong> Если API получает запрос с ошибкой, вернётся заголовок HTTP с ключом «MediaWiki-API-Error», после чего значение заголовка и код ошибки будут отправлены обратно и установлены в то же значение. Более подробную информацию см. [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Ошибки и предупреждения]].\n\n<p class=\"mw-apisandbox-link\"><strong>Тестирование:</strong> для удобства тестирования API-запросов, см. [[Special:ApiSandbox]].</p>\";'),('ru','messages:apihelp-main-param-action','s:67:\"Действие, которое следует выполнить.\";'),('ru','messages:apihelp-main-param-assert','s:271:\"Проверить, авторизован ли участник, если задано <kbd>user</kbd>, <em>not</em> авторизирован если задано <kbd>anon</kbd> или что он имеет права бота, если задано <kbd>bot</kbd>.\";'),('ru','messages:apihelp-main-param-assertuser','s:109:\"Проверить, что ник текущего участника совпадает с заданным.\";'),('ru','messages:apihelp-main-param-curtimestamp','s:69:\"Включить в результат временную метку.\";'),('ru','messages:apihelp-main-param-errorformat','s:604:\"Формат, используемый для вывода текста предупреждений и ошибок.\n; plaintext: Вики-текст с удалёнными HTML-тегами и замещёнными мнемониками.\n; wikitext: Нераспарсенный вики-текст.\n; html: HTML.\n; raw: Ключ сообщения и параметры.\n; none: Без текстового вывода, только коды ошибок.\n; bc: Формат, используемый до MediaWiki 1.29. <var>errorlang</var> и <var>errorsuselocal</var> игнорируются.\";'),('ru','messages:apihelp-main-param-errorlang','s:563:\"Язык, используемый для вывода предупреждений и сообщений об ошибках. Запрос <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> с <kbd>siprop=languages</kbd> возвращает список кодов языков; укажите <kbd>content</kbd> для использования основного языка этой вики, или <kbd>uselang</kbd> для использования того же значения, что и в параметре <var>uselang</var>.\";'),('ru','messages:apihelp-main-param-errorsuselocal','s:208:\"Если задан, тексты ошибок будут использовать локально модифицированные сообщения из пространства имён {{ns:MediaWiki}}.\";'),('ru','messages:apihelp-main-param-format','s:26:\"Формат вывода.\";'),('ru','messages:apihelp-main-param-maxage','s:196:\"Установить значение HTTP-заголовка Cache-Control <code>max-age</code> в заданное число секунд. Ошибки никогда не кэшируются.\";'),('ru','messages:apihelp-main-param-maxlag','s:899:\"Значение максимального отставания может использоваться, когда MediaWiki установлена на кластер из реплицируемых баз данных. Чтобы избежать ухудшения ситуации с отставанием репликации сайта, этот параметр может заставить клиента ждать, когда задержка репликации станет ниже указанного значения. В случае чрезмерной задержки возвращается код ошибки «<samp>maxlag</samp>» с сообщением «<samp>Waiting for $host: $lag seconds lagged</samp>».<br>См. подробнее на странице с описанием [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: параметра Maxlag]].\";'),('ru','messages:apihelp-main-param-origin','s:1686:\"При обращении к API с использованием кросс-доменного AJAX-запроса (CORS), задайте параметру значение исходного домена. Этот параметр должен быть включён в любой предварительный запрос и таким образом должен быть частью URI-запроса (не тела POST).\n\nДля аутентифицированных запросов он должен точно соответствовать одному из источников в заголовке <code>Origin</code>, так что он должен быть задан наподобие <kbd>https://ru.wikipedia.org</kbd> или <kbd>https://meta.wikimedia.org</kbd>. Если параметр не соответствует заголовку <code>Origin</code>, будет возвращён ответ с кодом ошибки 403. Если параметр соответствует заголовку <code>Origin</code>, и источник находится в белом списке, будут установлены заголовки <code>Access-Control-Allow-Origin</code> и <code>Access-Control-Allow-Credentials</code>.\n\nДля неаутентифицированных запросов укажите значение <kbd>*</kbd>. В результате заголовок <code>Access-Control-Allow-Origin</code> будет установлен, но <code>Access-Control-Allow-Credentials</code> примет значение <code>false</code> и все пользовательские данные будут ограничены.\";'),('ru','messages:apihelp-main-param-requestid','s:189:\"Любое заданное здесь значение будет включено в ответ. Может быть использовано для различения запросов.\";'),('ru','messages:apihelp-main-param-responselanginfo','s:131:\"Включить языки, использованные для <var>uselang</var> и <var>errorlang</var>, в результат.\";'),('ru','messages:apihelp-main-param-servedby','s:100:\"Включить в результаты имя хоста, обработавшего запрос.\";'),('ru','messages:apihelp-main-param-smaxage','s:197:\"Установить значение HTTP-заголовка Cache-Control <code>s-maxage</code> в заданное число секунд. Ошибки никогда не кэшируются.\";'),('ru','messages:apihelp-main-param-uselang','s:502:\"Язык, используемый для перевода сообщений. Запрос <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> с <kbd>siprop=languages</kbd> возвращает список кодов языков; укажите <kbd>user</kbd>, чтобы использовать текущие языковые настройки участника, или <kbd>content</kbd> для использования основного языка этой вики.\";'),('ru','messages:apihelp-main-summary','s:0:\"\";'),('ru','messages:apihelp-managetags-example-activate','s:110:\"Активировать метку <kbd>spam</kbd> с причиной <kbd>For use in edit patrolling</kbd>.\";'),('ru','messages:apihelp-managetags-example-create','s:122:\"Создать метку с названием <kbd>spam</kbd> с причиной <kbd>For use in edit patrolling</kbd>.\";'),('ru','messages:apihelp-managetags-example-deactivate','s:106:\"Деактивировать метку <kbd>spam</kbd> с причиной <kbd>No longer required</kbd>.\";'),('ru','messages:apihelp-managetags-example-delete','s:87:\"Удалить метку <kbd>vandlaism</kbd> с причиной <kbd>Misspelt</kbd>.\";'),('ru','messages:apihelp-managetags-param-ignorewarnings','s:123:\"Игнорировать ли все предупреждения, возникающие во время операции.\";'),('ru','messages:apihelp-managetags-param-operation','s:689:\"Какую операцию выполнить:\n;create: Создать новую метку для ручного использования.\n;delete: Удалить метку из базы данных, что включает в себя удаление метки со всех версий и записей журналов, где она использовалось.\n;activate: Активировать изменение метки, позволив участникам устанавливать её вручную.\n;deactivate: Деактивировать изменение метки, запретив участникам устанавливать её вручную.\";'),('ru','messages:apihelp-managetags-param-reason','s:156:\"Причина создания, удаления, активирования или деактивирования метки (необязательно).\";'),('ru','messages:apihelp-managetags-param-tag','s:551:\"Создаваемая, удаляемая, активируемая или деактивируемая метка. Создаваемая метка должна не существовать. Удаляемая метка должна существовать. Активируемая метка должна существовать и не быть использованной в каком-либо расширении. Деактивируемая метка должна существовать и быть заданной вручную.\";'),('ru','messages:apihelp-managetags-param-tags','s:95:\"Изменить метки записи в журнале управления метками.\";'),('ru','messages:apihelp-managetags-summary','s:93:\"Осуществление задач, связанных с изменением меток.\";'),('ru','messages:apihelp-mergehistory-example-merge','s:135:\"Переместить всю историю правок страницы <kbd>Oldpage</kbd> на страницу <kbd>Newpage</kdb>.\";'),('ru','messages:apihelp-mergehistory-example-merge-timestamp','s:178:\"Переместить историю правок из <kbd>Oldpage</kbd>, совершённых до <kbd>2015-12-31T04:37:41Z</kbd>, на страницу <kbd>Newpage</kdb>.\";'),('ru','messages:apihelp-mergehistory-param-from','s:205:\"Название страницы, история из которой будет объединяться. Не может быть использовано одновременно с <var>$1fromid</var>.\";'),('ru','messages:apihelp-mergehistory-param-fromid','s:213:\"Идентификатор страницы, история из которой будет объединяться. Не может быть использовано одновременно с <var>$1from</var>.\";'),('ru','messages:apihelp-mergehistory-param-reason','s:60:\"Причина для объединения истории.\";'),('ru','messages:apihelp-mergehistory-param-timestamp','s:366:\"Временная метка, до которой версии будут перемещены из истории страницы-источника в историю целевой страницы. Если опущено, в целевую страницу будет перемещена вся история правок страницы-источника.\";'),('ru','messages:apihelp-mergehistory-param-to','s:220:\"Название страницы, в историю которой будет добавлено объединяемое. Не может быть использовано одновременно с <var>$1toid</var>.\";'),('ru','messages:apihelp-mergehistory-param-toid','s:228:\"Идентификатор страницы, в историю которой будет добавлено объединяемое. Не может быть использовано одновременно с <var>$1to</var>.\";'),('ru','messages:apihelp-mergehistory-summary','s:51:\"Объединение историй правок.\";'),('ru','messages:apihelp-move-example-move','s:130:\"Переименовать <kbd>Badtitle</kbd> в <kbd>Goodtitle</kbd> без оставления перенаправления.\";'),('ru','messages:apihelp-move-param-from','s:156:\"Название переименовываемой страницы. Нельзя использовать одновременно с <var>$1fromid</var>.\";'),('ru','messages:apihelp-move-param-fromid','s:164:\"Идентификатор переименовываемой страницы. Нельзя использовать одновременно с <var>$1from</var>.\";'),('ru','messages:apihelp-move-param-ignorewarnings','s:61:\"Игнорировать все предупреждения.\";'),('ru','messages:apihelp-move-param-movesubpages','s:86:\"Переименовать подстраницы, если это применимо.\";'),('ru','messages:apihelp-move-param-movetalk','s:91:\"Переименовать страницу обсуждения, если она есть.\";'),('ru','messages:apihelp-move-param-noredirect','s:55:\"Не создавать перенаправление.\";'),('ru','messages:apihelp-move-param-reason','s:44:\"Причина переименования.\";'),('ru','messages:apihelp-move-param-tags','s:172:\"Изменить метки записи в журнале переименований и нулевой правки на переименованной странице.\";'),('ru','messages:apihelp-move-param-to','s:45:\"Новое название страницы.\";'),('ru','messages:apihelp-move-param-unwatch','s:141:\"Удалить страницу и перенаправление из списка наблюдения текущего участника.\";'),('ru','messages:apihelp-move-param-watch','s:141:\"Добавить страницу и перенаправление в список наблюдения текущего участника.\";'),('ru','messages:apihelp-move-param-watchlist','s:243:\"Безусловно добавить или удалить страницу из списка наблюдения текущего участника, использовать настройки или не менять наблюдение.\";'),('ru','messages:apihelp-move-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('ru','messages:apihelp-move-summary','s:46:\"Переименование страницы.\";'),('ru','messages:apihelp-no-such-module','s:38:\"Модуль «$1» не найден.\";'),('ru','messages:apihelp-none-summary','s:35:\"Ничего не выводить.\";'),('ru','messages:apihelp-opensearch-example-te','s:71:\"Найти страницы, начинающиеся с <kbd>Te</kbd>.\";'),('ru','messages:apihelp-opensearch-param-format','s:26:\"Формат вывода.\";'),('ru','messages:apihelp-opensearch-param-limit','s:84:\"Максимальное число возвращаемых результатов.\";'),('ru','messages:apihelp-opensearch-param-namespace','s:208:\"Пространства имён для поиска. Игнорируется, если <var>$1search</var> начинается с корректного префикса пространства имён.\";'),('ru','messages:apihelp-opensearch-param-redirects','s:455:\"Как обрабатывать перенаправления:\n;return: Вернуть само перенаправление.\n;resolve: Вернуть целевую страницу. Может вернуть меньше $1limit результатов.\nПо историческим причинам значением по умолчанию является «return» для $1format=json и «resolve» для остальных форматов.\";'),('ru','messages:apihelp-opensearch-param-search','s:26:\"Строка поиска.\";'),('ru','messages:apihelp-opensearch-param-suggest','s:150:\"Ничего не делать, если <var>[[mw:Special:MyLanguage/Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> ложно.\";'),('ru','messages:apihelp-opensearch-param-warningsaserror','s:184:\"Если предупреждения возникают при <kbd>format=json</kbd>, вернуть ошибку API вместо того, чтобы игнорировать их.\";'),('ru','messages:apihelp-opensearch-summary','s:87:\"Поиск по вики с использованием протокола OpenSearch.\";'),('ru','messages:apihelp-options-example-change','s:76:\"Изменить настройки <kbd>skin</kbd> и <kbd>hideminor</kbd>.\";'),('ru','messages:apihelp-options-example-complex','s:114:\"Сбросить все настройки, а затем изменить <kbd>skin</kbd> и <kbd>nickname</kbd>.\";'),('ru','messages:apihelp-options-example-reset','s:43:\"Сбросить все настройки.\";'),('ru','messages:apihelp-options-extended-description','s:398:\"Менять можно только настройки, зарегистрированные в ядре или в одном из установленных расширений, а также настройки, чьи ключи начинаются с <code>userjs-</code> (предназначенные для использования в пользовательских скриптах).\";'),('ru','messages:apihelp-options-param-change','s:715:\"Список изменений в формате название=значение (например, skin=vector). Если значения не даётся (нет даже знака равенства), например, названиенастройки|другаянастройка|, настройка будет возвращена в своё значение по умолчанию. Если какое-либо значение должно содержать знак пайпа (<kbd>|</kbd>), используйте [[Special:ApiHelp/main#main/datatypes|альтернативный разделитель значений]] для корректного проведения операции.\";'),('ru','messages:apihelp-options-param-optionname','s:175:\"Название настройки, которая должна быть установлена в значение, переданное через <var>$1optionvalue</var>.\";'),('ru','messages:apihelp-options-param-optionvalue','s:78:\"Значение настройки, заданной <var>$1optionname</var>.\";'),('ru','messages:apihelp-options-param-reset','s:96:\"Сбрасывает настройки на установленные по умолчанию.\";'),('ru','messages:apihelp-options-param-resetkinds','s:119:\"Список типов сбрасываемых настроек, если задана опция <var>$1reset</var>.\";'),('ru','messages:apihelp-options-summary','s:64:\"Смена настроек текущего участника.\";'),('ru','messages:apihelp-paraminfo-example-1','s:299:\"Показать информацию для <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, и <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('ru','messages:apihelp-paraminfo-example-2','s:125:\"Показать информацию для всех подмодулей <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('ru','messages:apihelp-paraminfo-param-formatmodules','s:189:\"Список названий форматных модулей (значения параметра <var>format</var>). Вместо этого используйте <var>$1modules</var>.\";'),('ru','messages:apihelp-paraminfo-param-helpformat','s:39:\"Формат строк справки.\";'),('ru','messages:apihelp-paraminfo-param-mainmodule','s:154:\"Также получить информацию о главном модуле. Вместо этого используйте <kbd>$1modules=main</kbd>.\";'),('ru','messages:apihelp-paraminfo-param-modules','s:372:\"Список названий модулей (значения параметров <var>action</var> и <var>format</var>, или <kbd>main</kbd>). Можно указать подмодули с помощью <kbd>+</kbd>, все подмодули с помощью <kbd>+*</kbd>, или все подмодули рекурсивно с помощью <kbd>+**</kbd>.\";'),('ru','messages:apihelp-paraminfo-param-pagesetmodule','s:134:\"Также получить информацию о модуле pageset (предоставляющем titles= и синонимы).\";'),('ru','messages:apihelp-paraminfo-param-querymodules','s:228:\"Список модулей query (значения параметров <var>prop</var>, <var>meta</var> или <var>list</var>). Используйте <kbd>$1modules=query+foo</kbd> вместо <kbd>$1querymodules=foo</kbd>.\";'),('ru','messages:apihelp-paraminfo-summary','s:62:\"Получение информации о модулях API.\";'),('ru','messages:apihelp-parse-example-page','s:32:\"Парсинг страницы.\";'),('ru','messages:apihelp-parse-example-summary','s:43:\"Анализ описания правки.\";'),('ru','messages:apihelp-parse-example-text','s:35:\"Анализ вики-текста.\";'),('ru','messages:apihelp-parse-example-texttitle','s:95:\"Парсинг вики-текста с заданным заголовком страницы.\";'),('ru','messages:apihelp-parse-extended-description','s:717:\"См. различные prop-модули <kbd>[[Special:ApiHelp/query|action=query]]</kbd> для получения информации о текущей версии страницы.\n\nЕсть несколько способов указать текст для парсинга:\n# Указать страницу или версию, используя <var>$1page</var>, <var>$1pageid</var> или <var>$1oldid</var>.\n# Явно указать содержимое, используя <var>$1text</var>, <var>$1title</var> и <var>$1contentmodel</var>.\n# Указать описание правки. Параметру <var>$1prop</var> должно быть присвоено пустое значение.\";'),('ru','messages:apihelp-parse-param-contentformat','s:199:\"Формат сериализации содержимого, использующийся во входном тексте. Доступен только при использовании с $1text.\";'),('ru','messages:apihelp-parse-param-contentmodel','s:348:\"Модель содержимого входного текста. Если пропущена, должен быть задан $1title, и значение по умолчанию будет взято в зависимости от указанного названия. Доступно только при использовании с $1text.\";'),('ru','messages:apihelp-parse-param-disableeditsection','s:124:\"Опустить ссылки на редактирование разделов из результата парсинга.\";'),('ru','messages:apihelp-parse-param-disablelimitreport','s:112:\"Опустить отчёт о лимите («NewPP limit report») из результата парсинга.\";'),('ru','messages:apihelp-parse-param-disablepp','s:79:\"Вместо этого используйте <var>$1disablelimitreport</var>.\";'),('ru','messages:apihelp-parse-param-disablestylededuplication','s:114:\"Не дедуплицируйте встроенные таблицы стилей в выходе парсера.\";'),('ru','messages:apihelp-parse-param-disabletoc','s:57:\"Не включать в вывод содержание.\";'),('ru','messages:apihelp-parse-param-effectivelanglinks','s:169:\"Включает языковые ссылки, обеспечиваемые расширениями (для использования с <kbd>$1prop=langlinks</kbd>).\";'),('ru','messages:apihelp-parse-param-generatexml','s:180:\"Сгенерировать дерево парсинга XML (требуется модель содержимого <code>$1</code>, замещено <kbd>$2prop=parsetree</kbd>).\";'),('ru','messages:apihelp-parse-param-oldid','s:135:\"Распарсить содержимое этой версии. Переопределяет <var>$1page</var> и <var>$1pageid</var>.\";'),('ru','messages:apihelp-parse-param-onlypst','s:322:\"Выполнить преобразование перед записью правки (PST) входных данных, но не парсить их. Возвращает тот же вики-текст после применения PST. Доступно только при применении с <var>$1text</var>.\";'),('ru','messages:apihelp-parse-param-page','s:181:\"Распарсить содержимое этой страницы. Не может быть использовано совместно с <var>$1text</var> и <var>$1title</var>.\";'),('ru','messages:apihelp-parse-param-pageid','s:122:\"Анализировать содержимое этой страницы. Переопределяет <var>$1page</var>.\";'),('ru','messages:apihelp-parse-param-preview','s:74:\"Проанализировать в режиме препросмотра.\";'),('ru','messages:apihelp-parse-param-prop','s:49:\"Какую информацию включить:\";'),('ru','messages:apihelp-parse-param-pst','s:251:\"Выполнить преобразование перед записью правки (PST) до того, как начать анализировать текст. Доступно только когда используется с текстом.\";'),('ru','messages:apihelp-parse-param-redirects','s:146:\"Если значением <var>$1page</var> или <var>$1pageid</var> указано перенаправление, разрешить его.\";'),('ru','messages:apihelp-parse-param-revid','s:124:\"Номер версии, для <code><nowiki>{{REVISIONID}}</nowiki></code> и аналогичных переменных.\";'),('ru','messages:apihelp-parse-param-section','s:387:\"Распарсить содержимое только секции с заданным номером.\n\nЕсли задан <kbd>new</kbd>, распарсить <var>$1text</var> и <var>$1sectiontitle</var> так, как будто добавлена новая секция на страницу.\n\n<kbd>new</kbd> доступен только при заданном <var>text</var>.\";'),('ru','messages:apihelp-parse-param-sectionpreview','s:151:\"Распарсить в режиме предпросмотра раздела (также активирует режим предпросмотра).\";'),('ru','messages:apihelp-parse-param-sectiontitle','s:338:\"Название новой секции, когда <var>section</var> имеет значение <kbd>new</kbd>.\n\nВ отличие от редактирования страницы, оно не примет значение параметра <var>summary</var>, если опустить его или оставить пустым.\";'),('ru','messages:apihelp-parse-param-summary','s:57:\"Анализируемое описание правки.\";'),('ru','messages:apihelp-parse-param-text','s:182:\"Распарсиваемый текст. Используйте <var>$1title</var> или <var>$1contentmodel</var> для управления моделью содержимого.\";'),('ru','messages:apihelp-parse-param-title','s:275:\"Название страницы, которой принадлежит текст. Если опущено, должен быть указан параметр <var>$1contentmodel</var>, и в качестве заголовка будет использовано [[API]].\";'),('ru','messages:apihelp-parse-param-useskin','s:299:\"Применить выбранную тему оформления к результату работы парсера. Может затронуть следующие свойства: <kbd>langlinks</kbd>, <kbd>headitems</kbd>, <kbd>modules</kbd>, <kbd>jsconfigvars</kbd>, <kbd>indicators</kbd>.\";'),('ru','messages:apihelp-parse-param-wrapoutputclass','s:101:\"CSS-класс, используемый для оборачивания вывода парсера.\";'),('ru','messages:apihelp-parse-paramvalue-prop-categories','s:106:\"Возвращает категории из проанализированного вики-текста.\";'),('ru','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:58:\"Возвращает HTML-версию категорий.\";'),('ru','messages:apihelp-parse-paramvalue-prop-displaytitle','s:97:\"Добавляет название проанализированного вики-текста.\";'),('ru','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:151:\"Возвращает переменные JavaScript с данными настроек для этой страницы в виде JSON-строки.\";'),('ru','messages:apihelp-parse-paramvalue-prop-externallinks','s:103:\"Возвращает внешние ссылки из распарсенного вики-текста.\";'),('ru','messages:apihelp-parse-paramvalue-prop-headhtml','s:213:\"Возвращает распарсенный тип документа, начальный  <code>&lt;html&gt;</code>, элемент <code>&lt;head&gt;</code> и открывающий <code>&lt;body&gt;</code>.\";'),('ru','messages:apihelp-parse-paramvalue-prop-headitems','s:134:\"Возвращает элементы, которые следует поместить в <code>&lt;head&gt;</code> страницы.\";'),('ru','messages:apihelp-parse-paramvalue-prop-images','s:98:\"Возвращает изображения из распарсенного вики-текста.\";'),('ru','messages:apihelp-parse-paramvalue-prop-indicators','s:121:\"Возвращает HTML-код индикаторов, использованных на данной странице.\";'),('ru','messages:apihelp-parse-paramvalue-prop-iwlinks','s:107:\"Возвращает интервики-ссылки из распарсенного вики-текста.\";'),('ru','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:207:\"Возвращает переменные JavaScript с данными настроек для этой страницы. Для их применения используйте <code>mw.config.set()</code>.\";'),('ru','messages:apihelp-parse-paramvalue-prop-langlinks','s:105:\"Возвращает языковые ссылки из распарсенного вики-текста.\";'),('ru','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:176:\"Возвращает структурированный отчёт о лимите. Не возвращает данных, если задан <var>$1disablelimitreport</var>.\";'),('ru','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:161:\"Возвращает HTML-версию отчёта о лимите. Не возвращает данных, если задан <var>$1disablelimitreport</var>.\";'),('ru','messages:apihelp-parse-paramvalue-prop-links','s:109:\"Возвращает внутренние ссылки из распарсенного вики-текста.\";'),('ru','messages:apihelp-parse-paramvalue-prop-modules','s:343:\"Возвращает использованные на странице модули ResourceLoader. Для загрузки, используйте <code>mw.loader.using()</code>. Одновременно с <kbd>modules</kbd> должно быть запрошено либо <kbd>jsconfigvars</kbd>, либо <kbd>encodedjsconfigvars</kbd>.\";'),('ru','messages:apihelp-parse-paramvalue-prop-parsetree','s:143:\"Дерево парсинга XML содержимого версии (требуется модель содержимого <code>$1</code>).\";'),('ru','messages:apihelp-parse-paramvalue-prop-parsewarnings','s:101:\"Возвращает предупреждения, возникшие во время анализа.\";'),('ru','messages:apihelp-parse-paramvalue-prop-properties','s:143:\"Возвращает различные свойства, объявленные в проанализированном вики-тексте.\";'),('ru','messages:apihelp-parse-paramvalue-prop-revid','s:101:\"Добавляет идентификатор версии распарсенной страницы.\";'),('ru','messages:apihelp-parse-paramvalue-prop-sections','s:102:\"Возвращает разделы из проанализированного вики-текста.\";'),('ru','messages:apihelp-parse-paramvalue-prop-templates','s:102:\"Возвращает шаблоны из проанализированного вики-текста.\";'),('ru','messages:apihelp-parse-paramvalue-prop-text','s:81:\"Возвращает текст распарсенного вики-текста.\";'),('ru','messages:apihelp-parse-paramvalue-prop-wikitext','s:87:\"Возвращает исходный распарсиваемый вики-текст.\";'),('ru','messages:apihelp-parse-summary','s:94:\"Парсит содержимое и возвращает результат парсинга.\";'),('ru','messages:apihelp-patrol-example-rcid','s:63:\"Патрулировать недавние изменения.\";'),('ru','messages:apihelp-patrol-example-revid','s:44:\"Отпатрулировать версию.\";'),('ru','messages:apihelp-patrol-param-rcid','s:86:\"Идентификатор патрулируемой последней правки.\";'),('ru','messages:apihelp-patrol-param-revid','s:67:\"Идентификатор патрулируемой версии.\";'),('ru','messages:apihelp-patrol-param-tags','s:88:\"Изменить метки записи в журнале патрулирования.\";'),('ru','messages:apihelp-patrol-summary','s:66:\"Патрулирование страницы или версии.\";'),('ru','messages:apihelp-php-param-formatversion','s:421:\"Формат вывода:\n;1: Обратно совместимый формат (логические значения в стиле XML, ключи <samp>*</samp> для узлов данных, и так далее).\n;2: Современный формат.\n;latest: Использовать последний формат (сейчас <kbd>2</kbd>), может меняться без предупреждения.\";'),('ru','messages:apihelp-php-summary','s:83:\"Выводить данные в сериализованном формате PHP.\";'),('ru','messages:apihelp-phpfm-summary','s:128:\"Выводить данные в сериализованном формате PHP (отформатированном в HTML).\";'),('ru','messages:apihelp-protect-example-protect','s:34:\"Защитить страницу.\";'),('ru','messages:apihelp-protect-example-unprotect','s:204:\"Снять защиту страницы, установив ограничения <kbd>all</kbd> (то есть, позволив всем проводить действия над страницей).\";'),('ru','messages:apihelp-protect-example-unprotect2','s:83:\"Снять защиту страницу, не указав ограничений.\";'),('ru','messages:apihelp-protect-param-cascade','s:331:\"Активировать каскадную защиту (то есть, защитить включённые шаблоны и использованные изображения). Игнорируется, если ни один из заданных уровней не поддерживает каскадную защиту.\";'),('ru','messages:apihelp-protect-param-expiry','s:340:\"Временная метка истечения защиты. Если задана только одна метка, она будет использована для всех защит. Используйте <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> или <kbd>never</kbd> для бессрочных защит.\";'),('ru','messages:apihelp-protect-param-pageid','s:155:\"Идентификатор (раз)защищаемой страницы. Не может использоваться одновременно с $1title.\";'),('ru','messages:apihelp-protect-param-protections','s:458:\"Список уровней защиты в формате <kbd>действие=уровень</kbd> (например, <kbd>edit=sysop</kbd>). Уровень <kbd>all</kbd> означает, что кто угодно может осуществлять действие, то есть, нет ограничений.\n\n<strong>Примечания:</strong> Все неперечисленные действия потеряют уровни защиты.\";'),('ru','messages:apihelp-protect-param-reason','s:36:\"Причина (раз)защиты.\";'),('ru','messages:apihelp-protect-param-tags','s:72:\"Изменить метки записи в журнале защиты.\";'),('ru','messages:apihelp-protect-param-title','s:146:\"Название (раз)защищаемой страницы. Не может использоваться одновременно с $1pageid.\";'),('ru','messages:apihelp-protect-param-watch','s:157:\"Если задан, добавить (раз)защищаемую страницу в список наблюдения текущего участника.\";'),('ru','messages:apihelp-protect-param-watchlist','s:243:\"Безусловно добавить или удалить страницу из списка наблюдения текущего участника, использовать настройки или не менять наблюдение.\";'),('ru','messages:apihelp-protect-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('ru','messages:apihelp-protect-summary','s:62:\"Изменение уровня защиты страницы.\";'),('ru','messages:apihelp-purge-example-generator','s:109:\"Очистить кэш первых 10 страниц в основном пространстве имён.\";'),('ru','messages:apihelp-purge-example-simple','s:85:\"Очистить кэш для страниц <kbd>Main Page</kbd> и <kbd>API</kbd>.\";'),('ru','messages:apihelp-purge-param-forcelinkupdate','s:143:\"Обновить таблицы ссылок и выполнить другие дополнительные обновления данных.\";'),('ru','messages:apihelp-purge-param-forcerecursivelinkupdate','s:195:\"То же, что <kbd>forcelinkupdate</kbd>, а также обновить таблицу ссылок для всех страниц, использующих данную как шаблон.\";'),('ru','messages:apihelp-purge-summary','s:56:\"Очистка кэша заданных страниц.\";'),('ru','messages:apihelp-query+allcategories-example-generator','s:159:\"Получить информацию о самой странице категории для категорий, начинающихся с <kbd>List</kbd>.\";'),('ru','messages:apihelp-query+allcategories-example-size','s:134:\"Составить список категорий с информацией о числе страниц в каждой из них.\";'),('ru','messages:apihelp-query+allcategories-param-dir','s:36:\"Порядок сортировки.\";'),('ru','messages:apihelp-query+allcategories-param-from','s:76:\"Категория, с которой начать перечисление.\";'),('ru','messages:apihelp-query+allcategories-param-limit','s:49:\"Сколько категорий вернуть.\";'),('ru','messages:apihelp-query+allcategories-param-max','s:129:\"Вернуть только категории, в которых не больше заданного числа страниц.\";'),('ru','messages:apihelp-query+allcategories-param-min','s:129:\"Вернуть только категории, в которых не меньше заданного числа страниц.\";'),('ru','messages:apihelp-query+allcategories-param-prefix','s:111:\"Найти все названия категорий, начинающиеся с этого значения.\";'),('ru','messages:apihelp-query+allcategories-param-prop','s:45:\"Какие свойства получить:\";'),('ru','messages:apihelp-query+allcategories-param-to','s:84:\"Категория, на которой закончить перечисление.\";'),('ru','messages:apihelp-query+allcategories-paramvalue-prop-hidd