-query+allpages-param-prtype','s:74:\"Перечислить только защищённые страницы.\";'),('ru','messages:apihelp-query+allpages-param-to','s:99:\"Название страницы, на которой закончить перечисление.\";'),('ru','messages:apihelp-query+allpages-summary','s:99:\"Перечисление всех страниц в данном пространстве имён.\";'),('ru','messages:apihelp-query+allredirects-example-b','s:202:\"Список целевых страниц, в включая несуществующих, с идентификаторами перенаправлений, начиная с буквы <kbd>B</kbd>.\";'),('ru','messages:apihelp-query+allredirects-example-generator','s:81:\"Список страниц, содержащих перенаправления.\";'),('ru','messages:apihelp-query+allredirects-example-unique','s:64:\"Список уникальных целевых страниц.\";'),('ru','messages:apihelp-query+allredirects-example-unique-generator','s:101:\"Список всех целевых страниц с отметкой несуществующих.\";'),('ru','messages:apihelp-query+allredirects-param-dir','s:40:\"Порядок перечисления.\";'),('ru','messages:apihelp-query+allredirects-param-from','s:107:\"Название перенаправления, с которого начать перечисление.\";'),('ru','messages:apihelp-query+allredirects-param-limit','s:49:\"Сколько элементов вернуть.\";'),('ru','messages:apihelp-query+allredirects-param-namespace','s:66:\"Пространство имён для перечисления.\";'),('ru','messages:apihelp-query+allredirects-param-prefix','s:122:\"Найти все названия целевых страниц, начинающихся с этого значения.\";'),('ru','messages:apihelp-query+allredirects-param-prop','s:49:\"Какую информацию включить:\";'),('ru','messages:apihelp-query+allredirects-param-to','s:113:\"Название перенаправления, на котором закончить перечисление.\";'),('ru','messages:apihelp-query+allredirects-param-unique','s:358:\"Показывать только уникальные целевые страницы. Не может быть использовано одновременно с $1prop=ids|fragment|interwiki. При использовании в качестве генератора, перечисляет целевые страницы вместо исходных.\";'),('ru','messages:apihelp-query+allredirects-paramvalue-prop-fragment','s:194:\"Добавляет фрагмент из перенаправления при наличии (не может быть использовано одновременно с <var>$1unique</var>).\";'),('ru','messages:apihelp-query+allredirects-paramvalue-prop-ids','s:196:\"Добавляет идентификатор перенаправляемой страницы (не может быть использовано одновременно с <var>$1unique</var>).\";'),('ru','messages:apihelp-query+allredirects-paramvalue-prop-interwiki','s:197:\"Добавляет префикс интервики к редиректу при наличии (не может быть использовано одновременно с <var>$1unique</var>).\";'),('ru','messages:apihelp-query+allredirects-paramvalue-prop-title','s:67:\"Добавляет название перенаправления.\";'),('ru','messages:apihelp-query+allredirects-summary','s:121:\"Перечисление всех перенаправлений на заданное пространство имён.\";'),('ru','messages:apihelp-query+allrevisions-example-ns-any','s:100:\"Перечислить первые 50 правок в любом пространстве имён.\";'),('ru','messages:apihelp-query+allrevisions-example-user','s:96:\"Перечислить последние 50 правок участника <kbd>Example</kbd>.\";'),('ru','messages:apihelp-query+allrevisions-param-end','s:95:\"Временная метка, на которой закончить перечисление.\";'),('ru','messages:apihelp-query+allrevisions-param-excludeuser','s:75:\"Не перечислять правки данного участника.\";'),('ru','messages:apihelp-query+allrevisions-param-generatetitles','s:186:\"При использовании в качестве генератора, генерирует названия страниц вместо идентификаторов версий.\";'),('ru','messages:apihelp-query+allrevisions-param-namespace','s:98:\"Перечислять только страницы этого пространства имён.\";'),('ru','messages:apihelp-query+allrevisions-param-start','s:87:\"Временная метка, с которой начать перечисление.\";'),('ru','messages:apihelp-query+allrevisions-param-user','s:60:\"Только правки данного участника.\";'),('ru','messages:apihelp-query+allrevisions-summary','s:47:\"Перечисление всех версий.\";'),('ru','messages:apihelp-query+alltransclusions-example-b','s:242:\"Списки заголовков включаемых страниц, в том числе несуществующи