ages:apihelp-query+allusers-example-y','s:66:\"Список участников, начиная с <kbd>Y</kbd>.\";'),('ru','messages:apihelp-query+allusers-param-activeusers','s:161:\"Перечислять только участников, которые были активны в последние $1 {{PLURAL:$1|день|дня|дней}}.\";'),('ru','messages:apihelp-query+allusers-param-attachedwiki','s:164:\"С <kbd>$1prop=centralids</kbd>, также отображает, прикреплён ли к вики участник с этим идентификатором.\";'),('ru','messages:apihelp-query+allusers-param-dir','s:36:\"Порядок сортировки.\";'),('ru','messages:apihelp-query+allusers-param-excludegroup','s:69:\"Исключать участников из данных групп.\";'),('ru','messages:apihelp-query+allusers-param-from','s:66:\"Ник, с которого начать перечисление.\";'),('ru','messages:apihelp-query+allusers-param-group','s:80:\"Включать участников только из данных групп.\";'),('ru','messages:apihelp-query+allusers-param-limit','s:41:\"Сколько ников вернуть.\";'),('ru','messages:apihelp-query+allusers-param-prefix','s:84:\"Найти все ники, начинающиеся с этого значения.\";'),('ru','messages:apihelp-query+allusers-param-prop','s:49:\"Какую информацию включить:\";'),('ru','messages:apihelp-query+allusers-param-rights','s:314:\"Включать только участников с данными правами. Участники с правами, предоставляемыми автоматически присваиваемыми группами — такими, как *, user или autoconfirmed, — не включаются.\";'),('ru','messages:apihelp-query+allusers-param-to','s:72:\"Ник, на котором закончить перечисление.\";'),('ru','messages:apihelp-query+allusers-param-witheditsonly','s:94:\"Перечислять только участников, совершавших правки.\";'),('ru','messages:apihelp-query+allusers-paramvalue-prop-blockinfo','s:100:\"Добавляет информацию о текущих блокировках участника.\";'),('ru','messages:apihelp-query+allusers-paramvalue-prop-centralids','s:129:\"Добавляет центральный идентификатор и статус прикрепления участника.\";'),('ru','messages:apihelp-query+allusers-paramvalue-prop-editcount','s:66:\"Добавляет счётчик правок участника