ample-simple','s:56:\"Показать ссылки на <kbd>Main page</kbd>.\";'),('ru','messages:apihelp-query+backlinks-param-dir','s:40:\"Порядок перечисления.\";'),('ru','messages:apihelp-query+backlinks-param-filterredir','s:256:\"Как обрабатывать перенаправления. Если присвоено значение <kbd>nonredirects</kbd> при заданном <var>$1redirect</var>, это применяется только ко второму уровню.\";'),('ru','messages:apihelp-query+backlinks-param-limit','s:308:\"Сколько страниц вернуть. Если задан <var>$1redirect</var>, лимит применяется к каждому уровню по отдельности (что означает, что всего может вернуться до 2 * <var>$1limit</var> результатов).\";'),('ru','messages:apihelp-query+backlinks-param-namespace','s:66:\"Пространство имён для перечисления.\";'),('ru','messages:apihelp-query+backlinks-param-pageid','s:160:\"Идентификатор страницы для поиска. Не может быть использован одновременно с <var>$1title</var>.\";'),('ru','messages:apihelp-query+backlinks-param-redirect','s:314:\"Если ссылающаяся страница является перенаправлением, найти также все страницы, которые ссылаются на это перенаправление. Максимальный лимит становится в два раза меньше.\";'),('ru','messages:apihelp-query+backlinks-param-title','s:136:\"Заголовок для поиска. Не может быть использован одновременно с <var>$1pageid</var>.\";'),('ru','messages:apihelp-query+backlinks-summary','s:106:\"Получение списка страниц, ссылающихся на данную страницу.\";'),('ru','messages:apihelp-query+blocks-example-simple','s:34:\"Список блокировок.\";'),('ru','messages:apihelp-query+blocks-example-users','s:90:\"Список блокировок участников <kbd>Alice</kbd> и <kbd>Bob</kbd>.\";'),('ru','messages:apihelp-query+blocks-param-end','s:95:\"Временная метка, на которой закончить перечисление.\";'),('ru','messages:apihelp-query+blocks-param-ids','s:94:\"Список идентификаторов блокировки (необязательно).\";'),('ru','messages:apihelp-query+blocks-param-ip','s:377:\"Получить все блокировки, применённые к этому IP-адресу или диапазону CIDR, включая блокировки диапазонов.\nНе может быть использовано одновременно с <var>$3users</var>. Диапазоны CIDR шире IPv4/$1 или IPv6/$2 не поддерживаются.\";'),('ru','messages:apihelp-query+blocks-param-limit','s:73:\"Максимальное число блокировок в списке.\";'),('ru','messages:apihelp-query+blocks-param-prop','s:45:\"Какие свойства получить:\";'),('ru','messages:apihelp-query+blocks-param-show','s:280:\"Показать только элементы, удовлетворяющие этим критериям.\nНапример, чтобы отобразить только бессрочные блокировки IP-адресов, установите <kbd>$1show=ip|!temp</kbd>.\";'),('ru','messages:apihelp-query+blocks-param-start','s:87:\"Временная метка, с которой начать перечисление.\";'),('ru','messages:apihelp-query+blocks-param-users','s:78:\"Список искомых участников (необязательно).\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-by','s:78:\"Добавляет ник заблокировавшего участника.\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-byid','s:98:\"Добавляет идентификатор заблокировавшего участника.\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-expiry','s:93:\"Добавляет метку времени, когда блокировка истечёт.\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-flags','s:82:\"Добавляет бану метку (autoblock, anonoly, и так далее).\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-id','s:67:\"Добавляет идентификатор блокировки.\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-range','s:99:\"Добавляет диапазон IP-адресов, затронутых блокировкой.\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-reason','s:55:\"Добавляет причину блокировки.\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-restrictions','s:166:\"Добавляет ограничения частичных блокировок, если блокировка не действует во всём проекте.\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-timestamp','s:96:\"Добавляет метку времени, когда была дана блокировка.\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-user','s:78:\"Добавляет ник заблокированного участника.\";'),('ru','messages:apihelp-query+blocks-paramvalue-prop-userid','s:98:\"Добавляет идентификатор заблокированного участника.\";'),('ru','messages:apihelp-query+blocks-summary','s:107:\"Перечисление всех заблокированных участников и IP-адресов.\";'),('ru','messages:apihelp-query+categories-example-generator','s:150:\"Получить информацию о всех категориях, использованных на странице <kbd>Albert Einstein</kbd>.\";'),('ru','messages:apihelp-query+categories-example-simple','s:129:\"Получить список категорий, в которые включена страница <kbd>Albert Einstein</kbd>.\";'),('ru','messages:apihelp-query+categories-param-categories','s:212:\"Перечислять только данные категории. Полезно для проверки, включена ли конкретная страница в конкретную категорию.\";'),('ru','messages:apihelp-query+categories-param-dir','s:40:\"Порядок перечисления.\";'),('ru','messages:apihelp-query+categories-param-limit','s:49:\"Сколько категорий вернуть.\";'),('ru','messages:apihelp-query+categories-param-prop','s:113:\"Какие дополнительные свойства получить для каждой категории:\";'),('ru','messages:apihelp-query+categories-param-show','s:56:\"Какие типы категорий показать.\";'),('ru','messages:apihelp-query+categories-paramvalue-prop-hidden','s:121:\"Отмечает категории, скрытые магическим словом <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('ru','messages:apihelp-query+categories-paramvalue-prop-sortkey','s:222:\"Добавляет ключ сортировки (шестнадцатеричная строка) и префикс ключа сортировки (человеко-читаемая часть) для категории.\";'),('ru','messages:apihelp-query+categories-paramvalue-prop-timestamp','s:104:\"Добавляет метку времени, когда категория была добавлена.\";'),('ru','messages:apihelp-query+categories-summary','s:109:\"Перечисление всех категорий, которым принадлежит страница.\";'),('ru','messages:apihelp-query+categoryinfo-example-simple','s:92:\"Получить информацию о <kbd>Category:Foo</kbd> и <kbd>Category:Bar</kbd>.\";'),('ru','messages:apihelp-query+categoryinfo-summary','s:89:\"Возвращение информации о конкретных категориях.\";'),('ru','messages:apihelp-query+categorymembers-example-generator','s:107:\"Получить информацию о первых 10 страницах в <kbd>Category:Physics</kbd>.\";'),('ru','messages:apihelp-query+categorymembers-example-simple','s:79:\"Получить первые 10 страниц в <kbd>Category:Physics</kbd>.\";'),('ru','messages:apihelp-query+categorymembers-param-dir','s:36:\"Порядок сортировки.\";'),('ru','messages:apihelp-query+categorymembers-param-end','s:210:\"Временная метка, на которой закончить перечисление. Может быть использовано только одновременно с <kbd>$1sort=timestamp</kbd>.\";'),('ru','messages:apihelp-query+categorymembers-param-endhexsortkey','s:260:\"Ключ сортировки, на котором закончить перечисление, возвращённый <kbd>$1prop=sortkey</kbd>. Может быть использовано только одновременно с <kbd>$1sort=sortkey</kbd>.\";'),('ru','messages:apihelp-query+categorymembers-param-endsortkey','s:63:\"Используйте вместо этого $1endhexsortkey.\";'),('ru','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:423:\"Префикс ключа сортировки, <strong>перед</strong> которым закончить перечисление (не <strong>на<strong> котором; если это значение существует, оно не будет включено!). Может быть использовано только одновременно с $1sort=sortkey. Переопределяет $1endhexsortkey.\";'),('ru','messages:apihelp-query+categorymembers-param-limit','s:76:\"Максимальное число возвращаемых страниц.\";'),('ru','messages:apihelp-query+categorymembers-param-namespace','s:295:\"Включать только страница из этих пространств имён. Обратите внимание, что вместо <kbd>$1namespace=14</kbd> или <kbd>6</kbd> могут быть использованы <kbd>$1type=subcat</kbd> или <kbd>$1type=file</kbd>.\";'),('ru','messages:apihelp-query+categorymembers-param-pageid','s:171:\"Идентификатор перечисляемой категории. Не может быть использовано одновременно с <var>$1title</var>.\";'),('ru','messages:apihelp-query+categorymembers-param-prop','s:49:\"Какую информацию включить:\";'),('ru','messages:apihelp-query+categorymembers-param-sort','s:45:\"Свойство для сортировки.\";'),('ru','messages:apihelp-query+categorymembers-param-start','s:202:\"Временная метка, с которой начать перечисление. Может быть использовано только одновременно с <kbd>$1sort=timestamp</kbd>.\";'),('ru','messages:apihelp-query+categorymembers-param-starthexsortkey','s:254:\"Ключ сортировки, с которого начать перечисление, возвращённый <kbd>$1prop=sortkey</kbd>. Может быть использовано только одновременно с <kbd>$1sort=sortkey</kbd>.\";'),('ru','messages:apihelp-query+categorymembers-param-startsortkey','s:65:\"Используйте вместо этого $1starthexsortkey.\";'),('ru','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:253:\"Префикс ключа сортировки, с которого начать перечисление. Может быть использовано только с <kbd>$1sort=sortkey</kbd>. Переопределяет <var>$1starthexsortkey</var>.\";'),('ru','messages:apihelp-query+categorymembers-param-title','s:275:\"Страницы какой категории перечислять (обязательно). Префикс <kbd>{{ns:category}}:</kbd> должен быть включён. Не может быть использовано одновременно с <var>$1pageid</var>.\";'),('ru','messages:apihelp-query+categorymembers-param-type','s:113:\"Какие типы страниц включать. Игнорируется при <kbd>$1sort=timestamp</kbd>.\";'),('ru','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:63:\"Добавляет идентификатор страницы.\";'),('ru','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:164:\"Добавляет ключ, используемый для сортировки внутри категории (шестнадцатеричная строка).\";'),('ru','messages:apihelp-query+categorymembers-paramvalue-prop-sortkeyprefix','s:191:\"Добавляет префикс ключа, используемого для сортировки внутри категории (человеко-читаемая часть ключа).\";'),('ru','messages:apihelp-query+categorymembers-paramvalue-prop-timestamp','s:100:\"Добавляет метку времени, когда страница была включена.\";'),('ru','messages:apihelp-query+categorymembers-paramvalue-prop-title','s:119:\"Добавляет заголовок и идентификатор пространства имён страницы.\";'),('ru','messages:apihelp-query+categorymembers-paramvalue-prop-type','s:142:\"Добавляет тип категоризованной страницы (<samp>page</samp>, <samp>subcat</samp> или <samp>file</samp>).\";'),('ru','messages:apihelp-query+categorymembers-summary','s:84:\"Перечисление всех страниц в данной категории.\";'),('ru','messages:apihelp-query+contributors-example-simple','s:76:\"Показать редакторов страницы <kbd>Main Page</kbd>.\";'),('ru','messages:apihelp-query+contributors-param-excludegroup','s:229:\"Исключать участников из заданных групп. Неявные или автоматически присваиваемые группы, вроде *, user или autoconfirmed, не считаются.\";'),('ru','messages:apihelp-query+contributors-param-excluderights','s:325:\"Исключать участников с данными правами. Участники с правами, предоставляемыми неявными или автоматически присваиваемыми группами — такими, как *, user или autoconfirmed, — не считаются.\";'),('ru','messages:apihelp-query+contributors-param-group','s:236:\"Включать только участников из данных групп. Неявные или автоматически присваиваемые группы, вроде *, user или autoconfirmed, не считаются.\";'),('ru','messages:apihelp-query+contributors-param-limit','s:51:\"Сколько редакторов вернуть.\";'),('ru','messages:apihelp-query+contributors-param-rights','s:336:\"Включать только участников с данными правами. Участники с правами, предоставляемыми неявными или автоматически присваиваемыми группами — такими, как *, user или autoconfirmed, — не считаются.\";'),('ru','messages:apihelp-query+contributors-summary','s:150:\"Получение списка зарегистрированных и количества анонимных редакторов страницы.\";'),('ru','messages:apihelp-query+deletedrevisions-example-revids','s:91:\"Список информации для удалённой правки <kbd>123456</kbd>.\";'),('ru','messages:apihelp-query+deletedrevisions-example-titles','s:134:\"Список удалённых правок страниц <kbd>Main Page</kbd> и <kbd>Talk:Main Page</kbd> с содержимым.\";'),('ru','messages:apihelp-query+deletedrevisions-extended-description','s:555:\"Может быть использовано несколькими способами:\n# Получение удалённых правок для набора страниц, заданного с помощью названий или идентификаторов. Сортируется по названиям и временным меткам.\n# Получение данных о наборе удалённых правок, заданных с помощью их revid. Сортируется по идентификаторам версий.\";'),('ru','messages:apihelp-query+deletedrevisions-param-end','s:204:\"Временная метка, на которой закончить перечисление. Игнорируется при обработке списка идентификаторов версий.\";'),('ru','messages:apihelp-query+deletedrevisions-param-excludeuser','s:75:\"Не перечислять правки данного участника.\";'),('ru','messages:apihelp-query+deletedrevisions-param-start','s:196:\"Временная метка, с которой начать перечисление. Игнорируется при обработке списка идентификаторов версий.\";'),('ru','messages:apihelp-query+deletedrevisions-param-tag','s:59:\"Только правки с заданной меткой.\";'),('ru','messages:apihelp-query+deletedrevisions-param-user','s:60:\"Только правки данного участника.\";'),('ru','messages:apihelp-query+deletedrevisions-summary','s:79:\"Получение информации об удалённых правках.\";'),('ru','messages:apihelp-query+deletedrevs-example-mode1','s:168:\"Список последних удалённых правок страниц <kbd>Main Page</kbd> и <kbd>Talk:Main Page</kbd> с содержимым (режим 1).\";'),('ru','messages:apihelp-query+deletedrevs-example-mode2','s:116:\"Список последних 50 удалённых правок участника <kbd>Bob</kbd> (режим 2).\";'),('ru','messages:apihelp-query+deletedrevs-example-mode3-main','s:135:\"Список последних 50 удалённых правок в основном пространстве имён (режим 3)\";'),('ru','messages:apihelp-query+deletedrevs-example-mode3-talk','s:133:\"Список последних 50 удалённых страниц в пространстве имён {{ns:talk}} (режим 3).\";'),('ru','messages:apihelp-query+deletedrevs-extended-description','s:891:\"Работает в трёх режимах:\n# Перечисление удалённых правок для заданных названий страниц, сортируется по временным меткам.\n# Перечисление удалённого вклада заданного участника, сортируется по временным меткам (названия страниц не указываются).\n# Перечисление удалённых правок в заданном пространстве имён, сортируется по названиям страниц и временным меткам (названия страниц и $1user не указываются).\n\nОпределённые параметры применяются только к некоторым режимам и игнорируются в других.\";'),('ru','messages:apihelp-query+deletedrevs-param-end','s:95:\"Временная метка, на которой закончить перечисление.\";'),('ru','messages:apihelp-query+deletedrevs-param-excludeuser','s:75:\"Не перечислять правки данного участника.\";'),('ru','messages:apihelp-query+deletedrevs-param-from','s:71:\"Начать перечисление на этом заголовке.\";'),('ru','messages:apihelp-query+deletedrevs-param-limit','s:75:\"Максимальное количество правок в списке.\";'),('ru','messages:apihelp-query+deletedrevs-param-namespace','s:98:\"Перечислять только страницы этого пространства имён.\";'),('ru','messages:apihelp-query+deletedrevs-param-prefix','s:107:\"Найти все названия страниц, начинающиеся с этого значения.\";'),('ru','messages:apihelp-query+deletedrevs-param-prop','s:1014:\"Какие свойства возвращать:\n;revid: Добавляет идентификатор удалённой правки.\n;parentid: Добавляет идентификатор предыдущей версии страницы.\n;user: Добавляет ник участника, сделавшего правку.\n;userid: Добавляет идентификатор участника, сделавшего правку.\n;comment: Добавляет описание правки.\n;parsedcomment: Добавляет распарсенное описание правки.\n;minor: Отмечает, была ли правка малым.\n;len: Добавляет длину (в байтах) правки.\n;sha1: Добавляет хэш SHA-1 (base 16) правки.\n;content: Добавляет содержимое правки.\n;token: <span class=\"apihelp-deprecated\">Устарело.</span> Возвращает токен редактирования.\n;tags: Метки правки.\";'),('ru','messages:apihelp-query+deletedrevs-param-start','s:87:\"Временная метка, с которой начать перечисление.\";'),('ru','messages:apihelp-query+deletedrevs-param-tag','s:59:\"Только правки с заданной меткой.\";'),('ru','messages:apihelp-query+deletedrevs-param-to','s:77:\"Закончить перечисление на этом заголовке.\";'),('ru','messages:apihelp-query+deletedrevs-param-unique','s:93:\"Перечислять только одну правку на каждую страницу.\";'),('ru','messages:apihelp-query+deletedrevs-param-user','s:60:\"Только правки данного участника.\";'),('ru','messages:apihelp-query+deletedrevs-paraminfo-modes','s:33:\"{{PLURAL:$1|Мод|Моды}}: $2\";'),('ru','messages:apihelp-query+deletedrevs-summary','s:57:\"Перечисление удалённых правок.\";'),('ru','messages:apihelp-query+disabled-summary','s:59:\"Этот запрос-модуль был отключён.\";'),('ru','messages:apihelp-query+duplicatefiles-example-generated','s:54:\"Поиск дубликатов всех файлов.\";'),('ru','messages:apihelp-query+duplicatefiles-example-simple','s:67:\"Поиск дубликатов [[:File:Albert Einstein Head.jpg]].\";'),('ru','messages:apihelp-query+duplicatefiles-param-dir','s:40:\"Порядок перечисления.\";'),('ru','messages:apihelp-query+duplicatefiles-param-limit','s:51:\"Сколько дубликатов вернуть.\";'),('ru','messages:apihelp-query+duplicatefiles-param-localonly','s:82:\"Искать только файлы в локальном репозитории.\";'),('ru','messages:apihelp-query+duplicatefiles-summary','s:169:\"Перечисление всех файлов, являющихся дубликатами данных, основываясь на сравнении хэш-сумм.\";'),('ru','messages:apihelp-query+embeddedin-example-generator','s:107:\"Получить информацию о страницах, включающих <kbd>Template:Stub</kbd>.\";'),('ru','messages:apihelp-query+embeddedin-example-simple','s:61:\"Показать включения <kbd>Template:Stub</kbd>.\";'),('ru','messages:apihelp-query+embeddedin-param-dir','s:40:\"Порядок перечисления.\";'),('ru','messages:apihelp-query+embeddedin-param-filterredir','s:61:\"Как фильтровать перенаправления.\";'),('ru','messages:apihelp-query+embeddedin-param-limit','s:45:\"Сколько страниц вернуть.\";'),('ru','messages:apihelp-query+embeddedin-param-namespace','s:66:\"Пространство имён для перечи