anges-param-limit','s:43:\"Сколько правок вернуть.\";'),('ru','messages:apihelp-query+recentchanges-param-namespace','s:74:\"Только правки в этих пространствах имён.\";'),('ru','messages:apihelp-query+recentchanges-param-prop','s:67:\"Включить дополнительную информацию:\";'),('ru','messages:apihelp-query+recentchanges-param-show','s:322:\"Показать только элементы, удовлетворяющие данным критериям. Например, чтобы отобразить только малые правки, сделанные зарегистрированными участниками, установите $1show=minor|!anon.\";'),('ru','messages:apihelp-query+recentchanges-param-slot','s:44:\"Only list changes that touch the named slot.\";'),('ru','messages:apihelp-query+recentchanges-param-start','s:87:\"Временная метка, с которой начать перечисление.\";'),('ru','messages:apihelp-query+recentchanges-param-tag','s:59:\"Только правки с заданной меткой.\";'),('ru','messages:apihelp-query+recentchanges-param-title','s:72:\"Вернуть записи, связанные со страницей.\";'),('ru','messages:apihelp-query+recentchanges-param-token','s:116:\"Вместо этого используйте <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\";'),('ru','messages:apihelp-query+recentchanges-param-toponly','s:83:\"Перечислять только последние правки страниц.\";'),('ru','messages:apihelp-query+recentchanges-param-type','s:50:\"Какие типы правок показать.\";'),('ru','messages:apihelp-query+recentchanges-param-user','s:60:\"Только правки данного участника.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-autopatrolled','s:145:\"Отмечает патрулируемые правки как отпатрулированные или неотпатрулированные.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:49:\"Добавляет описание правки.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-flags','s:43:\"Добавляет метки правки.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:120:\"Добавляет идентификаторы страницы, правки, старой и новой версии.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:148:\"Добавляет информацию о записи журнала (идентификатор записи, её тип, и так далее).\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:74:\"Добавляет распарсенное описание правки.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:145:\"Отмечает патрулируемые правки как отпатрулированные или неотпатрулированные.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:107:\"Отмечает правку, если страница является перенаправлением.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:128:\"Добавляет значение контрольных сумм для записей, связанных с версией.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:90:\"Добавляет старую и новую длину страницы в байтах.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-tags','s:47:\"Перечисляет метки записи.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:62:\"Добавляет временную метку правки.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:90:\"Добавляет заголовок отредактированной страницы.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:121:\"Добавить анонимных участников, ответственных за правку или метку.\";'),('ru','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:110:\"Добавить идентификатор ответственного за правку участника.\";'),('ru','messages:apihelp-query+recentchanges-summary','s:57:\"Перечисление последних правок.\";'),('ru','messages:apihelp-query+redirects-example-generator','s:102:\"Получить информацию о всех перенаправлениях на [[Main Page]].\";'),('ru','messages:apihelp-query+redirects-example-simple','s:80:\"Получить список перенаправлений на [[Main Page]].\";'),('ru','messages:apihelp-query+redirects-param-limit','s:61:\"Сколько перенаправлений вернуть.\";'),('ru','messages:apihelp-query+redirects-param-namespace',