isions+base-paramvalue-prop-ids','s:40:\"Идентификатор версии.\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment','s:55:\"Распарсенное описание правки.\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-parsetree','s:294:\"Используйте <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> или <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>. Дерево парсинга XML-содержимого версии (требуется модель содержимого <code>$1</code>).\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-roles','s:51:\"List content slot roles that exist in the revision.\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-sha1','s:165:\"SHA-1-хэш (base 16) версии. Если содержимое было удалено, будет возвращено свойство <samp>sha1hidden</samp>.\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-size','s:42:\"Длина версии (в байтах).\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-slotsha1','s:133:\"SHA-1 (base 16) of each revision slot. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-slotsize','s:37:\"Length (bytes) of each revision slot.\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-tags','s:24:\"Метки версии.\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-timestamp','s:43:\"Временная метка версии.\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-user','s:50:\"Участник, создавший версию.\";'),('ru','messages:apihelp-query+revisions+base-paramvalue-prop-userid','s:59:\"Идентификатор создателя версии.\";'),('ru','messages:apihelp-query+revisions-example-content','s:147:\"Получить данные с содержимым для последних версий страниц <kbd>API</kbd> и <kbd>Main Page</kbd>.\";'),('ru','messages:apihelp-query+revisions-example-first5','s:66:\"Получить первые 5 версий <kbd>Main Page</kbd>.\";'),('ru','messages:apihelp-q