s:104:\"Разблокировать участника <kbd>Bob</kbd> по причине <kbd>Sorry Bob</kbd>.\";'),('ru','messages:apihelp-unblock-param-id','s:255:\"Идентификатор снимаемой блокировки (получается с помощью <kbd>list=blocks</kbd>). Не может быть использовано одновременно с <var>$1user</var> или <var>$1userid</var>.\";'),('ru','messages:apihelp-unblock-param-reason','s:42:\"Причина разблокировки.\";'),('ru','messages:apihelp-unblock-param-tags','s:80:\"Изменить метки записи в журнале блокировок.\";'),('ru','messages:apihelp-unblock-param-user','s:232:\"Имя участника, IP-адрес или диапазон IP-адресов, которые вы хотите разблокировать. Нельзя использовать одновременно с <var>$1userid</var>\";'),('ru','messages:apihelp-unblock-param-userid','s:219:\"Идентификатор участника, которого вы хотите разблокировать. Нельзя использовать одновременно с <var>$1id</var> или <var>$1user</var>.\";'),('ru','messages:apihelp-unblock-summary','s:46:\"Разблокировка участника.\";'),('ru','messages:apihelp-undelete-example-page','s:63:\"Восстановить страницу <kbd>Main Page</kbd>.\";'),('ru','messages:apihelp-undelete-example-revisions','s:83:\"Восстановить две версии страницы <kbd>Main Page</kbd>.\";'),('ru','messages:apihelp-undelete-extended-description','s:390:\"Список удалённых версий с временными метками может быть получен с помощью [[Special:ApiHelp/query+deletedrevisions|prop=deletedrevisions]], а список идентификаторов удалённых файлов может быть получен с помощью [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('ru','messages:apihelp-undelete-param-fileids','s:228:\"Идентификаторы восстанавливаемых файловых версий. Если и <var>$1timestamps</var>, и <var>$1fileids</var> пустые, все версии будут восстановлены.\";'),('ru','messages:apihelp-undelete-param-reason','s:44:\"Причина восстановления.\";'),('ru','messages:apihelp-undelete-param-tags','s:76:\"Изменить метки записи в журнале удалений.\";'),('ru','messages:apihelp-undelete-param-timestamps','s:212:\"Временные метки восстанавливаемых версий. Если и <var>$1timestamps</var>, и <var>$1fileids</var> пустые, все версии будут восстановлены.\";'),('ru','messages:apihelp-undelete-param-title','s:71:\"Заголовок восстанавливаемой страницы.\";'),('ru','messages:apihelp-undelete-param-watchlist','s:243:\"Безусловно добавить или удалить страницу из списка наблюдения текущего участника, использовать настройки или не менять наблюдение.\";'),('ru','messages:apihelp-undelete-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('ru','messages:apihelp-undelete-summary','s:78:\"Восстановление версий удалённой страницы.\";'),('ru','messages:apihelp-unlinkaccount-example-simple','s:133:\"Попытаться удалить связь между текущим участником и <kbd>FooAuthenticationRequest</kbd>.\";'),('ru','messages:apihelp-unlinkaccount-summary','s:115:\"Удаление связанного стороннего аккаунта с текущим участником.\";'),('ru','messages:apihelp-upload-example-filekey','s:105:\"Завершение загрузки, провалившейся из-за предупреждений.\";'),('ru','messages:apihelp-upload-example-url','s:32:\"Загрузка через URL.\";'),('ru','messages:apihelp-upload-extended-description','s:914:\"Доступно несколько режимов:\n* Прямо загрузить содержимое файла, используя параметр <var>$1file</var>.\n* Загрузить файл по кусочком, используя параметры <var>$1filesize</var>, <var>$1chunk</var> и <var>$1offset</var>.\n* Заставить сервер MediaWiki запросить файл по ссылке, используя параметр <var>$1url</var>.\n* Завершить старую загрузку, провалившуюся из-за предупреждений, используя параметр <var>$1filekey</var>.\nОбратите внимание, что запрос HTTP POST должен быть выполнен как загрузка файла (то есть, с использованием <code>multipart/form-data</code>) при отправке <var>$1file</var>.\";'),('ru','messages:apihelp-upload-param-async','s:157:\"Сделать операции над потенциально большими файлами асинхронными, когда это возможно.\";'),('ru','messages:apihelp-upload-param-checkstatus','s:114:\"Только запросить статус загрузки для данного файлового ключа.\";'),('ru','messages:apihelp-upload-param-chunk','s:36:\"Содержимое кусочка.\";'),('ru','messages:apihelp-upload-param-comment','s:234:\"Описание загрузки. Также используется как начальный текст страницы при загрузке нового файла, если параметр <var>$1text</var> не задан.\";'),('ru','messages:apihelp-upload-param-file','s:32:\"Содержимое файла.\";'),('ru','messages:apihelp-upload-param-filekey','s:100:\"Ключ, идентифицирующий предыдущую временную загрузку.\";'),('ru','messages:apihelp-upload-param-filename','s:43:\"Целевое название файла.\";'),('ru','messages:apihelp-upload-param-filesize','s:35:\"Полны размер файла.\";'),('ru','messages:apihelp-upload-param-ignorewarnings','s:61:\"Игнорировать все предупреждения.\";'),('ru','messages:apihelp-upload-param-offset','s:44:\"Смещение блока в байтах.\";'),('ru','messages:apihelp-upload-param-sessionkey','s:104:\"Синоним $1filekey, обслуживаемый для обратной совместимости.\";'),('ru','messages:apihelp-upload-param-stash','s:150:\"Если задано, сервер поместит файл во временное хранилище, не добавив в постоянное.\";'),('ru','messages:apihelp-upload-param-tags','s:126:\"Изменить метки записи в журнале загрузок и версии файловой страницы.\";'),('ru','messages:apihelp-upload-param-text','s:78:\"Начальный текст страницы для новых файлов.\";'),('ru','messages:apihelp-upload-param-url','s:54:\"Ссылка на запрашиваемый файл.\";'),('ru','messages:apihelp-upload-param-watch','s:51:\"Наблюдать за этой страницей\";'),('ru','messages:apihelp-upload-param-watchlist','s:243:\"Безусловно добавить или удалить страницу из списка наблюдения текущего участника, использовать настройки или не менять наблюдение.\";'),('ru','messages:apihelp-upload-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('ru','messages:apihelp-upload-summary','s:113:\"Загрузка файла или получение статуса незавершённых загрузок.\";'),('ru','messages:apihelp-userrights-example-expiry','s:119:\"Добавить участника <kbd>SometimeSysop</kbd> в группу <kbd>sysop</kbd> на один месяц.\";'),('ru','messages:apihelp-userrights-example-user','s:168:\"Добавить участника <kbd>FooBot</kbd> в группу <kbd>bot</kbd> и удалить его из групп <kbd>sysop</kbd> и <kbd>bureaucrat</kbd>.\";'),('ru','messages:apihelp-userrights-example-userid','s:199:\"Добавить участника с идентификатором <kbd>123</kbd> в группу <kbd>bot</kbd> и удалить его из групп <kbd>sysop</kbd> и <kbd>bureaucrat</kbd>.\";'),('ru','messages:apihelp-userrights-param-add','s:218:\"Добавить участника в эти группы, или, если они уже являются её членами, обновить дату истечения членства в этих группах.\";'),('ru','messages:apihelp-userrights-param-expiry','s:607:\"Временная метка истечения. Может быть относительной (например, <kbd>5 months</kbd> или <kbd>2 weeks</kbd>) или абсолютной (например, <kbd>2014-09-18T12:34:56Z</kbd>). Если задана только одна временная метка, она будет использована для всех групп, переданных в параметре <var>$1add</var>. Используйте <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> или <kbd>never</kbd> для неистекаемой группы.\";'),('ru','messages:apihelp-userrights-param-reason','s:34:\"Причина изменения.\";'),('ru','messages:apihelp-userrights-param-remove','s:59:\"Удалить участника из этих групп.\";'),('ru','messages:apihelp-userrights-param-tags','s:68:\"Изменить метки записи в журнале прав.\";'),('ru','messages:apihelp-userrights-param-user','s:17:\"Участник.\";'),('ru','messages:apihelp-userrights-param-userid','s:46:\"Идентификатор участника.\";'),('ru','messages:apihelp-userrights-summary','s:49:\"Изменение групп участника.\";'),('ru','messages:apihelp-validatepassword-example-1','s:91:\"Проверка пароля <kbd>foobar</kbd> для текущего участника.\";'),('ru','messages:apihelp-validatepassword-example-2','s:118:\"Проверка пароля <kbd>querty</kbd> для создаваемого участника <kbd>Example</kbd>.\";'),('ru'