rong>.\nОбратитесь к документации API ([https://ru.wikipedia.org/w/api.php встроенной] или [https://www.mediawiki.org/wiki/Special:MyLanguage/API:Tutorial внешней]) для получения дополнительной информации об использовании API. Например, о том, [https://www.mediawiki.org/wiki/Special:MyLanguage/API:Tutorial#A_simple_query как найти страницы с заданным словом в заголовке]. Выберите действие, чтобы увидеть другие примеры.\n\nОбратите внимание, что, хотя это и песочница, действия, выполненные на этой странице, могут внести изменения в вики.\";'),('ru','messages:apisandbox-jsonly','s:87:\"Для использования API-песочницы требуется JavaScript.\";'),('ru','messages:apisandbox-load-error','s:111:\"Произошла ошибка при загрузке информации для API-модуля «$1»: $2\";'),('ru','messages:apisandbox-loading','s:71:\"Загрузка информации для API-модуля «$1»…\";'),('ru','messages:apisandbox-loading-results','s:48:\"Получение API-результатов…\";'),('ru','messages:apisandbox-multivalue-all-namespaces','s:45:\"$1 (Все пространства имён)\";'),('ru','messages:apisandbox-multivalue-all-values','s:28:\"$1 (Все значения)\";'),('ru','messages:apisandbox-no-parameters','s:59:\"У этого API-модуля нет параметров.\";'),('ru','messages:apisandbox-param-limit','s:106:\"Введите <kbd>max</kbd> для использования максимального предела.\";'),('ru','messages:apisandbox-request-format-json-label','s:4:\"JSON\";'),('ru','messages:apisandbox-request-format-url-label','s:31:\"Строка URL-запроса\";'),('ru','messages:apisandbox-request-json-label','s:24:\"Запросить JSON:\";'),('ru','messages:apisandbox-request-selectformat-label','s:53:\"Показать данные запроса, как:\";'),('ru','messages:apisandbox-request-time','s:48:\"Время запроса: {{PLURAL:$1|$1 мс}}\";'),('ru','messages:apisandbox-request-url-label','s:30:\"URL-адрес запроса:\";'),('ru','messages:apisandbox-reset','s:16:\"Очистить\";'),('ru','messages:apisandbox-results','s:20:\"Результаты\";'),('ru','messages:apisandbox-results-error','s:95:\"Произошла ошибка при загрузке API-ответа на запрос: $1.\";'),('ru','messages:apisandbox-results-fixtoken','s:68:\"Исправьте токен и повторите отправку\";'),('ru','messages:apisandbox-results-fixtoken-fail','s:53:\"Не удалось вызвать токен «$1».\";'),('ru','messages:apisandbox-results-login-suppressed','s:546:\"Этот запрос обработался как запрос неавторизованного пользователя, так как он может быть использован для обхода правила ограничения домена в браузере. Обратите внимание, что автоматическая обработка токенов песочницы API не работает корректно с такими запросами; пожалуйста, заполните их вручную.\";'),('ru','messages:apisandbox-retry','s:18:\"Повторить\";'),('ru','messages:apisandbox-sending-request','s:38:\"Отправка API-запроса…\";'),('ru','messages:apisandbox-submit','s:27:\"Сделать запрос\";'),('ru','messages:apisandbox-submit-invalid-fields-message','s:106:\"Пожалуйста, исправьте отмеченные поля и попробуйте снова.\";'),('ru','messages:apisandbox-submit-invalid-fields-title','s:50:\"Некоторые поля некорректны\";'),('ru','messages:apisandbox-summary','s:0:\"\";'),('ru','messages:apisandbox-templated-parameter-reason','s:185:\"Этот [[Special:ApiHelp/main#main/templatedparams|шаблонный параметр]] предлагается на основе {{PLURAL:$1|значения|значений}} $2.\";'),('ru','messages:apiwarn-alldeletedrevisions-performance','s:163:\"Для повышения производительности, при генерировании заголовков установите <kbd>$1dir=newer</kbd>.\";'),('ru','messages:apiwarn-badurlparam','s:140:\"Невозможно распарсить $2 из <var>$1urlparam</var>. Используется только ширина и высота.\";'),('ru','messages:apiwarn-badutf8','s:367:\"Значение, переданное <var>$1</var>, содержит некорректные или ненормализованные данные. Текстовые данные должны быть корректным NFC-нормализованным Юникодом без символов управления C0, кроме HT (\\t), LF (\\n) и CR (\\r).\";'),('ru','messages:apiwarn-checktoken-percentencoding','s:178:\"Проверьте, что символы вроде «+» в токене корректно закодированы %-последовательностями 