s:27:\"Неверный токен\";'),('ru','messages:authmanager-account-password-domain','s:5:\"$1@$2\";'),('ru','messages:authmanager-authn-autocreate-failed','s:116:\"Автоматическое создание локальной учётной записи не удалось: $1\";'),('ru','messages:authmanager-authn-no-local-user','s:137:\"Предоставленные учётные данные не связаны ни с одним участником этой вики.\";'),('ru','messages:authmanager-authn-no-local-user-link','s:476:\"Предоставленные учётные данные корректны, но не связаны ни с одни участником этой вики. Войдите с помощью какого-то другого способа или создайте новую учётную запись, и у вас появится возможность привязать свои предыдущие учётные данные к этой учётной записи.\";'),('ru','messages:authmanager-authn-no-primary','s:131:\"Предоставленные учётные данные не могут быть проверены на подлинность.\";'),('ru','messages:authmanager-authn-not-in-progress','s:203:\"Проверка подлинности не выполняется или данные сессии были утеряны. Пожалуйста, начните снова с самого начала.\";'),('ru','messages:authmanager-autocreate-exception','s:154:\"Автоматическое создание учётной записи временно отключено из-за предыдущих ошибок.\";'),('ru','messages:authmanager-autocreate-noperm','s:100:\"Автоматическое создание учётных записей не разрешено.\";'),('ru','messages:authmanager-change-not-supported','s:164:\"Предоставленные учётные данные не могут быть изменены, так как они не будут использованы.\";'),('ru','messages:authmanager-create-disabled','s:66:\"Создание учётных записей отключено.\";'),('ru','messages:authmanager-create-from-login','s:137:\"Чтобы создать учётную запись, пожалуйста, заполните приведённые ниже поля.\";'),('ru','messages:authmanager-create-no-primary','s:161:\"Предоставленные учётные данные не могут быть использованы для создания учётной записи.\";'),('ru','messages:authmanager-create-not-in-progress','s:208:\"Создание учётной записи не выполняется или данные сессии были утеряны. Пожалуйста, начните снова с самого начала.\";'),('ru','messages:authmanager-domain-help','s:62:\"Домен для внешней аутентификации.\";'),('ru','messages:authmanager-email-help','s:44:\"Адрес электронной почты\";'),('ru','messages:authmanager-email-label','s:33:\"Электронная почта\";'),('ru','messages:authmanager-link-no-primary','s:167:\"Предоставленные учётные данные не могут быть использованы для связывания учётных записей.\";'),('ru','messages:authmanager-link-not-in-progress','s:212:\"Связывание учётной записи не выполняется или данные сессии были утеряны. Пожалуйста, начните снова с самого начала.\";'),('ru','messages:authmanager-password-help','s:60:\"Пароль для проверки подлинности.\";'),('ru','messages:authmanager-provider-password','s:59:\"Аутентификация на основе пароля\";'),('ru','messages:authmanager-provider-password-domain','s:86:\"Проверка подлинности на основе пароля и домена\";'),('ru','messages:authmanager-provider-temporarypassword','s:31:\"Временный пароль\";'),('ru','messages:authmanager-realname-help','s:44:\"Настоящее имя участника\";'),('ru','messages:authmanager-realname-label','s:25:\"Настоящее имя\";'),('ru','messages:authmanager-retype-help','s:61:\"Ещё раз пароль для подтверждения.\";'),('ru','messages:authmanager-userdoesnotexist','s:73:\"Не зарегистрировано учётной записи «$1».\";'),('ru','messages:authmanager-userlogin-remembermypassword-help','s:141:\"Будет ли пароль запоминаться на время большее, чем продолжительность сессии.\";'),('ru','messages:authmanager-username-help','s:73:\"Имя участника для проверки подлинности.\";'),('ru','messages:authpage-cannot-create','s:87:\"Невозможно продолжить создание учётной записи.\";'),('ru','messages:authpage-cannot-create-continue','s:163:\"Невозможно продолжить создание учётной записи. Скорее всего, время вашей сессии истекло.\";'),('ru','messages:authpage-cannot-link','s:83:\"Невозможно начать связывание учётной записи.\";'),('ru','messages:authpage-cannot-link-continue','s:167:\"Невозможно продолжить связывание учётной записи. Скорее всего, время вашей сессии ис