ной почты и если ваша блокировка не включает запрет отправки писем подобным образом.\n\nВаш IP-адрес — $3, идентификатор блокировки — #$5.\nПожалуйста, указывайте эти сведения в любых своих обращениях.\";'),('ru','messages:autoblocker','s:181:\"Автоблокировка из-за того, что ваш IP-адрес недавно использовал «[[User:$1|$1]]».\nПричина блокировки $1: «$2»\";'),('ru','messages:autoblockid','s:32:\"Автоблокировка #$1\";'),('ru','messages:autoblocklist','s:28:\"Автоблокировки\";'),('ru','messages:autoblocklist-empty','s:51:\"Список автоблокировок пуст.\";'),('ru','messages:autoblocklist-legend','s:41:\"Список автоблокировок\";'),('ru','messages:autoblocklist-localblocks','s:109:\"{{PLURAL:$1|Локальная автоблокировка|Локальные автоблокировки}}\";'),('ru','messages:autoblocklist-otherblocks','s:97:\"{{PLURAL:$1|Другая автоблокировка|Другие автоблокировки}}\";'),('ru','messages:autoblocklist-submit','s:10:\"Найти\";'),('ru','messages:autoblocklist-total-autoblocks','s:43:\"Всего автоблокировок: $1\";'),('ru','messages:autochange-username','s:57:\"Автоматическое изменение MediaWiki\";'),('ru','messages:autocomment-prefix','s:0:\"\";'),('ru','messages:autoredircomment','s:42:\"Перенаправление на [[$1]]\";'),('ru','messages:autosumm-blank','s:71:\"Полностью удалено содержимое страницы\";'),('ru','messages:autosumm-changed-redirect-target','s:69:\"Перенаправление изменено с [[$1]] на [[$2]]\";'),('ru','messages:autosumm-new','s:35:\"Новая страница: «$1»\";'),('ru','messages:autosumm-newblank','s:44:\"Создана пустая страница\";'),('ru','messages:autosumm-removed-redirect','s:57:\"Удалено перенаправление на [[$1]]\";'),('ru','messages:autosumm-replace','s:66:\"Содержимое страницы заменено на «$1»\";'),('ru','messages:backend-fail-alreadyexists','s:40:\"Файл $1 уже существует.\";'),('ru','messages:backend-fail-backup','s:80:\"Невозможно сделать резервную копию файла $1.\";'),('ru','messages:backend-fail-batchsize','s:299:\"Хранилище получило блок из $1 {{PLURAL:$1|файловой операции|файловых операций}}, ограничение составляет $2 {{PLURAL:$1|файловую операцию|файловых операций|файловых операции}}.\";'),('ru','messages:backend-fail-closetemp','s:63:\"Не удаётся закрыть временный файл.\";'),('ru','messages:backend-fail-connect','s:74:\"Не удалось подключиться к хранилищу «$1».\";'),('ru','messages:backend-fail-contenttype','s:130:\"Не удалось определить тип содержимого файла, чтобы сохранить его в «$1».\";'),('ru','messages:backend-fail-copy','s:62:\"Не удалось скопировать файл $1 в $2 .\";'),('ru','messages:backend-fail-create','s:49:\"Не удалось записать файл $1.\";'),('ru','messages:backend-fail-delete','s:48:\"Не удалось удалить файл  $1.\";'),('ru','messages:backend-fail-describe','s:76:\"Не удалось изменить метаданные файла «$1».\";'),('ru','messages:backend-fail-hash','s:102:\"Невозможно определить криптографический хеш файла «$1».\";'),('ru','messages:backend-fail-hashes','s:85:\"Не удалось получить хэши файлов для сравнения.\";'),('ru','messages:backend-fail-internal','s:84:\"Произошла неизвестная ошибка в хранилище «$1».\";'),('ru','messages:backend-fail-invalidpath','s:63:\"$1 — некорректный путь к хранилищу.\";'),('ru','messages:backend-fail-maxsize','s:149:\"Не удалось записать файл $1, так как его размер превышает $2 {{PLURAL:$2|байт|байта|байт}}.\";'),('ru','messages:backend-fail-move','s:61:\"Не удалось переместить файл $1 в $2.\";'),('ru','messages:backend-fail-notexists','s:38:\"Файл $1 не существует.\";'),('ru','messages:backend-fail-notsame','s:53:\"Уже есть неидентичный файл $1.\";'),('ru','messages:backend-fail-opentemp','s:63:\"Не удаётся открыть временный файл.\";'),('ru','messages:backend-fail-read','s:51:\"Не удалось прочитать файл $1.\";'),('ru','messages:backend-fail-readonly','s:132:\"Хранилище «$1» сейчас находится в режиме «только чтение». Причина: <em>$2</em>\";'),('ru','messages:backend-fail-sizes','s:91:\"Не удалось получить размеры файлов для сравнения.\";'),('ru','messages:backend-fail-stat','s:70:\"Не удалось