s:badsiglength','s:162:\"Слишком длинная подпись.\nПодпись не должна превышать $1 {{PLURAL:$1|символа|символа|символов}}.\";'),('ru','messages:badsiglinks','s:256:\"Ваша подпись должна содержать ссылку на вашу страницу участника, страницу обсуждения или вклад. Пожалуйста, добавьте её, например: <code>$1</code>.\";'),('ru','messages:badsigsubst','s:155:\"Ваша подпись содержит вложенную замену (например, <code>subst:</code> или <code><nowiki>~~~~</nowiki></code>).\";'),('ru','messages:badtitle','s:41:\"Недопустимое название\";'),('ru','messages:badtitletext','s:308:\"Запрашиваемое название страницы неправильно, пусто, либо неверно указано межъязыковое или интервики название. Возможно, в названии используются недопустимые символы.\";'),('ru','messages:bitrate-bits','s:8:\"$1 б/с\";'),('ru','messages:bitrate-exabits','s:10:\"$1 Эб/с\";'),('ru','messages:bitrate-gigabits','s:10:\"$1 Гб/с\";'),('ru','messages:bitrate-kilobits','s:10:\"$1 Кб/с\";'),('ru','messages:bitrate-megabits','s:10:\"$1 Мб/с\";'),('ru','messages:bitrate-petabits','s:10:\"$1 Пб/с\";'),('ru','messages:bitrate-terabits','s:10:\"$1 Тб/с\";'),('ru','messages:bitrate-yottabits','s:10:\"$1 Иб/с\";'),('ru','messages:bitrate-zetabits','s:10:\"$1 Зб/с\";'),('ru','messages:blankarticle','s:264:\"<strong>Предупреждение:</strong> Страница, которую вы создаёте, пуста.\nЕсли снова нажмёте кнопку «$1», страница будет создана без какого-либо содержания.\";'),('ru','messages:blanknamespace','s:18:\"(Основное)\";'),('ru','messages:blankpage','s:29:\"Пустая страница\";'),('ru','messages:block','s:39:\"Блокировка участника\";'),('ru','messages:block-actions','s:45:\"Действия для блокировки:\";'),('ru','messages:block-expiry','s:32:\"Закончится через:\";'),('ru','messages:block-log-flags-angry-autoblock','s:68:\"включена расширенная автоблокировка\";'),('ru','messages:block-log-flags-anononly','s:56:\"только анонимные пользователи\";'),('ru','messages:block-log-flags-hiddenname','s:38:\"имя участника скрыто\";'),('ru','messages:block-log-flags-noautoblock','s:47:\"автоблокировка отключена\";'),('ru','messages:block-log-flags-nocreate','s:71:\"запрещена регистрация учётных записей\";'),('ru','messages:block-log-flags-noemail','s:46:\"запрещена отправка писем\";'),('ru','messages:block-log-flags-nousertalk','s:77:\"не может править свою страницу обсуждения\";'),('ru','messages:block-options','s:40:\"Дополнительные опции:\";'),('ru','messages:block-prevent-edit','s:28:\"Редактирование\";'),('ru','messages:block-reason','s:15:\"Причина:\";'),('ru','messages:block-target','s:47:\"Имя участника или IP-адрес:\";'),('ru','messages:blocked-mailpassword','s:269:\"Редактирование с вашего IP-адреса запрещено. Для предотвращения злоупотреблений для этого IP-адреса заблокирована и функция восстановления пароля.\";'),('ru','messages:blocked-notice-logextract','s:263:\"{{GENDER:$1|Этот участник|Эта участница}} в данный момент {{GENDER:$1|заблокирован|заблокирована}}.\nНиже приведена последняя запись из журнала блокировок:\";'),('ru','messages:blockednoreason','s:34:\"причина не указана\";'),('ru','messages:blockedtext','s:1149:\"<strong>Ваша учётная запись или IP-адрес заблокированы.</strong>\n\nБлокировка произведена администратором $1.\nУказана следующая причина: <em>$2</em>.\n\n* Начало блокировки: $8\n* Окончание блокировки: $6\n* Цель блокировки: $7\n\nВы можете связаться с $1 или любым другим [[{{MediaWiki:Grouppage-sysop}}|администратором]], чтобы обсудить блокировку.\nВы можете использовать функцию «{{int:emailuser}}», если в ваших [[Special:Preferences|персональных настройках]] задали корректный адрес электронной почты и если ваша блокировка не включает запрет отправки писем подобным образом.\nВаш IP-адрес — $3, идентификатор блокировки — $5.\nПожалуйста, указывайте эти сведения в любых своих обращениях.\";'),('ru','messages:blockedtext-composite','s:429:\"<strong>Ваше имя участника или IP-адрес были заблокированы.</strong>\n\nУказана следующая причина:\n\n:<em>$2</em>\n\n* Начало блокировки: $8\n* Окончание блокировки: $6\n\n* $5\n\nВаш текущий IP-адрес $3.\nПожалуйста, указывайте все эти сведения в любых своих обращениях.\";'),('ru','messages:blockedtext-composite-ids','s:148:\"Релевантные идентификаторы блокировок: $1 (ваш IP-адрес может быть в чёрном списке)\";'),('ru','messages:blockedtext-composite-no-ids','s:97:\"Ваш IP-адрес присутствует в нескольких чёрных списках\";'),('ru','messages:blockedtext-composite-reason','s:113:\"Есть несколько блокировок вашей учётной записи и/или IP-адреса\";'),('ru','messages:blockedtext-partial','s:862:\"<strong>Для вашей учётной записи или IP-адреса заблокировано данное действие. Но вы по-прежнему можете выполнять другие действия в этом вики-проекте (такие, как редактирование определённых страниц).</strong> Вы можете увидеть все подробности блокировки на странице [[Special:MyContributions|вклада учётной записи]].\n\nБлокировка произведена администратором $1.\n\nУказана следующая причина: <em>$2</em>.\n\n* Начало блокировки: $8\n* Окончание блокировки: $6\n* Цель блокировки: $7\n* Идентификатор блокировки: #$5\";'),('ru','messages:blockedtitle','s:41:\"Участник заблокирован\";'),('ru','messages:blockip','s:78:\"Заблокировать {{GENDER:$1|участника|участницу}}\";'),('ru','messages:blockipsuccesssub','s:43:\"Блокировка произведена\";'),('ru','messages:blockipsuccesstext','s:246:\"[[Special:Contributions/$1|«$1»]] {{GENDER:$1|заблокирован|заблокирована}}.<br />\nСм. [[Special:BlockList|список заблокированных IP-адресов]] для просмотра блокировок.\";'),('ru','messages:blockiptext','s:970:\"Используйте форму ниже, чтобы заблокировать возможность редактирования с определённого IP-адреса или имени участника.\nЭтот инструмент следует использовать для предотвращения вандализма и только в соответствии с [[{{MediaWiki:Policy-url}}|правилами]].\nНиже укажите конкретную причину (к примеру, процитируйте некоторые страницы с признаками вандализма).\nВы можете заблокировать диапазоны IP-адресов, используя [https://ru.wikipedia.org/wiki/Бесклассовая_адресация CIDR]-синтаксис. Максимально допустимый диапазон — /$1 для протокола IPv4 и /$2 для протокола IPv6.\";'),('ru','messages:blocklink','s:26:\"заблокировать\";'),('ru','messages:blocklist','s:49:\"Заблокированные участники\";'),('ru','messages:blocklist-addressblocks','s:55:\"Скрыть блокировки отдельных IP\";'),('ru','messages:blocklist-by','s:57:\"Заблокировавший администратор\";'),('ru','messages:blocklist-editing','s:28:\"редактирование\";'),('ru','messages:blocklist-editing-ns','s:33:\"пространства имён\";'),('ru','messages:blocklist-editing-page','s:16:\"страницы\";'),('ru','messages:blocklist-editing-sitewide','s:59:\"редактирование (во всём проекте)\";'),('ru','messages:blocklist-expiry','s:16:\"Истекает\";'),('ru','messages:blocklist-indefblocks','s:54:\"Скрыть бессрочные блокировки\";'),('ru','messages:blocklist-nousertalk','s:77:\"не может править свою страницу обсуждения\";'),('ru','messages:blocklist-params','s:39:\"Параметры блокировки\";'),('ru','messages:blocklist-rangeblocks','s:54:\"Скрыть блокировки диапазонов\";'),('ru','messages:blocklist-reason','s:14:\"Причина\";'),('ru','messages:blocklist-summary','s:0:\"\";'),('ru','messages:blocklist-target','s:8:\"Цель\";'),('ru','messages:blocklist-tempblocks','s:52:\"Скрыть временные блокировки\";'),('ru','messages:blocklist-timestamp','s:19:\"Дата/время\";'),('ru','messages:blocklist-type','s:7:\"Тип:\";'),('ru','messages:blocklist-type-opt-all','s:6:\"Все\";'),('ru','messages:blocklist-type-opt-partial','s:18:\"Частичная\";'),('ru','messages:blocklist-type-opt-sitewide','s:28:\"Во всём проекте\";'),('ru','messages:blocklist-userblocks','s:63:\"Скрыть блокировки учётных записей\";'),('ru','messages:blocklog-showlog','s:204:\"{{GENDER:$1|Этот участник уже блокировался|Эта участница уже блокировалась}} ранее.\nНиже приведён журнал блокировок:\";'),('ru','messages:blocklog-showsuppresslog','s:219:\"{{GENDER:$1|Этот участник уже заблокирован и скрыт|Эта участница уже заблокирована и скрыта}}. Журнал сокрытий приведён ниже:\";'),('ru','messages:blocklogentry','s:55:\"заблокировал [[$1]] на период $2 $3\";'),('ru','messages:blocklogpage','s:33:\"Журнал блокировок\";'),('ru','messages:blocklogtext','s:269:\"Журнал блокировок и разблокировок участников. Автоматически блокируемые IP-адреса здесь не указываются. См. [[Special:BlockList|список текущих блокировок]].\";'),('ru','messages:booksources','s:27:\"Источники книг\";'),('ru','messages:booksources-invalid-isbn','s:254:\"Указанный номер ISBN, судя по всему, содержит ошибку. Пожалуйста, проверьте, что при переносе номера из первоисточника не возникло искажений.\";'),('ru','messages:booksources-isbn','s:5:\"ISBN:\";'),('ru','messages:booksources-search','s:10:\"Найти\";'),('ru','messages:booksources-search-legend','s:45:\"Поиск информации о книге\";'),('ru','messages:booksources-summary','s:0:\"\";'),('ru','messages:booksources-text','s:321:\"На этой странице приведён список ссылок на сайты, где вы, возможно, найдёте дополнительную информацию о книге. Это интернет-магазины и системы поиска в библиотечных каталогах.\";'),('ru','messages:boteditletter','s:2:\"б\";'),('ru','messages:botpasswords','s:23:\"Пароли ботов\";'),('ru','messages:botpasswords-bad-appid','s:65:\"Имя бота «$1» является недопустимым.\";'),('ru','messages:botpasswords-created-body','s:124:\"Пароль бота для бота «$1» {{GENDER:$2|участника|участницы}} «$2» был создан.\";'),('ru','messages:botpasswords-created-title','s:34:\"Пароль бота создан\";'),('ru','messages:botpasswords-createnew','s:47:\"Создать новый пароль бота\";'),('ru','messages:botpasswords-deleted-body','s:124:\"Пароль бота для бота «$1» {{GENDER:$2|участника|участницы}} «$2» был удалён.\";'),('ru','messages:botpasswords-deleted-title','s:34:\"Пароль бота удалён\";'),('ru','messages:botpasswords-disabled','s:41:\"Пароли бота отключены.\";'),('ru','messages:botpasswords-editexisting','s:73:\"Редактировать существующий пароль бота\";'),('ru','messages:botpasswords-existing','s:46:\"Существующие пароли бота\";'),('ru','messages:botpasswords-help-grants','s:342:\"Каждое разрешение даёт доступ к перечисленным правам участника, которые уже есть у учётной записи участника. См. [[Special:ListGrants|таблицу разрешений]] для получения дополнительной информации.\";'),('ru','messages:botpasswords-insert-failed','s:124:\"Не удалось добавить бота с именем «$1». Возможно, он был уже добавлен?\";'),('ru','messages:botpasswords-invalid-name','s:128:\"Указанное имя участника не содержит разделителя для пароля бота («$1»).\";'),('ru','messages:botpasswords-label-appid','s:26:\"Название бота:\";'),('ru','messages:botpasswords-label-cancel','s:12:\"Отмена\";'),('ru','messages:botpasswords-label-create','s:14:\"Создать\";'),('ru','messages:botpasswords-label-delete','s:14:\"Удалить\";'),('ru','messages:botpasswords-label-grants','s:42:\"Применимые разрешения:\";'),('ru','messages:botpasswords-label-grants-column','s:18:\"Разрешено\";'),('ru','messages:botpasswords-label-needsreset','s:51:\"(пароль должен быть сброшен)\";'),('ru','messages:botpasswords-label-resetpassword','s:29:\"Сбросить пароль\";'),('ru','messages:botpasswords-label-update','s:16:\"Обновить\";'),('ru','messages:botpasswords-locked','s:163:\"Вы не можете войти в систему с паролем бота, поскольку ваша учётная запись заблокирована.\";'),('ru','messages:botpasswords-needs-reset','s:132:\"Пароль для бота «$1» {{GENDER:$2|участника|участницы}} «$2» должен быть сброшен.\";'),('ru','messages:botpasswords-newpassword','s:548:\"Новый пароль для входа под <strong>$1</strong> — <strong>$2</strong>. <em>Запишите его для последующего использования.</em> <br /> (Для старых ботов, которые требуют, чтоб логин участника был таким же, как имя потенциального участника, вы можете также использовать <strong>$3</strong> как имя участника и <strong>$4</strong> в качестве пароля.)\";'),('ru','messages:botpasswords-no-central-id','s:151:\"Для использования паролей бота вы должны войти в централизованную