es:brokenredirectstext','s:120:\"Следующие перенаправления указывают на несуществующие страницы:\";'),('ru','messages:bydate','s:13:\"по дате\";'),('ru','messages:cachedspecial-refresh-now','s:55:\"Просмотреть последнюю версию.\";'),('ru','messages:cachedspecial-viewing-cached-ts','s:196:\"Вы просматриваете кэшированную версию этой страницы, которая может серьёзно отличаться от текущей версии.\";'),('ru','messages:cachedspecial-viewing-cached-ttl','s:154:\"Вы просматриваете закэшированную версию страницы, она могла быть обновлена $1 назад.\";'),('ru','messages:cancel','s:16:\"Отменить\";'),('ru','messages:cannotauth-not-allowed','s:71:\"Вы не можете использовать эту страницу\";'),('ru','messages:cannotauth-not-allowed-title','s:29:\"Доступ запрещён\";'),('ru','messages:cannotchangeemail','s:147:\"Адреса электронной почты этой учётной записи не могут быть изменены в этой вики.\";'),('ru','messages:cannotcreateaccount-text','s:103:\"Прямое создание учётных записей не включено в этой вики.\";'),('ru','messages:cannotcreateaccount-title','s:63:\"Невозможно создать учётные записи\";'),('ru','messages:cannotdelete','s:185:\"Невозможно удалить или переименовать страницу или файл «$1».\nВозможно, уже было произведено удаление.\";'),('ru','messages:cannotdelete-title','s:51:\"Нельзя удалить страницу «$1»\";'),('ru','messages:cannotlink-no-provider','s:60:\"Нет связываемых учётных записей.\";'),('ru','messages:cannotlink-no-provider-title','s:59:\"Нет связываемых учётных записей\";'),('ru','messages:cannotlogin-text','s:48:\"Вход в систему невозможен.\";'),('ru','messages:cannotlogin-title','s:31:\"Невозможно войти\";'),('ru','messages:cannotloginnow-text','s:70:\"Нельзя войти во время использования $1.\";'),('ru','messages:cannotloginnow-title','s:55:\"Невозможно войти прямо сейчас\";'),('ru','messages:cannotlogoutnow-text','s:70:\"Нельзя выйти во время использования $1.\";'),('ru','messages:cannotlogoutnow-title','s:55:\"Невозможно выйти прямо сейчас\";'),('ru','messages:ca