:\"Изменить или удалить адрес электронной почты\";'),('ru','messages:changeemail-header','s:396:\"Заполните эту форму, чтобы изменить свой адрес электронной почты. Если вы хотите отвязать свой адрес электронной почты от учётной записи, то при заполнении формы оставьте пустым поле нового адреса электронной почты.\";'),('ru','messages:changeemail-newemail','s:56:\"Новый адрес электронной почты:\";'),('ru','messages:changeemail-newemail-help','s:369:\"Это поле должно быть оставлено пустым, если вы хотите удалить свой адрес электронной почты. Но после его удаления Вы не сможете сбросить забытый пароль и не будете получать письма из этого вики-проекта.\";'),('ru','messages:changeemail-no-info','s:157:\"Чтобы обращаться непосредственно к этой странице, вам следует представиться системе.\";'),('ru','messages:changeemail-nochange','s:102:\"Пожалуйста, введите иной новый адрес электронной почты.\";'),('ru','messages:changeemail-none','s:8:\"(нет)\";'),('ru','messages:changeemail-oldemail','s:60:\"Текущий адрес электронной почты:\";'),('ru','messages:changeemail-password','s:59:\"Ваш пароль для проекта «{{SITENAME}}»:\";'),('ru','messages:changeemail-submit','s:27:\"Изменить адрес\";'),('ru','messages:changeemail-summary','s:0:\"\";'),('ru','messages:changeemail-throttled','s:208:\"Вы сделали слишком много попыток представиться системе.\nПожалуйста, подождите $1 перед тем, как попробовать снова.\";'),('ru','messages:changepassword','s:31:\"Изменение пароля\";'),('ru','messages:changepassword-success','s:42:\"Ваш пароль был изменён!\";'),('ru','messages:changepassword-summary','s:0:\"\";'),('ru','messages:changepassword-throttled','s:177:\"Вы сделали слишком много попыток входа.\nПожалуйста, подождите $1 перед тем, как попробовать снова.\";'),('ru','messages:checkbox-all','s:6:\"Всё\";'),('ru','messages:checkbox-invert','s:26:\"Инвертировать\";'),('ru','messages:checkbox-none','s:12:\"Ничего\";'),('ru','messages:checkbox-select','s:14:\"Выбор: $1\";'),('ru','messages:clearyourcache','s:1033:\"<strong>Замечание.</strong> Возможно, после сохранения вам придётся очистить кэш своего браузера, чтобы увидеть изменения.\n* <strong>Firefox / Safari:</strong> Удерживая клавишу <em>Shift</em>, нажмите на панели инструментов <em>Обновить</em> либо нажмите <em>Ctrl-F5</em> или <em>Ctrl-R</em> (<em>⌘-R</em> на Mac)\n* <strong>Google Chrome:</strong> Нажмите <em>Ctrl-Shift-R</em> (<em>⌘-Shift-R</em> на Mac)\n* <strong>Internet Explorer:</strong> Удерживая <em>Ctrl</em>, нажмите <em>Обновить</em> либо нажмите <em>Ctrl-F5</em>\n* <strong>Opera:</strong> Перейдите в <em>Menu → Настройки</em> (<em>Opera → Настройки</em> на Mac), а затем <em>Безопасность → Очистить историю посещений → Кэшированные изображения и файлы</em>\";'),('ru','messages:collapsible-collapse','s:16:\"свернуть\";'),('ru','messages:collapsible-expand','s:20:\"развернуть\";'),('ru','messages:colon-separator','s:6:\":&#32;\";'),('ru','messages:comma-separator','s:6:\",&#32;\";'),('ru','messages:common.css','s:123:\"/* Размещённый здесь CSS будет применяться ко всем темам оформления */\";'),('ru','messages:common.js','s:177:\"/* Размещённый здесь код JavaScript будет загружаться пользователям при обращении к каждой странице */\";'),('ru','messages:common.json','s:174:\"/* Размещённый здесь JSON-код будет загружаться всем участникам при каждом обращении к странице */\";'),('ru','messages:compare-invalid-title','s:68:\"Указанное вами название недопустимо.\";'),('ru','messages:compare-page1','s:29:\"Первая страница\";'),('ru','messages:compare-page2','s:29:\"Вторая страница\";'),('ru','messages:compare-rev1','s:25:\"Первая версия\";'),('ru','messages:compare-rev2','s:25:\"Вторая версия\";'),('ru','messages:compare-revision-not-exists','s:67:\"Указанной вами версии не существует.\";'),('ru','messages:compare-submit','s:16:\"Сравнить\";'),('ru','messages:compare-title-not-exists','s:73:\"Не существует указанного вами названия.\";'),('ru','messages:comparepages','s:33:\"Сравнение страниц\";'),('ru','messages:comparepages-summary','s:0:\"\";'),('ru','messages:compareselectedversions','s:48:\"Сравнить выбранные версии\";'),('ru','messages:confirm','s:22:\"Подтвердить\";'),('ru','messages:confirm-markpatrolled-button','s:2:\"OK\";'),('ru','messages:confirm-markpatrolled-top','s:95:\"Пометить версию $3 страницы $2 как отпатрулированную?\";'),('ru','messages:confirm-mcrrestore-title','s:37:\"Восстановить версию\";'),('ru','messages:confirm-mcrundo-title','s:35:\"Отменить изменение\";'),('ru','messages:confirm-purge-bottom','s:117:\"После очистки кэша страницы будет показана её последняя версия.\";'),('ru','messages:confirm-purge-title','s:49:\"Очистить кэш этой страницы\";'),('ru','messages:confirm-purge-top','s:50:\"Очистить кэш этой страницы?\";'),('ru','messages:confirm-rollback-bottom','s:124:\"Это действие немедленно откатит выбранные изменения этой страницы.\";'),('ru','messages:confirm-rollback-button','s:4:\"ОК\";'),('ru','messages:confirm-rollback-top','s:61:\"Откатить правки на этой странице?\";'),('ru','messages:confirm-unwatch-button','s:2:\"OK\";'),('ru','messages:confirm-unwatch-top','s:91:\"Удалить эту страницу из вашего списка наблюдения?\";'),('ru','messages:confirm-watch-button','s:2:\"OK\";'),('ru','messages:confirm-watch-button-expiry','s:22:\"Отслеживать\";'),('ru','messages:confirm-watch-label','s:52:\"Список наблюдения за период:\";'),('ru','messages:confirm-watch-top','s:85:\"Добавить эту страницу в ваш список наблюдения?\";'),('ru','messages:confirm_purge_button','s:2:\"OK\";'),('ru','messages:confirmable-confirm','s:34:\"{{GENDER:$1|Вы}} уверены?\";'),('ru','messages:confirmable-no','s:6:\"Нет\";'),('ru','messages:confirmable-yes','s:4:\"Да\";'),('ru','messages:confirmdeletetext','s:453:\"Вы запросили полное удаление страницы (или изображения) и всей её истории изменений. Пожалуйста, подтвердите, что вы действительно желаете это сделать, понимаете последствия своих действий, и делаете это в соответствии [[{{MediaWiki:Policy-url}}|с правилами]].\";'),('ru','messages:confirmedittext','s:338:\"Вы должны подтвердить свой адрес электронной почты перед правкой страниц.\nПожалуйста, введите и подтвердите свой адрес электронной почты в своих [[Special:Preferences|персональных настройках]].\";'),('ru','messages:confirmemail','s:73:\"Подтверждение адреса электронной почты\";'),('ru','messages:confirmemail_body','s:888:\"Кто-то (вероятно, вы) с IP-адресом $1 зарегистрировал\nна сервере проекта {{SITENAME}} учётную запись «$2»,\nуказав этот адрес электронной почты.\n\nЧтобы подтвердить, что эта учётная запись действительно\nпринадлежит вам и включить возможность отправки электронной почты\nс сайта {{SITENAME}}, откройте приведённую ниже ссылку в браузере:\n\n$3\n\nЕсли вы *не* регистрировали подобной учётной записи, то перейдите\nпо следующей ссылке, чтобы отменить подтверждение адреса:\n\n$5\n\nКод подтверждения действителен до $4.\";'),('ru','messages:confirmemail_body_changed','s:850:\"Кто-то (возможно вы) с IP-адресом $1\nуказал данный адрес электронной почты в качестве нового для учётной записи «$2» в проекте {{SITENAME}}.\n\nЧтобы подтвердить, что эта учётная запись действительно принадлежит вам,\nи включить возможность отправки писем с сайта {{SITENAME}}, откройте приведённую ниже ссылку в браузере.\n\n$3\n\nЕсли данная учётная запись *не* относится к вам, то перейдите по следующей ссылке,\nчтобы отменить подтверждение адреса\n\n$5\n\nКод подтверждения действителен до $4.\";'),('ru','messages:confirmemail_body_set','s:861:\"Кто-то (вероятно, вы) с IP-адресом $1\nуказал данный адрес электронной почты для учётной записи «$2» в проекте «{{SITENAME}}».\n\nЧтобы подтвердить, что эта учётная запись действительно принадлежит вам,\nи включить возможность отправки писем с сайта «{{SITENAME}}», откройте в браузере приведённую ниже ссылку:\n\n$3\n\nЕсли данная учётная запись *не* относится к вам, то перейдите по следующей ссылке,\nчтобы отменить подтверждение адреса электронной почты:\n\n$5\n\nКод подтверждения действителен до $4.\";'),('ru','messages:confirmemail_invalid','s:112:\"Неправильный код подтверждения или срок действия кода истёк.\";'),('ru','messages:confirmemail_invalidated','s:91:\"Подтверждение адреса электронной почты отменено.\";'),('ru','messages:confirmemail_loggedin','s:75:\"Ваш адрес электронной почты подтверждён.\";'),('ru','messages:confirmemail_needlogin','s:115:\"Вы должны $1 для подтверждения вашего адреса электронной почты.\";'),('ru','messages:confirmemail_noemail','s:148:\"Вы не задали корректный адрес электронной почты в своих [[Special:Preferences|настройках]].\";'),('ru','messages:confirmemail_oncreate','s:442:\"Письмо с кодом подтверждения было отправлено на указанный вами почтовый ящик.\nДанный код не требуется для входа в систему, однако вы должны указать его,\nпрежде чем будет разрешено использование возможностей электронной почты в этом проекте.\";'),('ru','messages:confirmemail_pending','s:363:\"Письмо с кодом подтверждения уже было отправлено.\nЕсли вы недавно создали учётную запись, то, вероятно,\nвам следует подождать несколько минут, пока письмо придёт, перед тем, как запросить код ещё раз.\";'),('ru','messages:confirmemail_send','s:83:\"Отправить письмо с запросом на подтверждение\";'),('ru','messages:confirmemail_sendfailed','s:258:\"{{SITENAME}} не может отправить письмо с запросом на подтверждение.\nПожалуйста, проверьте правильность адреса электронной почты.\n\nОтвет сервера: $1\";'),('ru','messages:confirmemail_sent','s:86:\"Письмо с запросом на подтверждение отправлено.\";'),('ru','messages:confirmemail_subject','s:104:\"{{SITENAME}}:Запрос на подтверждение адреса электронной почты\";'),('ru','messages:confirmemail_success','s:75:\"Ваш адрес электронной почты подтверждён.\";'),('ru','messages:confirmemail_text','s:549:\"Вики-движок требует подтверждения адреса электронной почты перед тем, как начать с ним работать.\nНажмите на кнопку, чтобы на указанный адрес было отправлено письмо, содержащее ссылку на специальную страницу, после открытия которой в браузере адрес электронной почты будет считаться подтверждённым.\";'),('ru','messages:confirmleave-warning','s:129:\"Покидая эту страницу, вы можете потерять все внесенные вами изменения.\";'),('ru','messages:confirmrecreate','s:418:\"{{GENDER:$1|Участник|Участница|}}&nbsp;[[User:$1|$1]] ([[User talk:$1|обс]]) {{GENDER:$1|удалил|удалила}} эту страницу после того, как вы начали её редактировать, по следующей причине:\n: <em>$2</em>.\nПожалуйста, подтвердите, что вы хотите вновь создать эту страницу.\";'),('ru','messages:confirmrecreate-noreason','s:390:\"{{GENDER:$1|Участник|Участница|}}&nbsp;[[User:$1|$1]] ([[User talk:$1|обс]]) {{GENDER:$1|удалил|удалила}} эту страницу после того, как вы начали её редактировать. Пожалуйста, подтвердите, что вы действительно хотите вновь создать эту страницу.\";'),('ru','messages:content-failed-to-parse','s:72:\"Содержимое $2 не соответствует типу $1: $3.\";'),('ru','messages:content-json-empty-array','s:25:\"Пустой массив\";'),('ru','messages:content-json-empty-object','s:25:\"Пустой объект\";'),('ru','messages:content-model-css','s:3:\"CSS\";'),('ru','messages:content-model-javascript','s:10:\"JavaScript\";'),('ru','messages:content-model-json','s:4:\"JSON\";'),('ru','messages:content-model-text','s:25:\"обычный текст\";'),('ru','messages:content-model-wikitext','s:19:\"вики-текст\";'),('ru','messages:content-not-allowed-here','s:101:\"Содержимое «$1» недопустимо на странице [[:$2]] в месте «$3»\";'),('ru','messages:contentmodelediterror','s:266:\"Вы не можете редактировать эту версию, поскольку модель её содержания — <code>$1</code>, отличающаяся от текущей модели содержания страницы — <code>$2</code>.\";'),('ru','messages:continue-editing','s:49:\"Продолжить редактирование\";'),('ru','messages:contribslink','s:10:\"вклад\";'),('ru','messages:contribsub2','s:32:\"Вклад {{GENDER:$3|$1}} ($2)\";'),('ru','messages:contributions','s:62:\"Вклад {{GENDER:$1|участника|участницы}}\";'),('ru','messages:contributi