u','messages:datedefault','s:23:\"По умолчанию\";'),('ru','messages:days','s:47:\"{{PLURAL:$1|$1 день|$1 дня|$1 дней}}\";'),('ru','messages:days-abbrev','s:5:\"$1 д\";'),('ru','messages:dberr-again','s:96:\"Попробуйте обновить страницу через несколько минут.\";'),('ru','messages:dberr-info','s:52:\"(Нет доступа к базе данных: $1)\";'),('ru','messages:dberr-info-hidden','s:48:\"(Нет доступа к базе данных)\";'),('ru','messages:dberr-problems','s:106:\"Извините! На данном сайте возникли технические трудности.\";'),('ru','messages:deadendpages','s:35:\"Тупиковые страницы\";'),('ru','messages:deadendpages-summary','s:0:\"\";'),('ru','messages:deadendpagestext','s:127:\"Следующие страницы не содержат ссылок на другие страницы в этой вики.\";'),('ru','messages:dec','s:6:\"дек\";'),('ru','messages:december','s:14:\"декабрь\";'),('ru','messages:december-date','s:17:\"Декабрь $1\";'),('ru','messages:december-gen','s:14:\"декабря\";'),('ru','messages:default','s:23:\"по умолчанию\";'),('ru','messages:default-skin-not-found','s:2724:\"Упс! Тема оформления по умолчанию для вашей вики, определённая в <code>$wgDefaultSkin</code> как <code>$1</code>, недоступна.\n\nВаша установка, похоже, содержит {{PLURAL:$4|следующую тему|следующие темы}} оформления. См. [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Skin_configuration Руководство:Настройка темы оформления] с информацией о том, как включить {{PLURAL:$4|её|их и выбрать тему по умолчанию}}.\n\n$2\n\n; Если вы только что установили MediaWiki:\n: Вы, видимо, сделали это с Git или непосредственно из исходного кода с использованием другого способа. Тогда такое возможно. Попробуйте установить некоторые темы из [https://www.mediawiki.org/wiki/Category:All_skins каталога тем оформления сайта mediawiki.org]:\n:* скачав [https://www.mediawiki.org/wiki/Special:MyLanguage/Download архив установочных файлов], который содержит несколько тем оформления и расширений. Вы можете скопировать из него папку <code>skins/</code>;\n:* скачав архивы отдельных тем оформления с [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org];\n:* [https://www.mediawiki.org/wiki/Special:MyLanguage/Download_from_Git#Using_Git_to_download_MediaWiki_skins использовав Git для загрузки тем оформления].\n: Это не должно навредить вашему репозиторию Git, если вы разработчик MediaWiki.\n\n; Если вы только что обновили MediaWiki:\n: MediaWiki версии 1.24 и новее больше автоматически не включает установленные темы (см. [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Manual: Skin autodiscovery]).\nВы можете вставить {{PLURAL:$5|следующую строку|следующие строки}} в <code>LocalSettings.php</code>, чтобы включить {{PLURAL:$5|установленную тему|все установленные темы}} оформления: \n\n<pre dir=\"ltr\">$3</pre>\n\n; Если вы только что изменили <code>LocalSettings.php</code>:\n: Перепроверьте названия тем на наличие опечаток.\";'),('ru','messages:default-skin-not-found-no-skins','s:1967:\"Упс! Тема оформления по умолчанию для вашей вики, определённая в <code>$wgDefaultSkin</code> как <code>$1</code>, недоступна.\n\nУ вас нет установленных тем оформления.\n\n; Если вы только что установили или обновили MediaWiki:\n: Вы, видимо, сделали это с Git или непосредственно из исходного кода с использованием другого способа. Тогда такое возможно. MediaWiki версии 1.24 и новее не содержат темы оформления в основном репозитории. Попробуйте установить некоторые темы из [https://www.mediawiki.org/wiki/Category:All_skins каталога тем оформления сайта mediawiki.org]:\n:* скачав [https://www.mediawiki.org/wiki/Special:MyLanguage/Download архив установочных файлов], который содержит несколько тем оформления и расширений. Вы можете скопировать папку <code>skins/</code> из него;\n:* скачав архивы отдельных тем оформления с [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org];\n:* [https://www.mediawiki.org/wiki/Special:MyLanguage/Download_from_Git#Using_Git_to_download_MediaWiki_skins использовав Git для загрузки тем оформления].\n: Это не должно навредить вашему репозиторию Git, если вы разработчик MediaWiki. См. [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Skin_configuration Manual:Skin configuration] с информацией о том, как включить темы оформления и выбрать тему по умолчанию.\";'),('ru','messages:default-skin-not-found-row-disabled','s:60:\"* <code>$1</code> / $2 (<strong>отключено</strong>)\";'),('ru','messages:default-skin-not-found-row-enabled','s:41:\"* <code>$1</code> / $2 (включено)\";'),('ru','messages:defaultmessagetext','s:34:\"Текст по умолчанию\";'),('ru','messages:defemailsubject','s:37:\"{{SITENAME}} — Письмо от $1\";'),('ru','messages:deflate-invaliddeflate','s:107:\"Предоставленное содержимое не спущено надлежащим образом\";'),('ru','messages:delete','s:14:\"Удалить\";'),('ru','messages:delete-confirm','s:20:\"$1: удаление\";'),('ru','messages:delete-edit-reasonlist','s:40:\"Править список причин\";'),('ru','messages:delete-edit-reasonlist-suppress','s:21:\"Edit suppress reasons\";'),('ru','messages:delete-hook-aborted','s:151:\"Правка отменена процедурой-перехватчиком.\nДополнительных пояснений не приведено.\";'),('ru','messages:delete-legend','s:16:\"Удаление\";'),('ru','messages:delete-scheduled','s:108:\"Страница «$1» запланирована для удаления.\nБудьте терпеливы.\";'),('ru','messages:delete-toobig','s:304:\"У этой страницы очень длинная история изменений (более $1 {{PLURAL:$1|версии|версий}}).\nУдаление таких страниц было запрещено во избежание нарушений в работе сайта «{{SITENAME}}».\";'),('ru','messages:delete-warning-toobig','s:354:\"У этой страницы очень длинная история изменений (более $1 {{PLURAL:$1|версии|версий}}).\nЕё удаление может привести к нарушению нормальной работы базы данных сайта «{{SITENAME}}»;\nдействуйте с осторожностью.\";'),('ru','messages:delete_and_move_confirm','s:112:\"Да, удалить страницу, на которую производится переименование\";'),('ru','messages:delete_and_move_reason','s:84:\"Удалено для возможности пе