т Y и C\";'),('ru','messages:exif-yresolution','s:45:\"Вертикальное разрешение\";'),('ru','messages:expand_templates_generate_rawhtml','s:21:\"Показать HTML\";'),('ru','messages:expand_templates_generate_xml','s:48:\"Показать дерево разбора XML\";'),('ru','messages:expand_templates_html_output','s:15:\"HTML-вывод\";'),('ru','messages:expand_templates_input','s:26:\"Входной текст:\";'),('ru','messages:expand_templates_input_missing','s:71:\"Вы должны вставить хоть какой-то текст.\";'),('ru','messages:expand_templates_intro','s:452:\"Эта служебная страница преобразует текст, рекурсивно разворачивая все шаблоны в нём.\nТакже развёртке подвергаются функции парсера\n<code><nowiki>{{#language:…}}</nowiki></code> и переменные вида\n<code><nowiki>{{CURRENTDAY}}</nowiki></code> — в общем, всё внутри двойных фигурных скобок.\";'),('ru','messages:expand_templates_ok','s:2:\"OK\";'),('ru','messages:expand_templates_output','s:18:\"Результат\";'),('ru','messages:expand_templates_preview','s:24:\"Предпросмотр\";'),('ru','messages:expand_templates_preview_fail_html','s:734:\"<em>Так как {{SITENAME}} разрешает использовать чистый HTML, предварительный просмотр отключён в качестве меры предотвращения JavaScript-атак.</em>\n\n<strong>Если это добросовестная попытка редактирования, пожалуйста, попробуйте ещё раз.</strong>\nЕсли не получается повторная правка, попробуйте [[Special:UserLogout|завершить сеанс]] работы, заново представиться и проверить, что ваш браузер разрешает использовать cookies на этом сайте.\";'),('ru','messages:expand_templates_preview_fail_html_anon','s:504:\"<em>Поскольку на сайте {{SITENAME}} включён «сырой» HTML, а вы не авторизовались, предварительный просмотр скрыт в качестве меры предосторожности против JavaScript-атак.</em>\n\n<strong>Если это правомерная попытка предварительного просмотра, пожалуйста, [[Special:UserLogin|войдите]] и попробуйте ещё раз.\";'),('ru','messages:expand_templates_remove_comments','s:37:\"Удалить комментарии\";'),('ru','messages:expand_templates_remove_nowiki','s:60:\"Подавлять теги <nowiki> в результате\";'),('ru','messages:expand_templates_title','s:72:\"Заголовок страницы для {{FULLPAGENAME}} и т. п.:\";'),('ru','messages:expand_templates_xml_output','s:14:\"XML вывод\";'),('ru','messages:expandtemplates','s:35:\"Развёртка шаблонов\";'),('ru','messages:expansion-depth-exceeded-category','s:76:\"Страницы с превышением глубины раскрытия\";'),('ru','messages:expansion-depth-exceeded-category-desc','s:117:\"У страницы превышена максимально допустимая глубина раскрытия.\";'),('ru','messages:expansion-depth-exceeded-warning','s:74:\"На странице превышен предел вложенности\";'),('ru','messages:expensive-parserfunction-category','s:129:\"Страницы со слишком большим количеством вызовов ресурсоёмких функций\";'),('ru','messages:expensive-parserfunction-category-desc','s:332:\"На странице используется слишком много ресурсоёмких функций (таких, как <code>#ifexist</code>). Подробнее — на странице [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgExpensiveParserFunctionLimit Manual:$wgExpensiveParserFunctionLimit].\";'),('ru','messages:expensive-parserfunction-warning','s:369:\"\'\'\'Внимание!\'\'\' Эта страница содержит слишком много вызовов ресурсоёмких функций.\n\nДолжно быть не более {{PLURAL:$2|$2 вызова|$2 вызовов|1=одного вызова}}, в то время как сейчас здесь $1 {{PLURAL:$1|вызов|вызовов|вызова}}.\";'),('ru','messages:expiringblock','s:29:\"завершится $1 в $2\";'),('ru','messages:explainconflict','s:537:\"Пока вы редактировали эту страницу, кто-то внёс в неё изменения.\nВ верхнем окне для редактирования вы видите текущий текст страницы.\nВ нижнем окне находится ваш вариант.\nПеренесите сделанные вами изменения из нижнего окна в верхнее.\nПри нажатии на кнопку «$1» будет сохранён текст верхнего окна.\";'),('ru','messages:export','s:29:\"Экспорт страниц\";'),('ru','messages:export-addcat','s:16:\"Добавить\";'),('ru','messages:export-addcattext','s:58:\"Добавить страницы из категории:\";'),('ru','messages:export-addns','s:16:\"Добавить\";'),('ru','messages:export-addnstext','s:73:\"Добавить страницы из пространства имён:\";'),('ru','messages:export-download','s:55:\"Предложить сохранить как файл\";'),('ru','messages:export-manual','s:49:\"Добавить страницы вручную:\";'),('ru','messages:export-pagelinks','s:70:\"Включить связанные страницы глубиной:\";'),('ru','messages:export-submit','s:28:\"Экспортировать\";'),('ru','messages:export-summary','s:0:\"\";'),('ru','messages:export-templates','s:31:\"Включить шаблоны\";'),('ru','messages:exportall','s:52:\"Экспортировать все страницы\";'),('ru','messages:exportcuronly','s:101:\"Включать только текущую версию, без полной предыстории\";'),('ru','messages:exportlistauthors','s:109:\"Включить полный перечень внёсших вклад для каждой страницы\";'),('ru','messages:exportnohistory','s:192:\"----\n\'\'\'Замечание:\'\'\' экспорт полной истории изменений страниц отключён из-за проблем с производительностью.\";'),('ru','messages:exporttext','s:1068:\"Вы можете экспортировать текст и журнал изменений конкретной страницы или набора страниц в XML, который потом может быть [[Special:Import|импортирован]] в другой вики-проект, работающий на программном обеспечении MediaWiki.\n\nЧтобы экспортировать статьи, введите их наименования в поле редактирования, одно название на строку, и выберите хотите ли вы экспортировать всю историю изменений статей или только последние версии статей.\n\nВы также можете использовать специальный адрес для экспорта только последней версии. Например для страницы [[{{MediaWiki:Mainpage}}]] это будет адрес [[{{#Special:Export}}/{{MediaWiki:Mainpage}}]].\";'),('ru','messages:external_image_whitelist','s:849:\" #Оставьте эту строчку такой, как она есть<pre>\n#Разместите здесь фрагменты регулярных выражений (ту часть, что находится между //)\n#они будут соотнесены с URL внешних изображений.\n#Подходящие будут показаны как изображения, остальные будут показаны как ссылки на изображения.\n#Строки, начинающиеся с # считаются комментариями.\n#Строки не чувствительны к регистру\n\n#Размещайте фрагменты регулярных выражений над этой строчкой. Оставьте эту строчку такой, как она есть.</pre>\";'),('ru','messages:externaldberror','s:272:\"Произошла ошибка при аутентификации с помощью внешней базы данных или у вас недостаточно прав для внесения изменений в свою внешнюю учётную запись.\";'),('ru','messages:faq','s:8:\"ЧаВО\";'),('ru','messages:feb','s:6:\"фев\";'),('ru','messages:february','s:14:\"февраль\";'),('ru','messages:february-date','s:17:\"Февраль $1\";'),('ru','messages:february-gen','s:14:\"февраля\";'),('ru','messages:feed-atom','s:4:\"Atom\";'),('ru','messages:feed-invalid','s:69:\"Неправильный тип канала для подписки.\";'),('ru','messages:feed-rss','s:3:\"RSS\";'),('ru','messages:feed-unavailable','s:52:\"Ленты синдикации недоступны\";'),('ru','messages:feedback-adding','s:58:\"Добавление отзыва на страницу…\";'),('ru','messages:feedback-back','s:10:\"Назад\";'),('ru','messages:feedback-bugcheck','s:150:\"Прекрасно! Только проверьте, что в списке [$1 известных ошибок] нет подобной записи.\";'),('ru','messages:feedback-bugnew','s:64:\"Я проверил. Сообщить о новой ошибке\";'),('ru','messages:feedback-bugornote','s:479:\"Если вы готовы подробно описать техническую проблему, пожалуйста, [$1 сообщите об ошибке].\nВ противном случае вы можете использовать данную простую форму. Ваш комментарий будет добавлен на страницу «[$3 $2]» вместе с вашим именем участника и используемым браузером.\";'),('ru','messages:feedback-cancel','s:12:\"Отмена\";'),('ru','messages:feedback-close','s:12:\"Готово\";'),('ru','messages:feedback-dialog-intro','s:262:\"Вы можете воспользоваться простой формой ниже, чтобы оставить свой отзыв. Комментарий с вашим именем участника будет добавлен на страницу «$1».\";'),('ru','messages:feedback-dialog-title','s:29:\"Отправить отзыв\";'),('ru','messages:feedback-error1','s:64:\"Ошибка. Неизвестный результат из API\";'),('ru','messages:feedback-er