меньшенная копия <em>(миниатюра)</em> уже имеющегося файла. \n[[$1|thumb]]\nПожалуйста, проверьте файл <strong>[[:$1]]</strong>.\nЕсли это то же самое изображение, не стоит загружать отдельно его уменьшенную копию.\";'),('ru','messages:filehist','s:25:\"История файла\";'),('ru','messages:filehist-comment','s:20:\"Примечание\";'),('ru','messages:filehist-current','s:14:\"текущий\";'),('ru','messages:filehist-datetime','s:19:\"Дата/время\";'),('ru','messages:filehist-deleteall','s:21:\"удалить все\";'),('ru','messages:filehist-deleteone','s:14:\"удалить\";'),('ru','messages:filehist-dimensions','s:14:\"Размеры\";'),('ru','messages:filehist-filesize','s:23:\"Размер файла\";'),('ru','messages:filehist-help','s:120:\"Нажмите на дату/время, чтобы просмотреть, как тогда выглядел файл.\";'),('ru','messages:filehist-nothumb','s:25:\"Нет миниатюры\";'),('ru','messages:filehist-revert','s:14:\"вернуть\";'),('ru','messages:filehist-thumb','s:18:\"Миниатюра\";'),('ru','messages:filehist-thumbtext','s:46:\"Миниатюра для версии от $1\";'),('ru','messages:filehist-user','s:16:\"Участник\";'),('ru','messages:filejournal-fail-dbconnect','s:118:\"Не удалось подключиться к базе данных журнала для хранилища «$1».\";'),('ru','messages:filejournal-fail-dbquery','s:107:\"Не удалось обновить базу данных журнала для хранилища «$1».\";'),('ru','messages:filemissing','s:26:\"Файл не найден\";'),('ru','messages:filename','s:17:\"Имя файла\";'),('ru','messages:filename-bad-prefix','s:375:\"Имя загружаемого файла начинается с «<strong>$1</strong>» и, вероятно, представляет собой одно из шаблонных имён, генерируемых цифровыми фотокамерами. Пожалуйста, выберите имя, лучше описывающее содержание файла.\";'),('ru','messages:filename-prefix-blacklist','s:698:\" #<!-- оставьте эту строчку как есть --> <pre>\n# Синтаксис следующий:\n#   * Всё, что начинается с символа «#», считается комментарием (до конца строки)\n#   * Каждая непустая строка — префикс стандартного названия файла, которое обычно даёт ци