ges:mergehistory-submit','s:33:\"Объединить правки\";'),('ru','messages:mergehistory-warning-redirect-not-created','s:0:\"\";'),('ru','messages:mergelog','s:35:\"Журнал объединений\";'),('ru','messages:mergelogpagetext','s:111:\"Ниже приведён список последних объединений историй страниц.\";'),('ru','messages:metadata','s:20:\"Метаданные\";'),('ru','messages:metadata-collapse','s:54:\"Скрыть дополнительные данные\";'),('ru','messages:metadata-expand','s:58:\"Показать дополнительные данные\";'),('ru','messages:metadata-fields','s:493:\"Поля метаданных изображения, перечисленные в этом списке, будут показаны на странице изображения при свёрнутой таблице метаданных. Остальные поля будут по умолчанию скрыты.\n* make\n* model\n* datetimeoriginal\n* exposuretime\n* fnumber\n* isospeedratings\n* focallength\n* artist\n* copyright\n* imagedescription\n* gpslatitude\n* gpslongitude\n* gpsaltitude\";'),('ru','messages:metadata-help','s:374:\"Файл содержит дополнительные данные, обычно добавляемые цифровыми камерами или сканерами. Если файл после создания редактировался, то некоторые параметры могут не соответствовать текущему изображению.\";'),('ru','messages:metadata-langitem','s:23:\"<strong>$2:</strong> $1\";'),('ru','messages:metadata-langitem-default','s:2:\"$1\";'),('ru','messages:mimesearch','s:20:\"Поиск по MIME\";'),('ru','messages:mimesearch-summary','s:249:\"Эта страница позволяет фильтровать файлы по их MIME-типу. Формат ввода: типсодержимого/подтип или типсодержимого/*, например <code>image/jpeg</code>.\";'),('ru','messages:mimetype','s:12:\"MIME-тип:\";'),('ru','messages:minimum-size','s:35:\"Минимальный размер\";'),('ru','messages:minlength1','s:94:\"Название файла должно содержать хотя бы одну букву.\";'),('ru','messages:minoredit','s:29:\"Малое изменение\";'),('ru','messages:minoreditletter','s:2:\"м\";'),('ru','messages:minutes','s:59:\"{{PLURAL:$1|$1 минута|$1 минуты|$1 минут}}\";'),('ru','messages:minutes-abbrev','s:5:\"$1 м\";'),('ru','messages:minutes-ago','s:64:\"$1 {{PLURAL:$1|минуту|минуты|минут}} назад\";'),('ru','messages:missing-article','s:720:\"В базе данных не найдено запрашиваемого текста страницы «$1» $2, который следовало найти.\n\nПодобная ситуация обычно возникает при попытке перехода по устаревшей ссылке на историю изменения страницы, которая была удалена.\n\nЕсли дело не в этом, то скорее всего, вы обнаружили ошибку в программном обеспечении.\nПожалуйста, сообщите об этом одному из [[Special:ListUsers/sysop|администраторов]], указав данный URL.\";'),('ru','messages:missing-revision','s:370:\"Версия $1 страницы «{{FULLPAGENAME}}» не существует.\n\nОбычно это бывает, если проследовать по устаревшей ссылке на удалённую страницу.\nПодробности могут быть в [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} журнале удалений].\";'),('ru','messages:missing-revision-content','s:101:\"Не удалось загрузить содержимое версии #$1 страницы «$2».\";'),('ru','messages:missingarticle-diff','s:26:\"(разность: $1, $2)\";'),('ru','messages:missingarticle-rev','s:21:\"(версия № $1)\";'),('ru','messages:missingcommentheader','s:279:\"<strong>Напоминание.</strong> Вы не указали тему/заголовок для этого комментария.\nПри повторном нажатии на кнопку «$1», ваша правка будет записана без заголовка.\";'),('ru','messages:missingcommenttext','s:60:\"Пожалуйста, введите комментарий.\";'),('ru','messages:missingsummary','s:257:\"\'\'\'Напоминание.\'\'\' Вы не дали краткого описания изменений. При повторном нажатии на кнопку «$1» ваши изменения будут сохранены без комментария.\";'),('ru','messages:modeleditnotsupported-text','s:104:\"Редактирование не поддерживается моделью содержимого $1.\";'),('ru','messages:modeleditnotsupported-title','s:62:\"Редактирование не поддерживается\";'),('ru','messages:modifiedarticleprotection','s:70:\"изменён уровень защиты страницы «[[$1]]»\";'),('ru','messages:modifiedarticleprotection-comment','s:66:\"Изменил{{GENDER:$2||а}} уровень защиты [[$1]]\";'),('ru','messages:mon','s:4:\"Пн\";'),(