цы.\";'),('ru','messages:moveddeleted-notice-recent','s:301:\"К сожалению, эта страница была недавно удалена (в течение последних 24 часов).\nНиже для справки приведены журналы удаления, защиты и переименования для этой страницы.\";'),('ru','messages:movelogpage','s:41:\"Журнал переименований\";'),('ru','messages:movelogpagetext','s:91:\"Ниже представлен список переименованных страниц.\";'),('ru','messages:movenologintext','s:172:\"Вы должны [[Special:UserLogin|представиться системе]], чтобы иметь возможность переименовать страницы.\";'),('ru','messages:movenosubpage','s:57:\"У этой страницы нет подстраниц.\";'),('ru','messages:movenotallowed','s:79:\"У вас нет прав на переименовывание страниц.\";'),('ru','messages:movenotallowedfile','s:77:\"У вас нет прав на переименовывание файлов.\";'),('ru','messages:movepage-delete-first','s:281:\"У целевой страницы слишком много версий для удаления как части переименования страницы. Сначала удалите эту страницу вручную, а затем повторите попытку.\";'),('ru','messages:movepage-invalid-target-title','s:53:\"Запрошенное имя недопустимо.\";'),('ru','messages:movepage-max-pages','s:325:\"{{PLURAL:$1|Была переименована|Было переименовано|Были переименованы}} $1 {{PLURAL:$1|страница|страницы|страниц}} — это максимум; большее число страниц автоматически переименовать нельзя.\";'),('ru','messages:movepage-moved','s:66:\"\'\'\'Страница «$1» переименована в «$2»\'\'\'\";'),('ru','messages:movepage-moved-noredirect','s:76:\"Создание перенаправления было подавлено.\";'),('ru','messages:movepage-moved-redirect','s:55:\"Было создано перенаправление.\";'),('ru','messages:movepage-page-exists','s:128:\"Страница $1 уже существует и не может быть автоматически перезаписана.\";'),('ru','messages:movepage-page-moved','s:62:\"Страница $1 была переименована в $2.\";'),('ru','messages:movepage-page-unmoved','s:78:\"Страница $1 не может быть переименована в $2.\";'),('ru','messages:movepage-source-doesnt-exist','s:115:\"Страница $1 не существует, а потому не может быть переименована.\";'),('ru','messages:movepage-summary','s:0:\"\";'),('ru','messages:movepagebtn','s:43:\"Переименовать страницу\";'),('ru','messages:movepagetalktext','s:529:\"Если вы отметите эту галочку, соответствующая страница обсуждения будет также автоматически переименована, если только уже не существует непустая страница обсуждения с таким же названием.\n\nВ этом случае вам нужно будет переименовать или объединить страницы вручную, если это необходимо.\";'),('ru','messages:movepagetext','s:2052:\"Воспользовавшись нижеприведённой формой, вы переименуете страницу, одновременно переместив на новое место её журнал изменений.\nСтарое название станет перенаправлением на новое.\nВы можете автоматически обновить перенаправления, которые вели на старое название.\nЕсли вы этого не сделаете, пожалуйста, проверьте наличие [[Special:DoubleRedirects|двойных]] и [[Special:BrokenRedirects|разорванных перенаправлений]].\nВы отвечаете за то, чтобы ссылки продолжали и далее указывать туда, куда предполагалось.\n\nОбратите внимание, что страница <strong>не будет</strong> переименована, если уже существует страница с названием, идентичным выбранному, кроме случаев, когда такая страница пуста или представляет собой перенаправление, и при этом не имеет истории правок.\nЭто означает, что сделав ошибочное переименование, вы можете переименовать страницу обратно в то название, которое у неё только что было, но не можете случайно затереть существующую страницу.\n\n<strong>Примечание:</strong>\nПереименование популярных страниц может привести к масштабным и неожиданным изменениям.\nПожалуйста, прежде чем продолжать, убедитесь, что понимаете все возможные последствия.\";'),('ru','messages:movepagetext-noredirectfixer','s:1801:\"Воспользовавшись формой ниже, вы переименуете страницу, одновременно переместив на новое место её журнал изменений.\nСтарое название станет перенаправлением на новое название.\nПожалуйста, проверьте наличие [[Special:DoubleRedirects|двойных]] и [[Special:BrokenRedirects|разорванных перенаправлений]].\nВы отвечаете за то, чтобы ссылки продолжали и далее указывать туда, куда предполагалось.\n\nОбратите внимание, что страница <strong>не будет</strong> переименована, если страница с новым названием уже существует, кроме случаев, если она пуста или представляет собой перенаправление, и при этом не имеет истории правок.\nЭто означает, что сделав ошибочное переименование, вы сможете переименовать страницу обратно в то название, которое у неё только что было, но не сможете случайно затереть существующую страницу.\n\n<strong>Примечание:</strong>\nПереименование может привести к масштабным и неожиданным изменениям для популярных страниц.\nПожалуйста, прежде чем продолжить, убедитесь, что понимаете все возможные последствия.\";'),('ru','messages:movepagetext-noredirectsupport','s:1328:\"Воспользовавшись нижеприведённой формой, вы переименуете страницу, одновременно переместив на новое место её журнал изменений.\nВы отвечаете за то, чтобы ссылки продолжали и далее указывать туда, куда предполагалось.\n\nОбратите внимание, что страница <strong>не будет</strong> переименована, если уже существует страница под новым названием.\nЭто означает, что сделав ошибочное переименование, вы можете переименовать страницу обратно в то название, которое у неё только что было, но не можете случайно затереть существующую страницу.\n\n<strong>Примечание:</strong>\nПереименование популярных страниц может привести к масштабным и неожиданным изменениям.\nПожалуйста, прежде чем продолжать, убедитесь, что понимаете все возможные последствия.\";'),('ru','messages:movereason','s:15:\"Причина:\";'),('ru','messages:movesubpage','s:61:\"{{PLURAL:$1|1=Подстраница|Подстраницы}}\";'),('ru','messages:movesubpagetalktext','s:241:\"У соответствующей страницы обсуждения есть $1 {{PLURAL:$1|подстраница, показанная |подстраниц, показанных|подстраницы, показанные}} ниже.\";'),('ru','messages:movesubpagetext','s:113:\"У этой страницы $1 {{PLURAL:$1|подстра