)</span>\";'),('ru','messages:passwordpolicies-policy-maximalpasswordlength','s:96:\"Пароль должен быть короче $1 {{PLURAL:$1|символа|символов}}\";'),('ru','messages:passwordpolicies-policy-minimalpasswordlength','s:112:\"Пароль должен быть длиной не менее $1 {{PLURAL:$1|символа|символов}}\";'),('ru','messages:passwordpolicies-policy-minimumpasswordlengthtologin','s:199:\"Пароль должен быть длиной не менее $1 {{PLURAL:$1|символа|символов}}, чтобы участник мог войти в свою учётную запись\";'),('ru','messages:passwordpolicies-policy-passwordcannotbesubstringinusername','s:99:\"Пароль не может быть подстрокой от имени пользователя\";'),('ru','messages:passwordpolicies-policy-passwordcannotmatchblacklist','s:205:\"Пароль не может совпадать ни с одним паролем, внесённым в специальный список паролей, используемых по умолчанию\";'),('ru','messages:passwordpolicies-policy-passwordcannotmatchdefaults','s:205:\"Пароль не может совпадать ни с одним паролем, внесённым в специальный список паролей, используемых по умолчанию\";'),('ru','messages:passwordpolicies-policy-passwordcannotmatchusername','s:97:\"Пароль не может совпадать с названием учётной записи\";'),('ru','messages:passwordpolicies-policy-passwordnotincommonlist','s:126:\"Пароль не может быть из списка 100 000 самых часто используемых паролей.\";'),('ru','messages:passwordpolicies-policy-passwordnotinlargeblacklist','s:157:\"Пароль не может соответствовать какому-либо из 100 000 самых часто используемых паролей.\";'),('ru','messages:passwordpolicies-policyflag-forcechange','s:55:\"необходимо изменить при входе\";'),('ru','messages:passwordpolicies-policyflag-suggestchangeonlogin','s:57:\"предложить изменение при входе\";'),('ru','messages:passwordpolicies-summary','s:331:\"На этой странице перечисляются действующие на этой вики ограничения на пароли участников. Ограничения, действующие для какого-либо участника, зависят от групп, в которые он входит.\";'),('ru','messages:passwordremindertext','s:826:\"Кто-то (с IP-адреса $1) запросил новый пароль для {{grammar:genitive|{{SITENAME}}}} ($4). Для участника $2\nсоздан временный пароль: $3. Если это был ваш запрос,\nвам следует представиться системе и выбрать новый пароль.\nВаш временный пароль будет действовать в течение $5 {{PLURAL:$5|дня|дней}}.\n\nЕсли вы не посылали запроса на смену пароля, или уже вспомнили свой пароль,\nи не желаете его менять, вы можете проигнорировать данное сообщение и\nпродолжить использовать свой старый пароль.\";'),('ru','messages:passwordremindertitle','s:88:\"Напоминание пароля участника {{grammar:genitive|{{SITENAME}}}}\";'),('ru','messages:passwordreset','s:23:\"Сброс пароля\";'),('ru','messages:passwordreset-disabled','s:66:\"Сбросы пароля в этой вики отключены.\";'),('ru','messages:passwordreset-domain','s:11:\"Домен:\";'),('ru','messages:passwordreset-email','s:45:\"Адрес электронной почты:\";'),('ru','messages:passwordreset-emaildisabled','s:89:\"Функции электронной почты отключены в этой вики.\";'),('ru','messages:passwordreset-emailelement','s:68:\"Имя участника: \n$1\n\nВременный пароль: \n$2\";');
INSERT INTO `prefl10n_cache` VALUES ('ru','messages:passwordreset-emailtext-ip','s:1029:\"Кто-то (вероятно, вы, с IP-адреса $1) запросил сброс пароля к вашей учётной записи в проекте {{SITENAME}} ($4).\nС этим адресом электронной почты {{PLURAL:$3|1=связана следующая учётная запись|связаны следующие учётные записи}}:\n\n$2\n\n{{PLURAL:$3|1=Этот временный пароль будет|Эти временные пароли будут}} действовать {{PLURAL:$5|$5 день|$5 дня|$5 дней|1=один день}}.\nВы должны представиться системе и выбрать новый пароль. \nЕсли вы не делали этого запроса, или вспомнили свой исходный пароль и не желаете его менять, \nто можете проигнорировать это сообщение и продолжить использовать свой старый пароль.\";'),('ru','messages:passwordreset-emailtext-require-email','s:570:\"Однако если вы не сгенерировали этот запрос и хотите предотвратить нежелательные электронные письма, вы можете обновить параметры электронной почты на $1. Вы можете требовать как имя участника, так и адрес электронной почты для создания писем для сброса пароля. Это может уменьшить количество таких инцидентов.\";'),('ru','messages:passwordreset-emailtext-user','s:1010:\"Участник $1 из проекта {{SITENAME}} запросил сброс пароля для вашей учётной записи в проекте {{SITENAME}} ($4).\nС этим адресом электронной почты {{PLURAL:$3|1=связана следующая учётная запись|связаны следующие учётные записи}}:\n\n$2\n\n{{PLURAL:$3|1=Этот временный пароль будет|Эти временные пароли будут}} действовать {{PLURAL:$5|один день|$5 дня|$5 дней}}.\nВы должны представиться системе и выбрать новый пароль.\nЕсли вы не делали этого запроса или вспомнили свой исходный пароль и не желаете его менять, \nто можете проигнорировать это сообщение и продолжить использовать свой старый пароль.\";'),('ru','messages:passwordreset-emailtitle','s:62:\"Сведения об учётной записи {{SITENAME}}\";'),('ru','messages:passwordreset-ignored','s:139:\"Сброс пароля не был обработан. Может быть, не был настроен ни один провайдер?\";'),('ru','messages:passwordreset-nocaller','s:76:\"Должен быть предоставлен источник вызова\";'),('ru','messages:passwordreset-nodata','s:122:\"Ни имя участника, ни адрес электронной почты не были предоставлены\";'),('ru','messages:passwordreset-nosuchcaller','s:59:\"Источник вызова не существует: $1\";'),('ru','messages:passwordreset-success','s:48:\"Вы запросили сброс пароля.\";'),('ru','messages:passwordreset-success-details-generic','s:953:\"Если предоставленная информация верна, будет отправлено электронное письмо для сброса пароля. Если вы не получили письмо, рекомендуем вам посетить [[mw:Special:MyLanguage/Help:Reset_password|страницу справки по сбросу пароля]] или попробовать чуть позже. Вы можете <strong>запросить ограниченное количество сбросов пароля в течение короткого периода времени. Обратите внимание, что для того, чтобы предотвратить злоупотребления, для каждого аккаунта в течение {{PLURAL:$1|часа|$1 часов}} может быть отправлено только одно письмо сброса пароля</strong>.\";'),('ru','messages:passwordreset-success-info','s:56:\"Данные, которые вы отправили: $1\";'),('ru','messages:passwordreset-text-many','s:157:\"{{PLURAL:$1|Заполните одно из полей для получения временного пароля по электронной почте.}}\";'),('ru','messages:passwordreset-text-one','s:88:\"Заполните эту форму, чтобы сбросить свой пароль.\";'),('ru','messages:passwordreset-username','s:26:\"Имя участника:\";'),('ru','messages:passwordsent','s:265:\"Новый пароль был выслан на адрес электронной почты, указанный для участника $1.\n\nПожалуйста, представьтесь системе заново после получения пароля.\";'),('ru','messages:passwordtoolong','s:113:\"Пароль не может содержать более {{PLURAL:$1|1=$1 символа|$1 символов}}.\";'),('ru','messages:passwordtooshort','s:121:\"Пароль должен состоять не менее, чем из $1 {{PLURAL:$1|символа|символов}}.\";'),('ru','messages:patrol-log-auto','s:11:\"(automatic)\";'),('ru','messages:patrol-log-diff','s:11:\"revision $1\";'),('ru','messages:patrol-log-header','s:64:\"Это журнал патрулированных версий.\";'),('ru','messages:patrol-log-line','s:28:\"marked $1 of $2 patrolled $3\";'),('ru','messages:patrol-log-page','s:41:\"Журнал патрулирования\";'),('ru','messages:pear-mail-error','s:2:\"$1\";'),('ru','messages:percent','s:3:\"$1%\";'),('ru','messages:perfcached','s:203:\"Следующие данные были взяты из кэша и могут быть устаревшими. В кэше хранится не более $1 {{PLURAL:$1|записи|записей}}.\";'),('ru','messages:perfcachedts','s:217:\"Данные взяты из кэша; последний раз он обновлялся в $1. В кэше хранится не более {{PLURAL:$4|1=одной записи|$4 записи|$4 записей}}.\";'),('ru','messages:period-am','s:4:\"ДП\";'),('ru','messages:period-pm','s:4:\"ПП\";'),('ru','messages:permalink','s:33:\"Постоянная ссылка\";'),('ru','messages:permanentlink','s:33:\"Постоянная ссылка\";'),('ru','messages:permanentlink-revid','s:39:\"Идентификатор правки\";'),('ru','messages:permanentlink-submit','s:30:\"Перейти к версии\";'),('ru','messages:permanentlink-summary','s:0:\"\";'),('ru','messages:permissionserrors','s:36:\"Ошибка прав доступа\";'),('ru','messages:permissionserrorstext','s:169:\"У вас нет прав на выполнение этой операции по {{PLURAL:$1|1=следующей причине|следующим причинам}}:\";'),('ru','messages:permissionserrorstext-withaction','s:167:\"У вас нет прав на выполнение действия «$2» по {{PLURAL:$1|1=следующей причине|следующим причинам}}:\";'),('ru','messages:personaltools','s:47:\"Персональные инструменты\";'),('ru','messages:php-mail-error','s:2:\"$1\";'),('ru','messages:php-mail-error-unknown','s:64:\"Неизвестная ошибка в PHP-функции mail()\";'),('ru','messages:php-uploaddisabledtext','s:166:\"Загрузка файлов отключена в настройках PHP. Пожалуйста, проверьте значение свойства file_uploads.\";'),('ru','messages:pipe-separator','s:11:\"&#32;|&#32;\";'),('ru','messages:policy-url','s:22:\"Project:Правила\";'),('ru','messages:pool-errorunknown','s:35:\"Неизвестная ошибка\";'),('ru','messages:pool-queuefull','s:34:\"Пул запросов полон\";'),('ru','messages:pool-server