s:396:\"Для полного восстановления истории страницы оставьте все отметки пустыми и нажмите \'\'\'«{{int:undeletebtn}}»\'\'\'.\nДля частичного восстановления отметьте те версии страницы, которые нужно восстановить, и нажмите \'\'\'«{{int:undeletebtn}}»\'\'\'.\";'),('ru','messages:undeletehistory','s:387:\"При восстановлении страницы восстанавливается и её история правок.\nЕсли после удаления была создана новая страница с тем же названием, то восстановленные версии появятся в истории правок перед новыми версиями.\";'),('ru','messages:undeletehistorynoadmin','s:326:\"Статья была удалена. Причина удаления и список участников, редактировавших статью до её удаления, показаны ниже. Текст удалённой статьи могут просмотреть только администраторы.\";'),('ru','messages:undeleteinvert','s:35:\"Обратить выделение\";'),('ru','messages:undeletelink','s:47:\"просмотреть/восстановить\";'),('ru','messages:undeletepage','s:82:\"Просмотр и восстановление удалённых страниц\";'),('ru','messages:undeletepagetext','s:602:\"{{PLURAL:$1|Следующая $1 страница была удалена|Следующие $1 страниц были удалены|Следующие $1 страницы были удалены|1=Следующая страница была удалена}}, однако {{PLURAL:$1|1=она всё ещё находится в архиве и поэтому может быть восстановлена|они всё ещё находятся в архиве и поэтому могут быть восстановлены}}.\nАрхив может периодически очищаться.\";'),('ru','messages:undeletepagetitle','s:95:\"\'\'\'Ниже перечислены удалённые версии страницы [[:$1]]\'\'\'.\";'),('ru','messages:undeleterevdel','s:363:\"Восстановление не будет произведено, если оно приведёт к частичному удалению последней версии страницы или файла.\nВ подобном случае вы должны снять отметку или показать последние удалённые версии.\";'),('ru','messages:undeleterevision-duplicate-revid','s:204:\"$1 {{PLURAL:$1|версия|версий|версии}} не могут быть восстановлены, поскольку {{PLURAL:$1|её|их}} <code>rev_id</code> уже используется.\";'),('ru','messages:undeleterevision-missing','s:222:\"Неверная или отсутствующая версия. Возможно, вы перешли по неправильной ссылке, либо версия могла быть удалена из архива.\";'),('ru','messages:undeleterevisions','s:112:\"$1 {{PLURAL:$1|удалённая версия|удалённые версии|удалённых версий}}\";'),('ru','messages:undeleteviewlink','s:22:\"просмотреть\";'),('ru','messages:underline-always','s:12:\"Всегда\";'),('ru','messages:underline-default','s:60:\"Использовать настройки браузера\";'),('ru','messages:underline-never','s:14:\"Никогда\";'),('ru','messages:undo-failure','s:142:\"Правка не может быть отменена из-за несовместимости промежуточных изменений.\";'),('ru','messages:undo-main-slot-only','s:151:\"Правка не может быть отменена, поскольку оно включает контент вне основного слота.\";'),('ru','messages:undo-nochange','s:61:\"Правка, похоже, уже была отменена.\";'),('ru','messages:undo-norev','s:139:\"Правка не может быть отменена, так как её не существует или она была удалена.\";'),('ru','messages:undo-success','s:387:\"Правка может быть отменена. Пожалуйста, просмотрите сравнение версий, чтобы убедиться, что это именно те изменения, которые вас интересуют, и нажмите «Записать страницу», чтобы ваша отмена правки была сохранена.\";'),('ru','messages:undo-summary','s:120:\"Отмена правки $1, сделанной [[Special:Contributions/$2|$2]] ([[User talk:$2|обсуждение]])\";'),('ru','messages:undo-summary-anon','s:65:\"Отмена версии $1 от [[Special:Contributions/$2|$2]]\";'),('ru','messages:undo-summary-import','s:101:\"Отклонить импортированную страницу $1 участником [[:$2|$3]]\";'),('ru','messages:undo-summary-import2','s:149:\"Отклонить импортированную {{gender:$2|участником|участницей|участником}} $2 страницу $1\";'),('ru','messages:undo-summary-username-hidden','s:97:\"Отмена правки $1, сделанной участником, чьё имя скрыто\";'),('ru','messages:unexpected','s:57:\"Неподходящее значение: «$1»=«$2».\";'),('ru','messages:unicode-support-fail','s:225:\"Похоже, ваш браузер не поддерживает Unicode. Это необходимо для редактирования страниц, поэтому ваша правка не была сохранена.\";'),('ru','messages:unit-pixel','s:10:\" пикс.\";'),('ru','messages:unknown-error','s:36:\"Неизвестная ошибка.\";'),('ru','messages:unlinkaccounts','s:44:\"Отвязать учётные записи\";'),('ru','messages:unlinkaccounts-success','s:52:\"Учётная запись была отвязан.\";'),('ru','messages:unlockbtn','s:85:\"Восстановить возможность записи в базу данных\";'),('ru','messages:unlockconfirm','s:99:\"Да, я действительно хочу снять блокировку базы данных.\";'),('ru','messages:unlockdb','s:85:\"Восстановить возможность записи в базу данных\";'),('ru','messages:unlockdbsuccesssub','s:50:\"База данных разблокирована\";'),('ru','messages:unlockdbsuccesstext','s:75:\"База данных проекта была разблокирована.\";'),('ru','messages:unlockdbtext','s:483:\"Разблокирование базы данных восстановит для всех участников\nвозможность редактировать страницы, изменять настройки, изменять списки наблюдения и производить\nдругие действия, требующие доступа к базе данных.\nПожалуйста, подтвердите, что вы намерены это сделать.\";'),('ru','messages:unpatrolledletter','s:1:\"!\";'),('ru','messages:unprotect','s:29:\"Изменить защиту\";'),('ru','messages:unprotected-js','s:317:\"По соображениям безопасности JavaScript нельзя загружать с незащищённых страниц. Пожалуйста, создавайте скрипты только в пространстве имён MediaWiki: или как подстраницы участника.\";'),('ru','messages:unprotectedarticle','s:37:\"снята защита с «[[$1]]»\";'),('ru','messages:unprotectedarticle-comment','s:51:\"Cнял{{GENDER:$2||а}} защиту с «[[$1]]»\";'),('ru','messages:unregistered-user-config','s:248:\"По соображениям безопасности пользовательские подстраницы JavaScript, CSS и JSON не могут быть загружены для незарегистрированных участников.\";'),('ru','messages:unstrip-depth-category','s:80:\"Страницы с превышенным лимитом глубины Unstrip\";'),('ru','messages:unstrip-depth-warning','s:51:\"Превышен предел рекурсии ($1)\";'),('ru','messages:unstrip-size-category','s:80:\"Страницы с превышенным лимитом размера Unstrip\";'),('ru','messages:unstrip-size-warning','s:55:\"Превышен лимит размера Unstrip ($1)\";'),('ru','messages:unsupported-content-diff','s:113:\"Изменения (различия) не поддерживаются моделью содержимого $1.\";'),('ru','messages:unsupported-content-diff2','s:155:\"Изменения (различия) между моделями содержимого $1 и $2 не поддерживаются на этой вики.\";'),('ru','messages:unsupported-content-model','s:131:\"<strong>Внимание:</strong> Модель содержимого $1 не поддерживается на этой вики.\";'),('ru','messages:unusedcategories','s:47:\"Неиспользуемые категории\";'),('ru','messages:unusedcategories-summary','s:0:\"\";'),('ru','messages:unusedcategoriestext','s:155:\"Существуют следующие страницы категорий, не содержащие статей или других категорий.\";'),('ru','messages:unusedimages','s:39:\"Неиспользуемые файлы\";'),('ru','messages:unusedimages-summary','s:0:\"\";'),('ru','messages:unusedimagestext','s:408:\"Следующие файлы не используются ни на одной странице.\nПожалуйста, учтите, что другие веб-сайты могут непосредственно ссылаться на этот файл (его URL), таким образом он может использоваться несмотря на вхождение в этот список.\";'),('ru','messages:unusedimagestext-categorizedimgisused','s:580:\"Следующие файлы существуют, но не включены ни в одну страницу. Категоризируемые изображения считаются используемыми, несмотря на то что не присутствуют ни в одной странице.\nОбратите внимание, что другие вебсайты могут ссылаться на файл по прямому URL-адресу, и они будут находиться несмотря на активное использование.\";'),('ru','messages:unusedtemplates','s:43:\"Неиспользуемые шаблоны\";'),('ru','messages:unusedtemplates-summary','s:0:\"\";'),('ru','messages:unusedtemplatestext','s:321:\"Здесь перечислены все страницы пространства имён «{{ns:template}}», не включённые ни в какие другие страницы.\nНе забывайте проверять отсутствие ссылок на шаблон перед его удалением.\";'),('ru','messages:unusedtemplateswlh','s:25:\"другие ссылки\";'),('ru','messages:unwatch','s:19:\"Не следить\";'),('ru','messages:unwatchedpages','s:68:\"Страницы, за которыми никто не следит\";'),('ru','messages:unwatchedpages-summary','s:0:\"\";'),('ru','messages:unwatching','s:58:\"Удаление из списка наблюдения…\";'),('ru','messages:unwatchthispage','s:41:\"Прекратить наблюдение\";'),('ru','messages:updated','s:20:\"(Обновлена)\";'),('ru','messages:updatedmarker','s:82:\"обновлено после вашего последнего посещения\";'),('ru','messages:updatewatchlist','s:50:\"Обновить список наблюдения\";'),('ru','messages:upload','s:27:\"Загрузить файл\";'),('ru','messages:upload-copy-upload-invalid-domain','s:87:\"Копирование загрузок не доступно в этом домене.\";'),('ru','messages:upload-curl-error28','s:70:\"Время, отведённое на загрузку, истекло\";'),('ru','messages:upload-curl-error28-text','s:376:\"Сайт слишком долго не отвечает. \nПожалуйста, проверьте что сайт работоспособен и после небольшого перерыва попробуйте ещё раз. Возможно, операцию следует провести в другое время, когда сайт менее нагружен.\";'),('ru','messages:upload-curl-error6','s:77:\"Невозможно обратить по указанному адресу.\";'),('ru','messages:upload-curl-error6-text','s:179:\"Невозможно обратить по указанному адресу. Пожалуйста, проверьте, что адрес верен, а сайт доступен.\";'),('ru','messages:upload-default-description','s:1:\"-\";'),('ru','messages:upload-description','s:27:\"Описание файла\";'),('ru','messages:upload-dialog-button-back','s:10:\"Назад\";'),('ru','messages:upload-dialog-button-cancel','s:16:\"Отменить\";'),('ru','messages:upload-dialog-button-done','s:12:\"Готово\";'),('ru','messages:upload-dialog-button-save','s:18:\"Сохранить\";'),('ru','messages:upload-dialog-button-upload','s:18:\"Загрузить\";'),('ru','messages:upload-dialog-disabled','s:167:\"На этом вики-сайте отключена возможность загрузки файлов с помощью этого диалогового окна.\";'),('ru','messages:upload-dialog-title','s:27:\"Загрузить файл\";'),('ru','messages:upload-disallowed-here','s:66:\"Вы не можете перезаписать этот файл.\";'),('ru','messages:upload-file-error','s:33:\"Внутренняя ошибка\";'),('ru','messages:upload-file-error-text','s:223:\"Внутренняя ошибка при попытке создать временный файл на сервере.\nПожалуйста, обратитесь к [[Special:ListUsers/sysop|администратору]].\";'),('ru','messages:upload-foreign-cant-load-config','s:146:\"Не удалось загрузить конфигурацию загрузки файлов на внешнее хранилище файлов.\";'),('ru','messages:upload-foreign-cant-upload','s:164:\"Эта вики не настроена для загрузки файлов на запрошенный сторонний файловый репозиторий.\";'),('ru','messages:upload-form-label-infoform-categories','s:18:\"Категории\";'),('ru','messages:upload-form-label-infoform-date','s:8:\"Дата\";'),('ru','messages:upload-form-label-infoform-description','s:16:\"Описание\";'),('ru','messages:upload-form-label-infoform-description-tooltip','s:241:\"Коротко опишите всё самое важное об этом произведении. Для фото — укажите, что главное изображено, обстоятельства съёмки или место.\";'),('ru','messages:upload-form-label-infoform-name','s:6:\"Имя\";'),('ru','messages:upload-form-label-infoform-name-tooltip','s:287:\"Уникальный описательный заголовок для файла, который будет сохранён как его название. Можете использовать простой язык и пробелы. Не указывайте расширение.\";'),('ru','messages:upload-form-label-infoform-title','s:22:\"Подробности\";'),('ru','messages:upload-form-label-not-own-work-local-generic-foreign','s:300:\"В том случае, если этот файл может быть загружен в соответствии с правилами сайта {{SITENAME}}, вы также можете попробовать использовать его [[Special:Upload|страницу загрузки]].\";'),('ru','messages:upload-form-label-not-own-work-local-generic-local','s:151:\"Возможно, вы также захотите попробовать [[Special:Upload|страницу загрузки по умолчанию]].\";'),('ru','messages:upload-form-label-not-own-work-message-generic-foreign','s:280:\"Если Вы не можете загрузить этот файл в соответствиями с правилами общего хранилища, пожалуйста, закройте это диалоговое окно и попробуйте другой метод.\";'),('ru','messages:upload-form-label-not-own-work-message-generic-local','s:272:\"Если Вы не можете загрузить этот файл в соответствиями с правилами сайта {{SITENAME}}, пожалуйста, закройте это диалоговое окно и попробуйте другой метод.\";'),('ru','messages:upload-form-label-own-work','s:49:\"Это моя собственная работа\";'),('ru','messages:upload-form-label-own-work-message-generic-foreign','s:288:\"Я понимаю, что загружаю этот файл в общий репозиторий. Я подтверждаю, что я делаю это в соответствии с пользовательским соглашением и лицензионной политикой.\";'),('ru','messages:upload-form-label-own-work-message-generic-local','s:194:\"Я подтверждаю, что загружаю этот файл в соответствиями с правилами и лицензионной политикой сайта {{SITENAME}}.\";'),('ru','messages:upload-form-label-usage-filename','s:17:\"Имя файла\";'),('ru','messages:upload-form-label-usage-title','s:26:\"Использование\";'),('ru','messages:upload-http-error','s:40:\"Произошла ошибка HTTP: $1\";'),('ru','messages:upload-maxfilesize','s:52:\"Максимальный размер файла: $1\";'),('ru','messages:upload-misc-error','s:52:\"Неизвестная ошибка загрузки\";'),('ru','messages:upload-misc-error-text','s:289:\"Неизвестная ошибка загрузки. Пожалуйста, проверьте, что адрес верен, и повторите попытку. Если проблема остаётся, обратитесь к [[Special:ListUsers/sysop|администратору]].\";'),('ru','messages:upload-options','s:35:\"Параметры загрузки\";'),('ru','messages:upload-permitted','s:93:\"{{PLURAL:$2|Разрешённый тип|Разрешённые типы}} файлов: $1.\";'),('ru','messages:upload-preferred','s:113:\"{{PLURAL:$2|Предпочтительный тип|Предпочтительные типы}} файлов: $1.\";'),('ru','messages:upload-prohibited','s:93:\"{{PLURAL:$2|Запрещённый тип|Запрещённые типы}} файлов: $1.\";'),('ru','messages:upload-proto-error','s:41:\"Неправильный протокол\";'),('ru','messages:upload-proto-error-text','s:150:\"Для удалённой загрузки требуется адрес, начинающийся с <code>http://</code> или <code>ftp://</code>.\"