G-файла.\";'),('ru','messages:uploaded-href-attribute-svg','s:479:\"Элементы <a> могут ссылаться (href) только на data: (встроенный файл), ссылки http:// или https:// или фрагмент (#, в том же документе). Для других элементов, таких как <image>, разрешены только data: и фрагмент. Попробуйте внедрить изображения при экспорте SVG. Найдено <code>&lt;$1 $2=\"$3\"&gt;</code>.\";'),('ru','messages:uploaded-href-unsafe-target-svg','s:131:\"В загруженном SVG-файле найдены небезопасные данные: URI <code>&lt;$1 $2=\"$3\"&gt;</code>.\";'),('ru','messages:uploaded-image-filter-svg','s:144:\"В загруженном SVG-файле найден фильтр изображений с URL-адресом <code>&lt;$1 $2=\"$3\"&gt;</code>.\";'),('ru','messages:uploaded-remote-url-svg','s:251:\"SVG, который задаёт любой атрибут стиля с помощью удалённого URL-адреса, блокируется. Найдена конструкция <code>$1=\"$2\"</code> в загруженном SVG-файле.\";'),('ru','messages:uploaded-script-svg','s:144:\"Найден небезопасный элемент с поддержкой сценариев «$1» в загруженном SVG-файле.\";'),('ru','messages:uploaded-setting-event-handler-svg','s:197:\"Установка атрибутов обработчика событий заблокирована, в загруженном SVG-файле найден код <code>&lt;$1 $2=\"$3\"&gt;</code>.\";'),('ru','messages:uploaded-setting-handler-svg','s:265:\"SVG, который задаёт атрибут «handler» с помощью удалённого адреса/данных/скрипта, блокируется. Найдена конструкция <code>$1=\"$2\"</code> в загруженном SVG-файле.\";'),('ru','messages:uploaded-setting-href-svg','s:168:\"Использование тега «set» для добавления атрибута «href» в родительский элемент заблокировано.\";'),('ru','messages:uploaded-wrong-setting-svg','s:342:\"Использование тега «set» для добавления в качестве цели удалённого адреса/данных/сценария для любого атрибута заблокировано. В загруженном SVG-файле найдена конструкция <code>&lt;set to=\"$1\"&gt;</code>.\";'),('ru','messages:uploadedimage','s:17:\"uploaded \"[[$1]]\"\";'),('ru','messages:uploaderror','s:40:\"Ошибка загрузки файла\";'),('ru','messag