стить временные файлы\";'),('ru','messages:uploadstash-errclear','s:48:\"Очистка файлов не удалась.\";'),('ru','messages:uploadstash-exception','s:112:\"Не удалось сохранить загрузку во временное хранилище ($1): «$2».\";'),('ru','messages:uploadstash-file-not-found','s:77:\"Ключ «$1» не найден во временном хранилище.\";'),('ru','messages:uploadstash-file-not-found-missing-content-type','s:55:\"Отсутствует заголовок content-type.\";'),('ru','messages:uploadstash-file-not-found-no-local-path','s:115:\"Не найдено локального пути к отмасштабированному изображению.\";'),('ru','messages:uploadstash-file-not-found-no-remote-thumb','s:66:\"Извлечение эскиза не удалось: $1\nURL = $2\";'),('ru','messages:uploadstash-file-not-found-no-thumb','s:56:\"Не удалось получить миниатюру.\";'),('ru','messages:uploadstash-file-not-found-not-exists','s:62:\"Путь не найден или файл непонятен.\";'),('ru','messages:uploadstash-file-too-large','s:91:\"Невозможно обработать файл размером более $1 байт.\";'),('ru','messages:uploadstash-no-such-key','s:62:\"Нет ключа ($1), удаление невозможно.\";'),('ru','messages:uploadstash-nofiles','s:49:\"У вас нет временных файлов.\";'),('ru','messages:uploadstash-not-logged-in','s:128:\"Нет авторизованных участников, файлы должны принадлежать участникам.\";'),('ru','messages:uploadstash-refresh','s:42:\"Обновить список файлов\";'),('ru','messages:uploadstash-summary','s:368:\"Данная страница предоставляет доступ к файлам, которые были загружены (или находятся в процессе загрузки), но ещё не были опубликованы в вики. Эти файлы никому не видны, кроме загрузившего их участника.\";'),('ru','messages:uploadstash-thumbnail','s:35:\"показать миниатюру\";'),('ru','messages:uploadstash-wrong-owner','s:87:\"Этот файл ($1) не принадлежит текущему участнику.\";'),('ru','messages:uploadstash-zero-length','s:35:\"Файл нулевой длины.\";'),('ru','messages:uploadtext','s:1369:\"Воспользуйтесь этой формой для загрузки файлов на сервер.\nЧтобы просмотреть ранее загруженные файлы, обратитесь к [[Special:FileList|списку загруженных файлов]]. Загрузка файлов также записывается в [[Special:Log/upload|журнал загрузок]]; данные об удалённых файлах можно найти в [[Special:Log/delete|журнале удалений]].\n\nДля включения файла в статью вы можете использовать строки вида:\n* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong> для вставки полной версии файла;\n* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|описание]]</nowiki></code></strong> для вставки слева от текста уменьшенной до 200 пикселей по ширине версии файла с выводом под ним указанного описания;\n* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong> для вставки ссылки на файл, без отображения его содержимого на странице.\";'),('ru','messages:uploadvirus','s:46:\"Файл содержит вирус! См. $1\";'),('ru','messages:uploadwarning','s:28:\"Предупреждение\";'),('ru','messages:uploadwarning-text','s:143:\"Пожалуйста, измените представленное ниже описание файла и попробуйте ещё раз.\";'),('ru','messages:uploadwarning-text-nostash','s:128:\"Повторите загрузку файла, измените описание ниже и повторите попытку.\";'),('ru','messages:user-mail-no-addy','s:123:\"Пытался отправить электронное письмо без адреса электронной почты\";'),('ru','messages:user-mail-no-body','s:158:\"Пытался отправить электронное письмо с пустым или бессмысленно коротким содержанием.\";'),('ru','messages:usercreated','s:50:\"{{GENDER:$3|Создан|Создана}} $1 в $2\";'),('ru','messages:usercssispublic','s:275:\"Пожалуйста, обратите внимание: подстраницы CSS не должны содержать конфиденциальные сведения, поскольку они доступны для просмотра другим участникам.\";'),('ru','messages:usercsspreview','s:160:\"\'\'\'Помните, что это только предварительный просмотр вашего CSS-файла, он ещё не сохранён!\'\'\'\";'),('ru','messages:usercssyoucanpreview','s:176:\"\'\'\'Подсказка.\'\'\' Нажмите кнопку «{{int:showpreview}}», чтобы пров